    ['$(missioncolor:【伊斯坦堡】)是奥斯曼人的首都，濒临“黄金水道”——马尔马拉海，那里进可攻退可守，形势对我们不利。我们必须攻占$(missioncolor:【塞浦路斯】)和$(missioncolor:【雅典】)才能无后顾之忧。'] = '$(missioncolor:【伊斯坦堡】)是奧斯曼人的首都，瀕臨“黃金水道”——馬爾馬拉海，那裡進可攻退可守，形勢對我們不利。我們必須攻佔$(missioncolor:【塞浦路斯】)和$(missioncolor:【雅典】)才能無後顧之憂。', 
    ['$(missioncolor:【但泽】)是同盟最重要的工业港，也是后勤补给港口，攻占这里，汉萨同盟的实力至少会削弱一半！'] = '$(missioncolor:【但澤】)是同盟最重要的工業港，也是後勤補給港口，攻佔這裡，漢薩同盟的實力至少會削弱一半！', 
    ['$(missioncolor:【卑尔根】)是卢卡斯势力的门户，也是最重要的货运良港！只要占领它，就能切断北欧海盗50%以上的补给！'] = '$(missioncolor:【卑爾根】)是盧卡斯勢力的門戶，也是最重要的貨運良港！只要佔領它，就能切斷北歐海盜50%以上的補給！', 
    ['$(missioncolor:【塞浦路斯】)是扼守亚欧非的海上要冲，历来是必争之地。只要占领它，就能切断奥斯曼人入侵地中海的命脉。'] = '$(missioncolor:【塞浦路斯】)是扼守亞歐非的海上要衝，歷來是必爭之地。只要佔領它，就能切斷奧斯曼人入侵地中海的命脈。', 
    ['$(missioncolor:【奥斯陆】)——来自于古老的挪威语，一个是“草地”一个是“神”的意思。我曾经在此处停泊，这里的漂亮的姑娘和艺术品一样的出名。'] = '$(missioncolor:【奧斯陸】)——來自於古老的挪威語，一個是“草地”一個是“神”的意思。我曾經在此處停泊，這裡的漂亮的姑娘和藝術品一樣的出名。', 
    ['$(missioncolor:【威尼斯】)可是地中海最繁荣的商业之邦，那里云集来自世界各地的商人，确实是个不错的藏身之所。这个小家伙倒真会挑地方。'] = '$(missioncolor:【威尼斯】)可是地中海最繁榮的商業之邦，那裡雲集來自世界各地的商人，確實是個不錯的藏身之所。這個小家伙倒真會挑地方。', 
    ['$(missioncolor:【威尼斯】)可是地中海最繁荣的商业之邦，那里云集来自世界各地的商人，确实是个不错的藏身之所。这个小家伙可真会挑地方啊。'] = '$(missioncolor:【威尼斯】)可是地中海最繁榮的商業之邦，那裡雲集來自世界各地的商人，確實是個不錯的藏身之所。這個小家伙可真會挑地方啊。', 
    ['$(missioncolor:【斯德哥尔摩】)位于这三个港口的东侧，是敌人最重要的补给港口，只要占领它，就能让敌人战线无以为继！'] = '$(missioncolor:【斯德哥爾摩】)位於這三個港口的東側，是敵人最重要的補給港口，只要佔領它，就能讓敵人戰線無以為繼！', 
    ['$(missioncolor:【里加】)地处北海与波罗的海的交通要冲，被称为“波罗的海跳动的心脏”，是汉萨同盟垄断北方贸易的枢纽！攻击它，就能切断敌人伸向半岛的触手！'] = '$(missioncolor:【裡加】)地處北海與波羅的海的交通要衝，被稱為“波羅的海跳動的心臟”，是漢薩同盟壟斷北方貿易的樞紐！攻擊它，就能切斷敵人伸向半島的觸手！', 
    ['$(missioncolor:【阿姆斯特丹】)是汉萨同盟的贸易中心！汉萨同盟对于这里的防护绝对不能小视。或许有个简单的办法，集中火力，轰破大坝，这样……'] = '$(missioncolor:【阿姆斯特丹】)是漢薩同盟的貿易中心！漢薩同盟對於這裡的防護絕對不能小視。或許有個簡單的辦法，集中火力，轟破大壩，這樣……', 
    ['$(missioncolor:【阿尔金】)航线的确是暗礁密布，危险重重，但和凶残的海盗相比还是略逊一筹，有多少勇敢的冒险家躲过了暗礁却最终被残忍的海盗割断了脖子。'] = '$(missioncolor:【阿爾金】)航線的確是暗礁密佈，危險重重，但和凶殘的海盜相比還是略遜一籌，有多少勇敢的冒險家躲過了暗礁卻最終被殘忍的海盜割斷了脖子。', 
    ['$(missioncolor:【马六甲】)位于马来半岛的西南侧，扼守马六甲海峡，地理位置险要，是兵家必争之地。这次战役我们必须和张保仔紧密配合，避免受到两面夹击。'] = '$(missioncolor:【馬六甲】)位於馬來半島的西南側，扼守馬六甲海峽，地理位置險要，是兵家必爭之地。這次戰役我們必須和張保仔緊密配合，避免受到兩面夾擊。', 
    ['$(missioncolor:【马六甲】)是东印度公司占领的最后一个港口了，易守难攻，地方难免会负隅顽抗，我们需要张保仔的帮助。'] = '$(missioncolor:【馬六甲】)是東印度公司佔領的最後一個港口了，易守難攻，地方難免會負隅頑抗，我們需要張保仔的幫助。', 
    ['$(missioncolor:【马赛】)是个鱼龙混杂的地方，可以去那里打听打听。'] = '$(missioncolor:【馬賽】)是個魚龍混雜的地方，可以去那裡打聽打聽。', 
    ['$(touch:["BOSS_REWARD_TAG"])商会已击垮大海盗，并搜获大量宝箱$(c:COLOR_GREEN)【点击查看】'] = '$(touch:["BOSS_REWARD_TAG"])商會已擊垮大海盜，並搜獲大量寶箱$(c:COLOR_GREEN)【點擊查看】', 
    ['$(touch:["BOSS_TAG"])商会已开启对大海盗的讨伐$(c:COLOR_GREEN)【点击查看】'] = '$(touch:["BOSS_TAG"])商會已開啟對大海盜的討伐$(c:COLOR_GREEN)【點擊查看】', 
    ['$(touch:["GUILD_GIFT_TAG"])%s刚对商会进行了一笔捐献，所有人都可获得商会礼包，请船长前往$(c:COLOR_GREEN)【商会仓库】$(c:COLOR_YELLOW)领取。'] = '$(touch:["GUILD_GIFT_TAG"])%s剛對商會進行了一筆捐獻，所有人都可獲得商會禮包，請船長前往$(c:COLOR_GREEN)【商會倉庫】$(c:COLOR_YELLOW)領取。', 
    ['$(touch:["GUILD_TASK_TAG","%s"])%s发布了多人任务《%s》，当前参与人数%s/3$(c:COLOR_GREEN)【点击查看】'] = '$(touch:["GUILD_TASK_TAG","%s"])%s發佈了多人任務《%s》，當前參與人數%s/3$(c:COLOR_GREEN)【點擊查看】', 
    ['$(touch:["SHARE_TAG","%s"])$(c:COLOR_GREEN)%s$(c:COLOR_CREAM)的商品正在热销！前3位$(c:COLOR_GREEN)点击这条消息$(c:COLOR_CREAM)的小伙伴即可共享热销状态~'] = '$(touch:["SHARE_TAG","%s"])$(c:COLOR_GREEN)%s$(c:COLOR_CREAM)的商品正在熱銷！前3位$(c:COLOR_GREEN)點擊這條消息$(c:COLOR_CREAM)的小伙伴即可共享熱銷狀態~', 
    ['$(usename) 船长，听说长官找你了，有什么要紧事吗？'] = '$(usename) 船長，聽說長官找你了，有什麼要緊事嗎？', 
    ['$(usename)!你竟敢击沉我的商船！你会后悔的！'] = '$(usename)!你竟敢擊沉我的商船！你會後悔的！', 
    ['$(usename),我已经摸到了田鼠号了，我要先闪了哈。'] = '$(usename),我已經摸到了田鼠號了，我要先閃了哈。', 
    ['$(usename),打完“田鼠号”这里会出现第二个对手哦。'] = '$(usename),打完“田鼠號”這裡會出現第二個對手哦。', 
    ['$(usename),打完第二个目标，这里又会出现一个对手呢。'] = '$(usename),打完第二個目標，這裡又會出現一個對手呢。', 
    ['$(usename),现在说话的目标就是我啦，怎么样？觉得明显吗？'] = '$(usename),現在說話的目標就是我啦，怎麼樣？覺得明顯嗎？', 
    ['$(usename),看看第一个目标“田鼠号”！接下来，我会不管诱饵的存在，直接以田鼠号为目标。'] = '$(usename),看看第一個目標“田鼠號”！接下來，我會不管誘餌的存在，直接以田鼠號為目標。', 
    ['$(usename),这里有一个坐标（100,800），敌人要过来这里的，看看它是否会一直亮着提示你吧。'] = '$(usename),這裡有一個坐標（100,800），敵人要過來這裡的，看看它是否會一直亮著提示你吧。', 
    ['$(usename)你这碍手碍脚的家伙！真的以为能阻止我占领卡利卡特吗？'] = '$(usename)你這礙手礙腳的家伙！真的以為能阻止我佔領卡利卡特嗎？', 
    ['$(usename)船长！真荣幸见到你，你跟奥斯曼人作战的消息已经传遍了整个城市，大家都十分敬佩你的勇气呢！当然，也有不少光说不练的家伙嘲笑你的鲁莽，你别介意，他们要是行早就让他们上了。'] = '$(usename)船長！真榮幸見到你，你跟奧斯曼人作戰的消息已經傳遍了整個城市，大家都十分敬佩你的勇氣呢！當然，也有不少光說不練的家伙嘲笑你的魯莽，你別介意，他們要是行早就讓他們上了。', 
    ['%d次委任共收益%d金币'] = '%d次委任共收益%d金幣', 
    ['%d级%s'] = '%d級%s', 
