    ['1562年，浙江倭寇平息后，福建倭寇日甚，因兵将怯懦，戚继光受命领兵6000入闵，视福建倭寇情形决定先捣毁横屿倭寇。横屿之战中，戚继光智令将士以稻草填壕，遂打破横屿。'] = '1562年，浙江倭寇平息後，福建倭寇日甚，因兵將怯懦，戚繼光受命領兵6000入閔，視福建倭寇情形決定先搗毀橫嶼倭寇。橫嶼之戰中，戚繼光智令將士以稻草填壕，遂打破橫嶼。', 
    ['1568年，弗朗西斯•德雷克与表兄霍金斯代理5艘贩奴船前往墨西哥受到风暴袭击，船只受到严重损坏。'] = '1568年，弗朗西斯•德雷克與表兄霍金斯代理5艘販奴船前往墨西哥受到風暴襲擊，船隻受到嚴重損壞。', 
    ['1577年，德雷克再次从英国出发，乘着旗舰“金鹿”号直奔美洲沿岸，一路打劫西班牙商船，后在追击中逃往南方，在风暴中来到西班牙人也未曾到过的地方，这片汪洋大海，直到今天还被我们称为“德雷克海峡”。'] = '1577年，德雷克再次從英國出發，乘著旗艦“金鹿”號直奔美洲沿岸，一路打劫西班牙商船，後在追擊中逃往南方，在風暴中來到西班牙人也未曾到過的地方，這片汪洋大海，直到今天還被我們稱為“德雷克海峽”。', 
    ['1588年7月，英西两国正式开战，英军在弗朗西斯•德雷克建议下采取古老的火船战术，向敌方舰队发起突击。战后英国成为海上霸主，德雷克被封英格兰勋爵……'] = '1588年7月，英西兩國正式開戰，英軍在弗朗西斯•德雷克建議下採取古老的火船戰術，向敵方艦隊發起突擊。戰後英國成為海上霸主，德雷克被封英格蘭勛爵……', 
    ['1591年，经宰相柳成龙举荐，47岁的李舜臣出任全罗左道水师节度使。当时，日本正积极着手进行侵朝战争准备，李舜臣临危受命，到职后加强海军建设，并建造铁甲“龟船”，为反侵略战争做好准备。'] = '1591年，經宰相柳成龍舉薦，47歲的李舜臣出任全羅左道水師節度使。當時，日本正積極著手進行侵朝戰爭準備，李舜臣臨危受命，到職後加強海軍建設，並建造鐵甲“龜船”，為反侵略戰爭做好準備。', 
    ['1592年4月，日军水陆并进，占领大半个朝鲜半岛。在陆地屡战屡败的情况下，李舜臣部连战连捷。日方水陆并进计划受阻，利用朝鲜党争使计离间，李舜臣被革职下狱。重新被起用后，李舜臣重整舰队鏖战日军，一心坚持抗战。'] = '1592年4月，日軍水陸併進，佔領大半個朝鮮半島。在陸地屢戰屢敗的情況下，李舜臣部連戰連捷。日方水陸併進計劃受阻，利用朝鮮黨爭使計離間，李舜臣被革職下獄。重新被起用後，李舜臣重整艦隊鏖戰日軍，一心堅持抗戰。', 
    ['1592年，日本关白丰臣秀吉将日本国内群雄战乱平息，随即把目光投向了一水相隔的朝鲜国，希望将羸弱的朝鲜国纳入自己的权利版图。因为朝鲜国方面的求助，也因为唇齿相依的关系，中国明万历皇帝决定加入战争，援助朝鲜抵抗如日中天的日本。连番激烈的战事在朝鲜国境上进行，而作为对日本方面的物资补给及战事局势有着决定性影响的海上航区争夺战，亦在朝鲜沿海不断打响。'] = '1592年，日本關白豐臣秀吉將日本國內群雄戰亂平息，隨即把目光投向了一水相隔的朝鮮國，希望將羸弱的朝鮮國納入自己的權利版圖。因為朝鮮國方面的求助，也因為唇齒相依的關係，中國明萬曆皇帝決定加入戰爭，援助朝鮮抵抗如日中天的日本。連番激烈的戰事在朝鮮國境上進行，而作為對日本方面的物資補給及戰事局勢有著決定性影響的海上航區爭奪戰，亦在朝鮮沿海不斷打響。', 
    ['15级海盗'] = '15級海盜', 
    ['1635年亨利·摩根出生在威尔士的一个大户人家的庄园，后作为契约工人前往加勒比海，很快在牙买加岛应征成为英军士兵。'] = '1635年亨利•摩根出生在威爾士的一個大戶人家的莊園，後作為契約工人前往加勒比海，很快在牙買加島應征成為英軍士兵。', 
    ['1645年，郑芝龙、郑鸿逵兄弟在福州奉明唐王朱聿键为帝，年号隆武，郑芝龙被册封为南安候，负责南明所有军事事务，一时间权顷朝野，短短的几个月时光是郑芝龙政治生涯的顶峰。'] = '1645年，鄭芝龍、鄭鴻逵兄弟在福州奉明唐王朱聿鍵為帝，年號隆武，鄭芝龍被冊封為南安候，負責南明所有軍事事務，一時間權頃朝野，短短的幾個月時光是鄭芝龍政治生涯的頂峰。', 
    ['1689年，英国再次和法国开战，威廉·基德应征入伍，不仅在战争期间成功维持美国与英国之间的贸易航道，并屡建战功，成为战斗英雄，受英国女皇嘉奖。威廉·基德志得意满、意气风发，于不久后成婚。'] = '1689年，英國再次和法國開戰，威廉•基德應征入伍，不僅在戰爭期間成功維持美國與英國之間的貿易航道，並屢建戰功，成為戰鬥英雄，受英國女皇嘉獎。威廉•基德志得意滿、意氣風發，於不久後成婚。', 
    ['1698年，威廉·基德打着法国的旗号劫掠了一艘船籍为亚美尼亚的商船——奎达商人号，消息传回伦敦，威廉·基德被认定为海盗。从成功商人到战争英雄，且最后沦为恶贯满盈的海盗，欲望与贪婪使威廉·基德变得多面。'] = '1698年，威廉•基德打著法國的旗號劫掠了一艘船籍為亞美尼亞的商船——奎達商人號，消息傳回倫敦，威廉•基德被認定為海盜。從成功商人到戰爭英雄，且最後淪為惡貫滿盈的海盜，欲望與貪婪使威廉•基德變得多面。', 
    ['16世纪世界上最好的商船之一，这种船运载贵重货物，运费很高。它们实力强大，能抵御海盗的侵袭，因此一些商人认为没有必要给这种船运载的货物上保险。'] = '16世紀世界上最好的商船之一，這種船運載貴重貨物，運費很高。它們實力強大，能抵禦海盜的侵襲，因此一些商人認為沒有必要給這種船運載的貨物上保險。', 
    ['16岁，华裔葡萄牙人。天真烂漫的少女，聪慧热情，有温暖人心的力量。祖父是劫富济贫的海盗、父亲是正直勤恳的海商，对自己该走哪条路一直摇摆不定。'] = '16歲，華裔葡萄牙人。天真爛漫的少女，聰慧熱情，有溫暖人心的力量。祖父是劫富濟貧的海盜、父親是正直勤懇的海商，對自己該走哪條路一直搖擺不定。', 
    ['16级海盗'] = '16級海盜', 
    ['1715年7月，一艘西班牙宝船在佛洲外海被飓风打沉。为了迎娶玛利亚，改善贫困的生活，萨姆·贝拉米决定出海打捞沉没的西班牙宝船，可惜萨姆都什么都没有找到。'] = '1715年7月，一艘西班牙寶船在佛洲外海被颶風打沉。為了迎娶瑪利亞，改善貧困的生活，薩姆•貝拉米決定出海打撈沉沒的西班牙寶船，可惜薩姆都什麼都沒有找到。', 
    ['1717年萨姆·贝拉米成功掠夺英籍大型贩奴船－维达号，并以之为旗舰，借由维达号的重装武力，成为当时北美洲东岸海域最令人闻风丧胆的海盗之一。'] = '1717年薩姆•貝拉米成功掠奪英籍大型販奴船－維達號，並以之為旗艦，藉由維達號的重裝武力，成為當時北美洲東岸海域最令人聞風喪膽的海盜之一。', 
    ['17级海盗'] = '17級海盜', 
    ['18岁，葡萄牙人。父亲是个小商人，靠着勤劳和诚信成为小船主。里奥比父亲更有冒险精神，在继承父亲的帆船后开始盘算着如何扬名立万。'] = '18歲，葡萄牙人。父親是個小商人，靠著勤勞和誠信成為小船主。里奧比父親更有冒險精神，在繼承父親的帆船後開始盤算著如何揚名立萬。', 
    ['18级海盗'] = '18級海盜', 
    ['1987年7月，李舜臣与陈磷、邓子龙组成中朝联合舰队，与日方海军进行了一场规模空前的海上决战——露梁海战，此战中中方将领邓子龙壮烈牺牲，李舜臣身中流弹身亡。死前，李舜臣叮嘱侄儿李莞代为指挥坚持抗战。'] = '1987年7月，李舜臣與陳磷、鄧子龍組成中朝聯合艦隊，與日方海軍進行了一場規模空前的海上決戰——露梁海戰，此戰中中方將領鄧子龍壯烈犧牲，李舜臣身中流彈身亡。死前，李舜臣叮囑侄兒李莞代為指揮堅持抗戰。', 
    ['19岁，西班牙人。加泰罗尼亚大乡绅之女，美丽而自信，在父亲的资助下成为一名航海家，比普通人更加努力，讨厌别人称她为“徒有其表的富家女”。'] = '19歲，西班牙人。加泰羅尼亞大鄉紳之女，美麗而自信，在父親的資助下成為一名航海家，比普通人更加努力，討厭別人稱她為“徒有其表的富家女”。', 
