    ['“世界的尽头”就在西南方的大洋深处，那里是一片蛮荒的所在，未知的危险潜藏在蔚蓝大海之中。起锚，觐见海洋女神！'] = '“世界的盡頭”就在西南方的大洋深處，那裡是一片蠻荒的所在，未知的危險潛藏在蔚藍大海之中。起錨，覲見海洋女神！', 
