    ['“冒险号”竟然打起了莫卧儿王朝的大型运宝船“吉达号”的主意，击退海盗，可是有不菲的酬劳的。'] = '“冒險號”竟然打起了莫臥兒王朝的大型運寶船“吉達號”的主意，擊退海盜，可是有不菲的酬勞的。', 
    ['“十八芝”是南中国海实力最强的海盗团伙，几乎所有经过的船只都深受其害，如果能协助官府进行打击，应该对沿海的贸易稳定有极大的帮助。'] = '“十八芝”是南中國海實力最強的海盜團夥，幾乎所有經過的船隻都深受其害，如果能協助官府進行打擊，應該對沿海的貿易穩定有極大的幫助。', 
    ['“协议达成，速回'] = '“協議達成，速回', 
