    ['一次，多索·贝利欧面对艳遇不屑一顾，原来他早已心有所属，现在之所以一心寻宝，便是为了娶到自己的梦中情人。'] = '一次，多索•貝利歐面對艷遇不屑一顧，原來他早已心有所屬，現在之所以一心尋寶，便是為了娶到自己的夢中情人。', 
