    ['一种以【葡萄】为原料西班牙香槟酒，气泡细腻丰富，口感比法国香槟更加柔和，略带面包发酵的酸甜香气。'] = '一種以【葡萄】為原料西班牙香檳酒，氣泡細膩豐富，口感比法國香檳更加柔和，略帶麵包發酵的酸甜香氣。', 
    ['一种包含金属铁的矿石，锻造【刀剑、洋枪、武士刀】等武器时都会用到。'] = '一種包含金屬鐵的礦石，鍛造【刀劍、洋槍、武士刀】等武器時都會用到。', 
    ['一种古老的器物，人们将黏土捏制成形后，高温烧制成实用的陶器。'] = '一種古老的器物，人們將黏土捏製成形後，高溫燒製成實用的陶器。', 
    ['一种可以将声音扩大放出的神奇乐器。'] = '一種可以將聲音擴大放出的神奇樂器。', 
