    ['一种小巧的香料植物，花色鲜艳，芳香四溢，在干燥炎热的环境下生长的最好。'] = '一種小巧的香料植物，花色鮮艷，芳香四溢，在干燥炎熱的環境下生長的最好。', 
    ['一种常见坚果，分布广泛，可以用来榨油。'] = '一種常見堅果，分佈廣泛，可以用來榨油。', 
    ['一种常见餐后甜酒，以【柠檬】的外皮为原料制成，在意大利南部的拉古萨湾地区较为流行。'] = '一種常見餐後甜酒，以【檸檬】的外皮為原料製成，在意大利南部的拉古薩灣地區較為流行。', 
    ['一种热带水果，喜欢生长在温暖干燥的山地，果肉香味浓郁，酸甜可口，一次吃太多可能会口舌发麻。'] = '一種熱帶水果，喜歡生長在溫暖干燥的山地，果肉香味濃郁，酸甜可口，一次吃太多可能會口舌發麻。', 
    ['一种热带水果，果肉柔软且甘甜多汁，但并不是所有人都喜欢这种味道。'] = '一種熱帶水果，果肉柔軟且甘甜多汁，但並不是所有人都喜歡這種味道。', 
    ['一种热带水果，肉质甜软，外壳坚硬，表面有坚硬的凸起。'] = '一種熱帶水果，肉質甜軟，外殼堅硬，錶面有堅硬的凸起。', 
    ['一种生长在热带的香料，气味芳香清凉，味道辣中带苦。'] = '一種生長在熱帶的香料，氣味芳香清涼，味道辣中帶苦。', 
    ['一种用【蚕丝】制成的衣料，不仅柔软光滑、色泽绚丽，还带有让人迷醉的高贵光泽。'] = '一種用【蠶絲】製成的衣料，不僅柔軟光滑、色澤絢麗，還帶有讓人迷醉的高貴光澤。', 
    ['一种稀有的天然矿物，带有美丽的透明光泽，是打造【宝石首饰】的好材料。'] = '一種稀有的天然礦物，帶有美麗的透明光澤，是打造【寶石首飾】的好材料。', 
    ['一种粮食作物，可以用来制造营养丰富的豆制品，但食用太多的话，常常让人忍不住释放出令人尴尬的气味。'] = '一種糧食作物，可以用來製造營養豐富的豆製品，但食用太多的話，常常讓人忍不住釋放出令人尷尬的氣味。', 
    ['一种精巧的民间工艺，质地坚韧的【红木、花梨木】都是雕刻复杂作品的上等材料。'] = '一種精巧的民間工藝，質地堅韌的【紅木、花梨木】都是雕刻複雜作品的上等材料。', 
    ['一种红色的硬木，带有天然形成的花纹，材质坚硬耐磨，适合打造贵重家具，或【木雕、木器、巴厘木雕】等工艺品。'] = '一種紅色的硬木，帶有天然形成的花紋，材質堅硬耐磨，適合打造貴重傢具，或【木雕、木器、巴釐木雕】等工藝品。', 
    ['一种营养丰富但是咬起来非常吃力的水果，含糖量较高的甘蔗通常用来生产【朗姆酒、黑糖、蔗糖】。'] = '一種營養豐富但是咬起來非常吃力的水果，含糖量較高的甘蔗通常用來生產【朗姆酒、黑糖、蔗糖】。', 
    ['一种质地很软的金属，常用来打造【银饰】。与黄金一样，白银一直是财富的象征。'] = '一種質地很軟的金屬，常用來打造【銀飾】。與黃金一樣，白銀一直是財富的象征。', 
    ['一种身体扁长的鱼，喜欢生活在寒冷的海水里，肉质白细鲜嫩，口感清淡不腻，可以提炼【鱼油】。'] = '一種身體扁長的魚，喜歡生活在寒冷的海水裡，肉質白細鮮嫩，口感清淡不膩，可以提煉【魚油】。', 
