    ['一种辣味蔬菜，能增进食欲，也是制作【咖喱】的主要原料。'] = '一種辣味蔬菜，能增進食欲，也是製作【咖喱】的主要原料。', 
    ['一种透明物质，最初从火山喷出的酸性岩中凝固而得，制造技术纯熟后，常用来吹制【玻璃器皿】等工艺品。'] = '一種透明物質，最初從火山噴出的酸性岩中凝固而得，製造技術純熟後，常用來吹制【玻璃器皿】等工藝品。', 
    ['一种铜质重型武器，装上弹药后可以射出较远的距离，火力范围广，威力十分强大。'] = '一種銅質重型武器，裝上彈葯後可以射出較遠的距離，火力範圍廣，威力十分強大。', 
