    ['不好，对方的护卫船发现我们了！先引开它击沉，然后再对付寻宝船吧。'] = '不好，對方的護衛船發現我們了！先引開它擊沉，然後再對付尋寶船吧。', 
    ['不好，我们的盟友需要支援，他刚被海盗偷袭，补给不足。'] = '不好，我們的盟友需要支援，他剛被海盜偷襲，補給不足。', 
    ['不好，敌人早已埋伏在此。'] = '不好，敵人早已埋伏在此。', 
    ['不好，有落难的商人称，卡利卡特再次遭遇围攻，即将沦陷，敌人已将炮塔安置在卡利卡特附近，防止增援舰队，萨尔法王国舰队已损失惨重，萨尔法八世被困在城中。而西印度公司的舰队一支也没有出现。'] = '不好，有落難的商人稱，卡利卡特再次遭遇圍攻，即將淪陷，敵人已將炮塔安置在卡利卡特附近，防止增援艦隊，薩爾法王國艦隊已損失慘重，薩爾法八世被困在城中。而西印度公司的艦隊一支也沒有出現。', 
    ['不好，被包围了，保护商船！别让他们靠近。'] = '不好，被包圍了，保護商船！別讓他們靠近。', 
    ['不好，被发现了！赶快消灭【海盗斥候】，防止他们报信'] = '不好，被髮現了！趕快消滅【海盜斥候】，防止他們報信', 
    ['不好，要被卷进漩涡了'] = '不好，要被卷進漩渦了', 
    ['不妙……那么坚硬的霍金斯号都被轰成这样……先撤'] = '不妙……那麼堅硬的霍金斯號都被轟成這樣……先撤', 
    ['不对，仔细看，中间的船只像商船，船体破损，看来刚经历过战争。'] = '不對，仔細看，中間的船隻像商船，船體破損，看來剛經歷過戰爭。', 
    ['不对，那边有船来了，那旗帜是……是“红胡子”巴巴罗萨！该死，来不及逃走了！'] = '不對，那邊有船來了，那旗幟是……是“紅鬍子”巴巴羅薩！該死，來不及逃走了！', 
    ['不屑园中牡丹，惟爱傲雪寒梅。'] = '不屑園中牡丹，惟愛傲雪寒梅。', 
    ['不得不承认，你的好运气确实让我很嫉妒。这把武器曾经是“杀手之王”——辉亚·琉斯的心爱之物，居然被你得到了.'] = '不得不承認，你的好運氣確實讓我很嫉妒。這把武器曾經是“殺手之王”——輝亞•琉斯的心愛之物，居然被你得到了.', 
    ['不必了，除了钱之外，老家伙留下的每样东西都让我觉得恶心——当然也包括你！'] = '不必了，除了錢之外，老家伙留下的每樣東西都讓我覺得噁心——當然也包括你！', 
    ['不必慌张，萨格里什是贯穿南北的中转站，龙蛇混杂之地，可以到那里去寻找需要的线索吧。'] = '不必慌張，薩格裡什是貫穿南北的中轉站，龍蛇混雜之地，可以到那裡去尋找需要的線索吧。', 
    ['不必考虑了，我要让这个贪婪的家伙付出代价。'] = '不必考慮了，我要讓這個貪婪的家伙付出代價。', 
    ['不愧是专业的……等等，这个箱子上的纹饰怎么和宝石上的花纹如此相似。我一定要尽快搞清楚这个秘密！'] = '不愧是專業的……等等，這個箱子上的紋飾怎麼和寶石上的花紋如此相似。我一定要儘快搞清楚這個秘密！', 
    ['不明错误'] = '不明錯誤', 
    ['不是任命水手'] = '不是任命水手', 
    ['不是商会之星不能领奖'] = '不是商會之星不能領獎', 
    ['不是所有布伦希尔德都有她的齐格弗里德。'] = '不是所有布倫希爾德都有她的齊格弗里德。', 
    ['不是！不是海盗！当时政府正为印度洋上的海盗发愁，我是为国效力！为国效力！'] = '不是！不是海盜！當時政府正為印度洋上的海盜發愁，我是為國效力！為國效力！', 
    ['不止一座港口叫圣乔治。'] = '不止一座港口叫聖喬治。', 
    ['不止你哥哥，你还深受许多百姓爱戴。'] = '不止你哥哥，你還深受許多百姓愛戴。', 
    ['不用在意，看轻你的人终将为他们的轻浮付出代价……（轻声）至于他为什么不向我们动手，自然是因为……'] = '不用在意，看輕你的人終將為他們的輕浮付出代價……（輕聲）至於他為什麼不向我們動手，自然是因為……', 
    ['不用找了，在游戏里加尔各答是印度东岸唯一的港口。'] = '不用找了，在遊戲裡加爾各答是印度東岸唯一的港口。', 
    ['不用找了，女神之誓应该已经不在此处，我们进攻汪直之时，有一支船队已经悄悄离开此处朝$(missioncolor:【大阪】)去了。'] = '不用找了，女神之誓應該已經不在此處，我們進攻汪直之時，有一支船隊已經悄悄離開此處朝$(missioncolor:【大阪】)去了。', 
    ['不用拍马屁！不过也没说错，我因为在战争中的出色表现得到女皇嘉奖，志得意满，结婚生子，直到在伦敦认识贝洛蒙特勋爵。'] = '不用拍馬屁！不過也沒說錯，我因為在戰爭中的出色表現得到女皇嘉獎，志得意滿，結婚生子，直到在倫敦認識貝洛蒙特勛爵。', 
    ['不用斥责这位小兄弟，我的确是用过一些手段。'] = '不用斥責這位小兄弟，我的確是用過一些手段。', 
    ['不用着急，慢慢来，先从英军士兵开始。'] = '不用著急，慢慢來，先從英軍士兵開始。', 
    ['不用装扮，我本来就是商人！只要经商的利益确实落入我的钱包，我现在就可以动身。'] = '不用裝扮，我本來就是商人！只要經商的利益確實落入我的錢包，我現在就可以動身。', 
    ['不知何时才能找到关于族人的消息，哎……'] = '不知何時才能找到關於族人的消息，哎……', 
    ['不知死活的奴隶，居然趁机反抗！'] = '不知死活的奴隸，居然趁機反抗！', 
    ['不知死活，我们的忍耐可是有限度的，要逃命趁早！'] = '不知死活，我們的忍耐可是有限度的，要逃命趁早！', 
    ['不知道是不是我的错觉，我总感觉幸运女神要远离我们了。'] = '不知道是不是我的錯覺，我總感覺幸運女神要遠離我們了。', 
    ['不知道，可能中国人的饮食和我们真的很不同呢，总之我们只管找食材，【马尼拉】的【荔枝】是吧？'] = '不知道，可能中國人的飲食和我們真的很不同呢，總之我們只管找食材，【馬尼拉】的【荔枝】是吧？', 
    ['不祥的预兆'] = '不祥的預兆', 
    ['不祥的预兆，赶回'] = '不祥的預兆，趕回', 
    ['不等了,全速前进。'] = '不等了,全速前進。', 
    ['不管别人如何看，我对您是佩服的，大叔。'] = '不管別人如何看，我對您是佩服的，大叔。', 
    ['不管如何，“魔鬼之手--佛得角”就在西南方，第一步的计划，就是征服这片让先辈闻之色变的海域，到佛得角去！'] = '不管如何，“魔鬼之手--佛得角”就在西南方，第一步的計劃，就是征服這片讓先輩聞之色變的海域，到佛得角去！', 
    ['不管如何，他都不该出现在这条航线上，到【普利茅斯】找到德雷克，必须让他给一个说法！'] = '不管如何，他都不該出現在這條航線上，到【普利茅斯】找到德雷克，必須讓他給一個說法！', 
    ['不管怎么样，当务之急就是帮助这片曾经美丽的土地恢复原来的面貌吧。'] = '不管怎麼樣，當務之急就是幫助這片曾經美麗的土地恢複原來的面貌吧。', 
    ['不管怎么样，肃清了盘踞在比绍的海盗，总算让新航线安全一些了，努力让比绍成为崭新的贸易港口吧。'] = '不管怎麼樣，肅清了盤踞在比紹的海盜，總算讓新航線安全一些了，努力讓比紹成為嶄新的貿易港口吧。', 
    ['不管怎么说，这看起来是个做生意的好地方，让我们到市政厅办理贸易许可证吧。'] = '不管怎麼說，這看起來是個做生意的好地方，讓我們到市政廳辦理貿易許可證吧。', 
    ['不管怎样，我们必须做好应对的准备，敌人可是很快就会反扑回来的呢。'] = '不管怎樣，我們必須做好應對的準備，敵人可是很快就會反撲回來的呢。', 
    ['不管是上流社会的贵妇人，还是放浪形骸的市井女子，她们下午茶的谈资里总不会缺少这样一个名字--“黑男爵”巴塞洛缪·罗伯茨。这个据说是有史以来最绅士的海盗王，有着俊朗的相貌和高雅的谈吐，胡子永远保持干净整齐，喜欢穿着华丽的红色外套和戴着红色羽翎装饰的宽檐帽。行动儒雅端庄，不酗酒，甚至喜欢喝清茶，还每天坚持在他的船长室做祷告，就像每一个在圣保罗教堂祷告的教徒一般谦卑虔诚。而除了良好的做派，他为手下散漫凶悍的海盗制定了“海盗10诫”，还有他果敢准确的指挥能力更是为人所津津乐道。'] = '不管是上流社會的貴婦人，還是放浪形骸的市井女子，她們下午茶的談資里總不會缺少這樣一個名字--“黑男爵”巴塞洛繆•羅伯茨。這個據說是有史以來最紳士的海盜王，有著俊朗的相貌和高雅的談吐，鬍子永遠保持乾淨整齊，喜歡穿著華麗的紅色外套和戴著紅色羽翎裝飾的寬檐帽。行動儒雅端莊，不酗酒，甚至喜歡喝清茶，還每天堅持在他的船長室做禱告，就像每一個在聖保羅教堂禱告的教徒一般謙卑虔誠。而除了良好的做派，他為手下散漫凶悍的海盜制定了“海盜10誡”，還有他果敢準確的指揮能力更是為人所津津樂道。', 
    ['不管现在还是未来，科学和宗教都可以共存。'] = '不管現在還是未來，科學和宗教都可以共存。', 
    ['不能任命相同职业的航海士'] = '不能任命相同職業的航海士', 
    ['不能任由阿芒德的人胡作非为，出发，驰援巴塞罗那！'] = '不能任由阿芒德的人胡作非為，出發，馳援巴塞羅那！', 
    ['不能再被增援'] = '不能再被增援', 
    ['不能加速'] = '不能加速', 
    ['不能参加'] = '不能參加', 
    ['不能取消'] = '不能取消', 
    ['不能含有非法字符'] = '不能含有非法字元', 
    ['不能在接受悬赏任务的港口放弃任务'] = '不能在接受懸賞任務的港口放棄任務', 
    ['不能在活动时间外修改时间'] = '不能在活動時間外修改時間', 
    ['不能容忍粗鄙的海盗们继续破坏这座美丽的城市。进攻！'] = '不能容忍粗鄙的海盜們繼續破壞這座美麗的城市。進攻！', 
    ['不能开始'] = '不能開始', 
    ['不能拆解编入舰队中的船'] = '不能拆解編入艦隊中的船', 
    ['不能接受'] = '不能接受', 
    ['不能接收并回赠'] = '不能接收並回贈', 
    ['不能放过这些多管闲事的，干掉他们！'] = '不能放過這些多管閑事的，幹掉他們！', 
    ['不能更新信息'] = '不能更新信息', 
    ['不能犹豫，机会稍纵即逝！必须在他们完成集结前进攻！全员准备，到了跟摩尔海盗宣战的时候了！'] = '不能猶豫，機會稍縱即逝！必須在他們完成集結前進攻！全員準備，到了跟摩爾海盜宣戰的時候了！', 
    ['不能给敌人喘息的机会，趁着敌人慌乱的机会，直取对方中军旗舰！'] = '不能給敵人喘息的機會，趁著敵人慌亂的機會，直取對方中軍旗艦！', 
    ['不能让他们完成包围，一定要撕开他们的阵线。'] = '不能讓他們完成包圍，一定要撕開他們的陣線。', 
    ['不能让他们继续攻击平民，再损失3艘平民船就无法完成撤退任务了。'] = '不能讓他們繼續攻擊平民，再損失3艘平民船就無法完成撤退任務了。', 
    ['不能让敌人靠近卡利卡特'] = '不能讓敵人靠近卡利卡特', 
    ['不能让暴行继续。'] = '不能讓暴行繼續。', 
    ['不能让运输货船逃离，击毁2个炮塔，最后攻击彼得松•霍因。'] = '不能讓運輸貨船逃離，擊毀2個炮塔，最後攻擊彼得松•霍因。', 
    ['不能让这些家伙进入港湾，截击他们！'] = '不能讓這些家伙進入港灣，截擊他們！', 
    ['不能购买那么多委任次数'] = '不能購買那麼多委任次數', 
    ['不能迁移到原本的据点港口'] = '不能遷移到原本的據點港口', 
    ['不能进行一键升级'] = '不能進行一鍵升級', 
    ['不能领取其他阵营声望物品'] = '不能領取其他陣營聲望物品', 
    ['不能领奖'] = '不能領獎', 
    ['不行了，船舱已经进水，快靠近主舰!'] = '不行了，船艙已經進水，快靠近主艦!', 
    ['不行！不能允许如此暴行的存在，哪怕是以国家的名义，立即驰援突围的这位朋友。'] = '不行！不能允許如此暴行的存在，哪怕是以國家的名義，立即馳援突圍的這位朋友。', 
    ['不行，改变方向，朝着另一个珊瑚礁群前进，抵达那边，我们才能甩开他们。'] = '不行，改變方向，朝著另一個珊瑚礁群前進，抵達那邊，我們才能甩開他們。', 
    ['不行，魔鬼之手——$(missioncolor:【佛得角】)本身危机重重，我们不能为了一点点金币以身犯险。'] = '不行，魔鬼之手——$(missioncolor:【佛得角】)本身危機重重，我們不能為了一點點金幣以身犯險。', 
    ['不要与护卫船过多纠缠，绕过去消灭【海盗斥候】'] = '不要與護衛船過多糾纏，繞過去消滅【海盜斥候】', 
    ['不要再往南走了，南方没有港口了。'] = '不要再往南走了，南方沒有港口了。', 
    ['不要吃我'] = '不要吃我', 
    ['不要听那些原住民诽谤我们的总督大人！'] = '不要聽那些原住民誹謗我們的總督大人！', 
    ['不要在椰子树下闲逛，会被熟透的椰子砸到。'] = '不要在椰子樹下閑逛，會被熟透的椰子砸到。', 
    ['不要在王宫面前晃来晃去的。'] = '不要在王宮面前晃來晃去的。', 
    ['不要忽视女人在政治中的隐性作用。'] = '不要忽視女人在政治中的隱性作用。', 
    ['不要意气用事！现在风向有利于我们，敌方船速不快，我们尽量推延时间，让属下准备突击快船，我自有妙用。'] = '不要意氣用事！現在風向有利於我們，敵方船速不快，我們儘量推延時間，讓屬下準備突擊快船，我自有妙用。', 
    ['不要担心伙计，只要在非洲以东，就不用担心海盗的问题，那些懒惰的家伙才不会费尽心力跑得那么远来抢劫呢。'] = '不要擔心伙計，只要在非洲以東，就不用擔心海盜的問題，那些懶惰的家伙才不會費盡心力跑得那麼遠來搶劫呢。', 
    ['不要指着月亮起誓，它是变化无常的。'] = '不要指著月亮起誓，它是變化無常的。', 
    ['不要松懈！对方气势汹汹的过来了！'] = '不要鬆懈！對方氣勢洶洶的過來了！', 
    ['不要着急，休息，休息一会儿。'] = '不要著急，休息，休息一會兒。', 
    ['不要让水手们在城里惹事！'] = '不要讓水手們在城裡惹事！', 
    ['不要轻敌！也永远不要低估马其顿士兵的战斗意志！利用敌人的弱点，我们才有机会取胜。'] = '不要輕敵！也永遠不要低估馬其頓士兵的戰鬥意志！利用敵人的弱點，我們才有機會取勝。', 
    ['不见得吧，在你心中肯定宝藏更为重要。'] = '不見得吧，在你心中肯定寶藏更為重要。', 
    ['不许人们私下交易，对每一单贸易都收取高额的税收。却不肯付工钱给农民和工人。把他们当成奴隶使用！'] = '不許人們私下交易，對每一單貿易都收取高額的稅收。卻不肯付工錢給農民和工人。把他們當成奴隸使用！', 
    ['不许看！'] = '不許看！', 
    ['不说红胡子，现在你的目标是阿芒德，听闻他最近在$(missioncolor:【亚历山大】)屯以重兵，那里的监狱是关押重要犯人的地方，拉比斯说不定在那里，我们一起去看看。'] = '不說紅鬍子，現在你的目標是阿芒德，聽聞他最近在$(missioncolor:【亞歷山大】)屯以重兵，那裡的監獄是關押重要犯人的地方，拉比斯說不定在那裡，我們一起去看看。', 
    ['不超过2艘水军死亡'] = '不超過2艘水軍死亡', 
    ['不足%s个，无法合成'] = '不足%s個，無法合成', 
    ['不足20个，无法合成'] = '不足20個，無法合成', 
    ['不足5个，无法合成'] = '不足5個，無法合成', 
    ['不过么，我记得当时亨利王子和我们尊贵的女王定下的协议是，英国官方将不侵犯贵国在南方的权益，但这不能约束个人行为啊！'] = '不過麽，我記得當時亨利王子和我們尊貴的女王定下的協議是，英國官方將不侵犯貴國在南方的權益，但這不能約束個人行為啊！', 
    ['不过他们还算明智，知道我们是块难啃的骨头，并没有向我们下手。'] = '不過他們還算明智，知道我們是塊難啃的骨頭，並沒有向我們下手。', 
    ['不过你们记住，你们是以私掠船的名义，因为女王现在还不想正面和汉堡发生冲突呢，祝你们好运吧！'] = '不過你們記住，你們是以私掠船的名義，因為女王現在還不想正面和漢堡發生衝突呢，祝你們好運吧！', 
    ['不过即便如此，$(missioncolor:【阿尔金】)依旧是航海家们趋之若鹜的港口，海盗们抢掠的天堂。阿尔金连接南北，各路人马都在此地停泊补给，我们可以向过往的航海家打听拉比斯的消息，不过……'] = '不過即便如此，$(missioncolor:【阿爾金】)依舊是航海家們趨之若鶩的港口，海盜們搶掠的天堂。阿爾金連接南北，各路人馬都在此地停泊補給，我們可以向過往的航海家打聽拉比斯的消息，不過……', 
    ['不过多索·贝利欧的打算并不是成为一名航海家，而是梦想在大海这座宝库中发掘一处宝藏，从而获得大量的财富，而多索·贝利欧最初出海，便是听说某小岛有海盗的宝藏。'] = '不過多索•貝利歐的打算並不是成為一名航海家，而是夢想在大海這座寶庫中發掘一處寶藏，從而獲得大量的財富，而多索•貝利歐最初出海，便是聽說某小島有海盜的寶藏。', 
    ['不过好消息就是，我们赢得个南方整个未知世界的开拓权，而这正是我想要的！'] = '不過好消息就是，我們贏得個南方整個未知世界的開拓權，而這正是我想要的！', 
    ['不过如果你们肯帮我凑齐食材的话，等美食节结束我一定上你们的船。'] = '不過如果你們肯幫我湊齊食材的話，等美食節結束我一定上你們的船。', 
    ['不过我想请你们帮忙，因为小生意不受重视，市政厅一直扣押我的经营许可。'] = '不過我想請你們幫忙，因為小生意不受重視，市政廳一直扣押我的經營許可。', 
    ['不过本地人不肯卖【糖胶】给我，能不能请你们到【文莱】帮我采购一些？'] = '不過本地人不肯賣【糖膠】給我，能不能請你們到【文萊】幫我採購一些？', 
    ['不过海军实力虽然提高，但朝鲜党争激烈，肯定会给日方可趁之机。'] = '不過海軍實力雖然提高，但朝鮮黨爭激烈，肯定會給日方可趁之機。', 
    ['不过要到船厂去建造【三桅卡拉维尔】，我们需要赚到10000银币！加油吧！'] = '不過要到船廠去建造【三桅卡拉維爾】，我們需要賺到10000銀幣！加油吧！', 
    ['不过迭戈·桑切斯半生都被霉运之神笼罩，他加入的船队不是遇上风暴，便是遇上鲨鱼，后来已经很少有船长敢招募他。'] = '不過迭戈•桑切斯半生都被霉運之神籠罩，他加入的船隊不是遇上風暴，便是遇上鯊魚，後來已經很少有船長敢招募他。', 
    ['不过，以目前我们的实力，与强大的奥斯曼帝国正面抗争时机尚未成熟，所以，我们需要想办法扩充我们的势力版图。'] = '不過，以目前我們的實力，與強大的奧斯曼帝國正面抗爭時機尚未成熟，所以，我們需要想辦法擴充我們的勢力版圖。', 
    ['不过，你别指望休息了，达伽马把果阿的驻军都调过来了，这场恶战可是随时打响呢。'] = '不過，你別指望休息了，達伽馬把果阿的駐軍都調過來了，這場惡戰可是隨時打響呢。', 
    ['不过，你需要为【威尼斯】的港口繁荣做些投资，那样，我们才会为你提供所有的便利！很公平，不是么？'] = '不過，你需要為【威尼斯】的港口繁榮做些投資，那樣，我們才會為你提供所有的便利！很公平，不是麽？', 
    ['不过，我的消息称，马六甲土司可还不死心呢，他又募集了一支舰队，企图夺回马六甲！为了长久的航线安全，必须彻底消灭他呀！'] = '不過，我的消息稱，馬六甲土司可還不死心呢，他又募集了一支艦隊，企圖奪回馬六甲！為了長久的航線安全，必須徹底消滅他呀！', 
    ['不过，法国人的船通常不会有太多火炮，用火炮把那些擅长摆姿势的骑兵解决掉！这船就逃不出我们的手掌了。'] = '不過，法國人的船通常不會有太多火炮，用火炮把那些擅長擺姿勢的騎兵解決掉！這船就逃不出我們的手掌了。', 
    ['不过，看在你们帮忙的份上，或许你可以到汉堡去，我听说汉萨同盟的商人可是出了名的杂货商，嗯，他们大小通吃，从不挑肥拣瘦！'] = '不過，看在你們幫忙的份上，或許你可以到漢堡去，我聽說漢薩同盟的商人可是出了名的雜貨商，嗯，他們大小通吃，從不挑肥揀瘦！', 
    ['不错不错，当年我也是通过竞技加入军队，后来就带着人到新大陆袭击西班牙的地盘，掠夺大量财宝。'] = '不錯不錯，當年我也是通過競技加入軍隊，後來就帶著人到新大陸襲擊西班牙的地盤，掠奪大量財寶。', 
    ['不错么，看起来你还知道这个图纸怎么用，不管怎么说，总算你有一艘看起来像点样子的船只了。'] = '不錯麽，看起來你還知道這個圖紙怎麼用，不管怎麼說，總算你有一艘看起來像點樣子的船隻了。', 
    ['不错，传说七海霸主信物就是七枚克拉肯之眼，克拉肯之眼能够减轻风浪的侵袭。至于七颗克拉肯之眼聚在一起的效果，没人知道。毕竟还没有任何人能称霸七海。'] = '不錯，傳說七海霸主信物就是七枚克拉肯之眼，克拉肯之眼能夠減輕風浪的侵襲。至於七顆克拉肯之眼聚在一起的效果，沒人知道。畢竟還沒有任何人能稱霸七海。', 
    ['不错，当年光是魔鬼之手--佛得角就牺牲了无数先驱者才将其征服的。'] = '不錯，當年光是魔鬼之手--佛得角就犧牲了無數先驅者才將其征服的。', 
    ['不错，成为四等男爵才会开放设置四船舰队的权限，前往各个港口投资或是完成精英战役可以提升你的贡献度，四等男爵指日可待。'] = '不錯，成為四等男爵才會開放設置四船艦隊的許可權，前往各個港口投資或是完成精英戰役可以提升你的貢獻度，四等男爵指日可待。', 
    ['不错，这个报酬不算低了。辛西亚要是知道这个消息肯定乐疯了。我们赶紧将它任命到舰队吧，有了它，远洋贸易肯定能事半功倍。'] = '不錯，這個報酬不算低了。辛西亞要是知道這個消息肯定樂瘋了。我們趕緊將它任命到艦隊吧，有了它，遠洋貿易肯定能事半功倍。', 
    ['不闻机杼声，惟闻女叹息。'] = '不聞機杼聲，惟聞女嘆息。', 
    ['不限购'] = '不限購', 
    ['不靠近巴巴罗萨'] = '不靠近巴巴羅薩', 
    ['不骗你，新大陆的西岸是没有港口的。'] = '不騙你，新大陸的西岸是沒有港口的。', 
    ['不！你们不能这样说我，我持有国王发放的私掠许可证，可以合法劫掠任何其他国家保护的商船，我是为国效力，是合法的！'] = '不！你們不能這樣說我，我持有國王發放的私掠許可證，可以合法劫掠任何其他國家保護的商船，我是為國效力，是合法的！', 
    ['不！我四处寻找宝藏就是为了发财，然后迎娶我的梦中情人…不和你说了，我得继续寻宝去，我预感这次肯定会找到宝藏……'] = '不！我四處尋找寶藏就是為了發財，然後迎娶我的夢中情人…不和你說了，我得繼續尋寶去，我預感這次肯定會找到寶藏……', 
    ['不！我说了我只不过不想看着他送死。'] = '不！我說了我只不過不想看著他送死。', 
    ['不！该后悔的是你！我发誓我会摧毁所有见到的摩根家族的东西！'] = '不！該後悔的是你！我發誓我會摧毀所有見到的摩根家族的東西！', 
    ['不，不仅仅是“梅利号”，拉比斯去过海洋的尽头，只有她能够带我去世界的尽头寻找父亲！'] = '不，不僅僅是“梅利號”，拉比斯去過海洋的盡頭，只有她能夠帶我去世界的盡頭尋找父親！', 
    ['不，卡利卡特是我的！'] = '不，卡利卡特是我的！', 
    ['不，我的梦想在西边，传说中的大陆！再见了，下次见面我们未必还是朋友。'] = '不，我的夢想在西邊，傳說中的大陸！再見了，下次見面我們未必還是朋友。', 
    ['不，我的防御舰队！（防御下降）'] = '不，我的防禦艦隊！（防禦下降）', 
    ['不，我还有些必须处理的事情在这里。赶紧走吧你们，记住，心有多大，海洋就有多大！当战火再次燃及我们的故乡，我希望你能成为拯救她的英雄！我相信我们还会再见面的！'] = '不，我還有些必須處理的事情在這裡。趕緊走吧你們，記住，心有多大，海洋就有多大！當戰火再次燃及我們的故鄉，我希望你能成為拯救她的英雄！我相信我們還會再見面的！', 
    ['不，这不可能！'] = '不，這不可能！', 
    ['不，这不对！希勒这家伙不是在从事贸易，他是想把斯堪的纳维亚的经济完全整垮！'] = '不，這不對！希勒這家伙不是在從事貿易，他是想把斯堪的納維亞的經濟完全整垮！', 
    ['不，这不对！把枪炮对准毫无还手之力的平民，我们连海盗都不如，更别提荣誉两个字了！'] = '不，這不對！把槍炮對準毫無還手之力的平民，我們連海盜都不如，更別提榮譽兩個字了！', 
