    ['从这里进入波斯湾之后还有其他港口。'] = '從這裡進入波斯灣之後還有其他港口。', 
    ['从郑芝龙的话中分析，他的儿子一定是跑去迎敌了。那么我们只要从这三座港口入手，一定会有所收获。'] = '從鄭芝龍的話中分析，他的兒子一定是跑去迎敵了。那麼我們只要從這三座港口入手，一定會有所收穫。', 
    ['从金刚石中雕琢而出，因为非常坚硬，一直被人们视为忠贞爱情的象征，将其镶嵌在婚戒等【宝石首饰】上。'] = '從金剛石中雕琢而出，因為非常堅硬，一直被人們視為忠貞愛情的象征，將其鑲嵌在婚戒等【寶石首飾】上。', 
    ['从金鸡纳树中提取而来，是治疗疟疾必备的药物，也可以作为香料为酒类调味。'] = '從金雞納樹中提取而來，是治療瘧疾必備的藥物，也可以作為香料為酒類調味。', 
    ['仓 库'] = '倉 庫', 
    ['仓库可以使用和合成道具。'] = '倉庫可以使用和合成道具。', 
    ['他……是“飞翔的荷兰人”操纵师，是你父亲的老熟人，也是使你父亲遭遇不测的罪魁祸首！'] = '他……是“飛翔的荷蘭人”操縱師，是你父親的老熟人，也是使你父親遭遇不測的罪魁禍首！', 
    ['他一定会很开心的。好了，别让亨利王子久等了，走吧。'] = '他一定會很開心的。好了，別讓亨利王子久等了，走吧。', 
    ['他不应该这样对你，你是韦恩海运的头号功臣。'] = '他不應該這樣對你，你是韋恩海運的頭號功臣。', 
    ['他人'] = '他人', 
    ['他们一定是听说圣乔治“黄金”的传闻。'] = '他們一定是聽說聖喬治“黃金”的傳聞。', 
    ['他们不过是一些小鱼小虾，大鱼还在后头呢。'] = '他們不過是一些小魚小蝦，大魚還在後頭呢。', 
    ['他们以为我仅是个酗酒的普通商人罢了。'] = '他們以為我僅是個酗酒的普通商人罷了。', 
    ['他们发现我们了，准备作战！'] = '他們發現我們了，準備作戰！', 
    ['他们在港湾两侧犄角还设有护卫炮台和护卫船来回巡逻，我们的任务会非常艰难。'] = '他們在港灣兩側犄角還設有護衛炮台和護衛船來回巡邏，我們的任務會非常艱難。', 
    ['他们在港湾两侧犄角还设有护卫炮台，如果不摧毁掉，我们的任务会非常艰难。'] = '他們在港灣兩側犄角還設有護衛炮台，如果不摧毀掉，我們的任務會非常艱難。', 
    ['他们就在前面，炮火瞄准，将他们截下，小心不要伤到船上的无辜人员。'] = '他們就在前面，炮火瞄準，將他們截下，小心不要傷到船上的無辜人員。', 
    ['他们居然做出如此丧心病狂的行径！我饶不了他们！'] = '他們居然做出如此喪心病狂的行徑！我饒不了他們！', 
    ['他们居然还敢得寸进尺！'] = '他們居然還敢得寸進尺！', 
    ['他们往马尼拉方向逃了，船长，不能让他们跑了，他们身上肯定有陈祖义的线索。'] = '他們往馬尼拉方向逃了，船長，不能讓他們跑了，他們身上肯定有陳祖義的線索。', 
    ['他们扼守斯堪的纳维亚半岛，切断我们与北方的联系。我们与盟友大英帝国的贸易往来因此中断。'] = '他們扼守斯堪的納維亞半島，切斷我們與北方的聯繫。我們與盟友大英帝國的貿易往來因此中斷。', 
    ['他们火炮强大，与敌人保持距离…'] = '他們火炮強大，與敵人保持距離…', 
    ['他们的货船正在从卡利卡特运走文物，这对卡利卡特来说是毁灭性损失，快阻止那些货船！'] = '他們的貨船正在從卡利卡特運走文物，這對卡利卡特來說是毀滅性損失，快阻止那些貨船！', 
    ['他们说得是科纳克太阳神庙，是婆罗门教的圣地之一。狮首象身的怪物是其中雕刻上图像，如果你有兴趣可以去探索一番，说不定会有意外收获。'] = '他們說得是科納克太陽神廟，是婆羅門教的聖地之一。獅首象身的怪物是其中雕刻上圖像，如果你有興趣可以去探索一番，說不定會有意外收穫。', 
    ['他们说的也不无道理……哦，我是说，他们太不讲道理了，这下你可以跟我们上船了吧？'] = '他們說的也不無道理……哦，我是說，他們太不講道理了，這下你可以跟我們上船了吧？', 
    ['他叫马合谟沙，不过他不愿意和陌生人打交道，除非你们能给他的交易所带来生意。'] = '他叫馬合謨沙，不過他不願意和陌生人打交道，除非你們能給他的交易所帶來生意。', 
    ['他可是个有名的硬骨头，要小心对付。'] = '他可是個有名的硬骨頭，要小心對付。', 
    ['他呀，刀子口豆腐心，见你们协助我朝除此大患，心中十分高兴。从我这知道你们在找什么东西之后，特意广发告示，派人四处搜寻……'] = '他呀，刀子口豆腐心，見你們協助我朝除此大患，心中十分高興。從我這知道你們在找什麼東西之後，特意廣發告示，派人四處搜尋……', 
    ['他掳掠人口，当做奴隶贩卖！这种罪恶的行径，连海洋女神都不会饶恕他！'] = '他擄掠人口，當做奴隸販賣！這種罪惡的行徑，連海洋女神都不會饒恕他！', 
    ['他是个穷小子，又输了钱，据说跑到【布宜诺斯艾利斯】去找事做了，他这种游手好闲的人怕是只会闯祸。'] = '他是個窮小子，又輸了錢，據說跑到【布宜諾斯艾利斯】去找事做了，他這種游手好閑的人怕是只會闖禍。', 
    ['他是唯一一个被冠以“伟大”称号的海盗王，也是奥斯曼帝国的海军元帅。他无情的摧毁敌人的舰船，却把获得的财富无私的分给穷苦的人民。他把一生献给了他要保卫的领土和人民，其名字在爱琴海永世流传。他就是地中海之王--巴巴罗萨·海雷丁！'] = '他是唯一一個被冠以“偉大”稱號的海盜王，也是奧斯曼帝國的海軍元帥。他無情的摧毀敵人的艦船，卻把獲得的財富無私的分給窮苦的人民。他把一生獻給了他要保衛的領土和人民，其名字在愛琴海永世流傳。他就是地中海之王--巴巴羅薩•海雷丁！', 
    ['他有这个权力，这家海运公司现在属于他。我很高兴能够与那些充满激情的经纪人和水手共事，现在到了说再见的时候了。'] = '他有這個權力，這家海運公司現在屬於他。我很高興能夠與那些充滿激情的經紀人和水手共事，現在到了說再見的時候了。', 
    ['他添加你为好友'] = '他添加你為好友', 
