    ['付出必有回报'] = '付出必有回報', 
    ['代表善良、圣洁的船首像，能为舰船驱走一切厄运。'] = '代表善良、聖潔的船首像，能為艦船驅走一切厄運。', 
    ['令人钦佩又如何？朝廷之人是不会承认这一切的，仅仅因为我是女儿身！'] = '令人欽佩又如何？朝廷之人是不會承認這一切的，僅僅因為我是女兒身！', 
    ['以【棉花】为原料，手工织成自然舒适的布匹，许多古老的民族依旧保有这项极其复杂的工艺。'] = '以【棉花】為原料，手工織成自然舒適的布匹，許多古老的民族依舊保有這項極其複雜的工藝。', 
