    ['原本是印第安人的居住地，经过西班牙的殖民后，这里变成了加勒比海盗的大本营。'] = '原本是印第安人的居住地，經過西班牙的殖民後，這裡變成了加勒比海盜的大本營。', 
    ['原来一切都是彼得松·霍因为了掌控印度洋所设计的阴谋，现在他在卡利卡特附近布置了大型炮塔，躲开炮塔，击破他的旗舰。'] = '原來一切都是彼得松•霍因為了掌控印度洋所設計的陰謀，現在他在卡利卡特附近佈置了大型炮塔，躲開炮塔，擊破他的旗艦。', 
    ['原来如此。为了爵位，也只有全力以赴了。'] = '原來如此。為了爵位，也只有全力以赴了。', 
    ['原来如此，可你的外表看上去很柔弱，不像出海之人。'] = '原來如此，可你的外表看上去很柔弱，不像出海之人。', 
    ['原来如此，怪不得这么多人，我们也别落后，去市政厅投资！'] = '原來如此，怪不得這麼多人，我們也別落後，去市政廳投資！', 
    ['原来如此，我们也正在寻找陈祖义的消息，说不定我们可以合作。'] = '原來如此，我們也正在尋找陳祖義的消息，說不定我們可以合作。', 
    ['原来如此，我看他们与这些红眉毛绿眼睛的侵略者长得十分类似，以为他们也是同伙。'] = '原來如此，我看他們與這些紅眉毛綠眼睛的侵略者長得十分類似，以為他們也是同伙。', 
    ['原来如此，无知而野蛮的海盗是文明的大敌。先暂缓追击海盗的脚步，保护圣乔治，我们协助恢复城市设施，能帮多少就帮多少吧。拉比斯，我终于能理解你的心情了。'] = '原來如此，無知而野蠻的海盜是文明的大敵。先暫緩追擊海盜的腳步，保護聖喬治，我們協助恢復城市設施，能幫多少就幫多少吧。拉比斯，我終於能理解你的心情了。', 
    ['原来如雷贯耳的【暴雪竞技场】就在卑尔根！听说这是著名的 金发埃里克 建造的呢！'] = '原來如雷貫耳的【暴雪競技場】就在卑爾根！聽說這是著名的 金髮埃里克 建造的呢！', 
    ['原来投资港口后还有分红回报！立刻'] = '原來投資港口後還有分紅回報！立刻', 
    ['原来摩尔人的背后是地中海真正的海上霸主--红胡子巴巴罗萨·海雷丁！但是，为了家乡的安宁，不管面对的敌人是多么强大，绝不退缩！'] = '原來摩爾人的背後是地中海真正的海上霸主--紅鬍子巴巴羅薩•海雷丁！但是，為了家鄉的安寧，不管面對的敵人是多麼強大，絕不退縮！', 
    ['原来是你们在搞鬼，看来你们没搞清楚状况。'] = '原來是你們在搞鬼，看來你們沒搞清楚狀況。', 
    ['原来是威尼斯人在背后支持阿拉伯商团，立刻赶回'] = '原來是威尼斯人在背後支持阿拉伯商團，立刻趕回', 
    ['原来是郑公子，汪直罪恶深重，我们此去正是为了这个家伙。'] = '原來是鄭公子，汪直罪惡深重，我們此去正是為了這個家伙。', 
    ['原来海盗一直利用佛得角附近凶险的环境伏击过往的船只！难怪那么多经验丰富的探险家都在这里遇难！'] = '原來海盜一直利用佛得角附近凶險的環境伏擊過往的船隻！難怪那麼多經驗豐富的探險家都在這裡遇難！', 
    ['原来海盗一直在利用佛得角附近凶险的环境伏击过往的船只！难怪那么多经验丰富的探险家都在这里失事！'] = '原來海盜一直在利用佛得角附近凶險的環境伏擊過往的船隻！難怪那麼多經驗豐富的探險家都在這裡失事！', 
