    ['呃……我们的旗舰恐怕无法应付之后的战斗，直面巴巴罗萨更是无从谈起，该如何是好。'] = '呃……我們的旗艦恐怕無法應付之後的戰鬥，直面巴巴羅薩更是無從談起，該如何是好。', 
    ['呃，他的船帆和胸前有这样形制的徽记。'] = '呃，他的船帆和胸前有這樣形制的徽記。', 
