    ['呃，迭戈·桑切斯先生，你说的一点都没有错，但有梦想就应该去努力实现是吧？我看你好像并没有为此付诸行动。'] = '呃，迭戈•桑切斯先生，你說的一點都沒有錯，但有夢想就應該去努力實現是吧？我看你好像並沒有為此付諸行動。', 
    ['呦，还真是个耿直的小子。这样，只要你能够替我教训阿芒德并帮我找到“命运号”，我就给你做向导，如何？'] = '呦，還真是個耿直的小子。這樣，只要你能夠替我教訓阿芒德並幫我找到“命運號”，我就給你做嚮導，如何？', 
    ['周末商会战将于周六凌晨0点准时开启，系统将对设立了据点的商会进行匹配。'] = '周末商會戰將於周六淩晨0點準時開啟，系統將對設立了據點的商會進行匹配。', 
    ['周末商会战已开启，胜者的商会将提升排名，并获得丰富的奖励。'] = '周末商會戰已開啟，勝者的商會將提升排名，並獲得豐富的獎勵。', 
    ['周末商会战已结束，玩家可在商会领取奖励，并在市政厅查看战绩。'] = '周末商會戰已結束，玩家可在商會領取獎勵，並在市政廳查看戰績。', 
    ['周边的强国都积极扩张，只有汉萨同盟能保护我们。'] = '周邊的強國都積極擴張，只有漢薩同盟能保護我們。', 
    ['周边的王国总是觊觎自由市的财富。'] = '周邊的王國總是覬覦自由市的財富。', 
    ['味道甘甜，通常生长在山坡上稀疏灌丛中，或路边的岩石缝中。'] = '味道甘甜，通常生長在山坡上稀疏灌叢中，或路邊的岩石縫中。', 
    ['味道香甜，可以加工成各式菜肴，也可以用来酿造【威士忌】。'] = '味道香甜，可以加工成各式菜餚，也可以用來釀造【威士忌】。', 
    ['呵呵，不能说不能说，除非你拿出几瓶马赛产82年的【茴香酒】，否则我是不会告诉你的。茴香酒可是好东西啊，当年我偷偷拿会长的收藏畅饮一番，现在都记得那个香味……对了，我只能说那是个好东西，看你的样子是个航海家吧，这对于你来说有莫大的好处。'] = '呵呵，不能說不能說，除非你拿出幾瓶馬賽產82年的【茴香酒】，否則我是不會告訴你的。茴香酒可是好東西啊，當年我偷偷拿會長的收藏暢飲一番，現在都記得那個香味……對了，我只能說那是個好東西，看你的樣子是個航海家吧，這對於你來說有莫大的好處。', 
    ['呵呵，人心难测啊，人心难测……'] = '呵呵，人心難測啊，人心難測……', 
    ['呵呵，你自己好好想一下吧，我先出去走走。'] = '呵呵，你自己好好想一下吧，我先出去走走。', 
    ['呵呵，如果不是看在你父亲的份上，我调开了舰队，你怎么有可能击败阿芒德那个蠢货，虽然他的野心迟早会把他自己烧毁。'] = '呵呵，如果不是看在你父親的份上，我調開了艦隊，你怎麼有可能擊敗阿芒德那個蠢貨，雖然他的野心遲早會把他自己燒毀。', 
    ['呵呵，小妞，口号倒是喊得响亮，待会可别往吓哭了！'] = '呵呵，小妞，口號倒是喊得響亮，待會可別往嚇哭了！', 
    ['呵呵，年轻人，这是工匠公会的信物。工匠公会是七海中闻名的中立组织。有了这个就能够请动那群臭脾气的老家伙帮忙改造船只了。'] = '呵呵，年輕人，這是工匠公會的信物。工匠公會是七海中聞名的中立組織。有了這個就能夠請動那群臭脾氣的老家伙幫忙改造船隻了。', 
    ['呵呵，我找到玛利亚时才明白，她并不在意在海难中丢失的财富，只在意我能从海难中平安归来……'] = '呵呵，我找到瑪利亞時才明白，她並不在意在海難中丟失的財富，只在意我能從海難中平安歸來……', 
    ['呵呵，没什么。新消息，红胡子打算占领亚平宁，精锐尽出，他的后防必定空虚。我们可以趁这个机会干掉驻守老巢$(missioncolor:【伊斯坦堡】)的阿芒德！'] = '呵呵，沒什麼。新消息，紅鬍子打算佔領亞平寧，精銳盡出，他的後防必定空虛。我們可以趁這個機會幹掉駐守老巢$(missioncolor:【伊斯坦堡】)的阿芒德！', 
    ['呵呵，没什么，你自己想好就行，我只是随便说说。'] = '呵呵，沒什麼，你自己想好就行，我只是隨便說說。', 
    ['呵呵，没想到吧，今天的你就好比当年的我，你放心，我不会让你轻易死掉的。'] = '呵呵，沒想到吧，今天的你就好比當年的我，你放心，我不會讓你輕易死掉的。', 
    ['呵呵，现在你拥有了任命两艘船组成舰队的权限，随着爵位的提升，你会得到更多的特权，其中的好处你以后自然会明白。'] = '呵呵，現在你擁有了任命兩艘船組成艦隊的許可權，隨著爵位的提升，你會得到更多的特權，其中的好處你以後自然會明白。', 
    ['呵呵，自由？“不自由，毋宁死”是你们这些贵族老爷们的荒唐信念，我们只想活下去。'] = '呵呵，自由？“不自由，毋寧死”是你們這些貴族老爺們的荒唐信念，我們只想活下去。', 
    ['呵呵，越是高级的船，能升的星级越多，可不要因为这艘小船而忘记自己的目标啊。'] = '呵呵，越是高級的船，能升的星級越多，可不要因為這艘小船而忘記自己的目標啊。', 
    ['呵呵，这可是“女神的恩赐”，从那次灾难之后，我就一直将这枚克拉肯之眼当做假眼。'] = '呵呵，這可是“女神的恩賜”，從那次災難之後，我就一直將這枚克拉肯之眼當做假眼。', 
    ['呵呵，这是冒险家协会为了鼓励勇敢的冒险者探索大海，每天都会推荐一名航海士给初出茅庐的冒险家，现在先将新加入的航海士任命到船上。'] = '呵呵，這是冒險家協會為了鼓勵勇敢的冒險者探索大海，每天都會推薦一名航海士給初出茅廬的冒險家，現在先將新加入的航海士任命到船上。', 
    ['呵，你所谓的感谢就是在英西大海战中让西班牙舰队覆灭吧。'] = '呵，你所謂的感謝就是在英西大海戰中讓西班牙艦隊覆滅吧。', 
    ['呵，贵族华丽的袍子上都沾满了血和泪，年轻人，你的行为的确可嘉，听说你一直在寻找去前往世界尽头的凭证——女神之誓的碎片，我这里刚刚好有一块，可以将其赠送。'] = '呵，貴族華麗的袍子上都沾滿了血和淚，年輕人，你的行為的確可嘉，聽說你一直在尋找去前往世界盡頭的憑證——女神之誓的碎片，我這裡剛剛好有一塊，可以將其贈送。', 
    ['呼哈！继续前进！'] = '呼哈！繼續前進！', 
    ['呼，这里的海盗真是比沙子还多呢。'] = '呼，這裡的海盜真是比沙子還多呢。', 
    ['命运号'] = '命運號', 
    ['命运号的消息'] = '命運號的消息', 
    ['命运号血量>50%'] = '命運號血量>50%', 
    ['命运女神编织丝线，万物都在丝线上运行。'] = '命運女神編織絲線，萬物都在絲線上運行。', 
    ['和'] = '和', 
    ['和其他品种的咖啡相比，里约咖啡虽然口感较为粗糙，但胜在高产，不失为一种大众咖啡。'] = '和其他品種的咖啡相比，里約咖啡雖然口感較為粗糙，但勝在高產，不失為一種大眾咖啡。', 
    ['和小麦相比，大麦不适合做面包，但可以用来酿造【啤酒、伏特加、威士忌、琴酒】。'] = '和小麥相比，大麥不適合做麵包，但可以用來釀造【啤酒、伏特加、威士忌、琴酒】。', 
    ['和平使者'] = '和平使者', 
    ['和平的条件'] = '和平的條件', 
    ['和我不用客气，希望我回来时能够带来好消息。'] = '和我不用客氣，希望我回來時能夠帶來好消息。', 
    ['和拉比斯心生间隙'] = '和拉比斯心生間隙', 
    ['和敌方保持一定距离，被“希腊火”喷到可不是开玩笑的'] = '和敵方保持一定距離，被“希腊火”噴到可不是開玩笑的', 
    ['和纯伏特加相比，葡萄酒简直就是淡果汁。'] = '和純伏特加相比，葡萄酒簡直就是淡果汁。', 
    ['和罗安达一样，这里也是由航海家迪亚士发现的。'] = '和羅安達一樣，這裡也是由航海家迪亞士發現的。', 
    ['和贝拉米联手击退政府军，并且保护贝拉米旗舰。'] = '和貝拉米聯手擊退政府軍，並且保護貝拉米旗艦。', 
    ['咖啡豆产自牙买加蓝山山脉，这种咖啡拥有所有好咖啡的特点，味道浓郁香醇，口感顺滑。'] = '咖啡豆產自牙買加藍山山脈，這種咖啡擁有所有好咖啡的特點，味道濃郁香醇，口感順滑。', 
    ['咖喱'] = '咖喱', 
    ['咦！这个港口水网密布，快赶上威尼斯了。'] = '咦！這個港口水網密佈，快趕上威尼斯了。', 
    ['咦，船长你在说啥，问我今后的打算，噢，不用您担心，就算我比较倒霉，但我不会放弃我的梦想。'] = '咦，船長你在說啥，問我今後的打算，噢，不用您擔心，就算我比較倒霉，但我不會放棄我的夢想。', 
    ['咦？你们不是汉萨同盟的商船，本海域严禁汉萨同盟以外的船只经过，速速离开。'] = '咦？你們不是漢薩同盟的商船，本海域嚴禁漢薩同盟以外的船隻經過，速速離開。', 
    ['咦？前面好像有什么比赛？'] = '咦？前面好像有什麼比賽？', 
    ['咦？大叔您也知道拉比斯？'] = '咦？大叔您也知道拉比斯？', 
    ['咦？大叔您说什么？发生什么事了，怎么人们都在四散奔逃？'] = '咦？大叔您說什麼？發生什麼事了，怎麼人們都在四散奔逃？', 
    ['咦？进阶图纸？有了这个图纸我们就可以把一艘星级船只随机进化成高阶船。'] = '咦？進階圖紙？有了這個圖紙我們就可以把一艘星級船隻隨機進化成高階船。', 
    ['咳~咳~~我才是船长！嗯，我说伙计们，敌人港口的第一道防线已经突破了！让我们趁胜追击！'] = '咳~咳~~我才是船長！嗯，我說伙計們，敵人港口的第一道防線已經突破了！讓我們趁勝追擊！', 
    ['咳~咳~（热闹的酒馆安静了下来）。请问这里有赋闲的航海士找活干吗？我是 $(usename) 船长！我需要一些能干的家伙跟我到巴塞罗那对付摩尔海盗！'] = '咳~咳~（熱鬧的酒館安靜了下來）。請問這裡有賦閑的航海士找活幹嗎？我是 $(usename) 船長！我需要一些能幹的家伙跟我到巴塞羅那對付摩爾海盜！', 
    ['咳、咳，拉比斯的话虽然…但也没有错，每年由于撞上浮冰而沉没于北海中的船不可胜数。我们最好改变下阵型，用护甲较高的装甲舰和突击舰将旗舰护卫在最中间。'] = '咳、咳，拉比斯的話雖然…但也沒有錯，每年由於撞上浮冰而沉沒於北海中的船不可勝數。我們最好改變下陣型，用護甲較高的裝甲艦和突擊艦將旗艦護衛在最中間。', 
    ['咳、咳，拉比斯的话虽然…但也没有错，每年由于撞上浮冰而沉没于北海中的船不可胜数。我们最好改变下阵型，用护甲较高的装甲船和近战船将旗舰护卫在最中间。'] = '咳、咳，拉比斯的話雖然…但也沒有錯，每年由於撞上浮冰而沉沒於北海中的船不可勝數。我們最好改變下陣型，用護甲較高的裝甲船和近戰船將旗艦護衛在最中間。', 
    ['咳咳……咳咳……好像失败了呢。'] = '咳咳……咳咳……好像失敗了呢。', 
    ['咳咳……并不是我不信任你们，但这批货物对我很重要，你们必须在市政厅压一笔保证金。'] = '咳咳……並不是我不信任你們，但這批貨物對我很重要，你們必須在市政廳壓一筆保證金。', 
    ['咳咳，多谢您，善良的船长。强盗，该死的强盗！他们掳走了我们所有人，把我们当成奴隶，进行惨无人道地虐待。我趁他们不备，跳海逃生。要不是您，我这条命就……呜……'] = '咳咳，多謝您，善良的船長。強盜，該死的強盜！他們擄走了我們所有人，把我們當成奴隸，進行慘無人道地虐待。我趁他們不備，跳海逃生。要不是您，我這條命就……嗚……', 
    ['咳咳，差点忘了还有这回事。辛西亚，现在去交易所把存货出售，换取继续强化所需的银币吧。'] = '咳咳，差點忘了還有這回事。辛西亞，現在去交易所把存貨出售，換取繼續強化所需的銀幣吧。', 
    ['咳，喝多了莫名其妙帮人跑了趟腿。对了，戴肯叔叔，您帮我看下，这个锤子是什么？'] = '咳，喝多了莫名其妙幫人跑了趟腿。對了，戴肯叔叔，您幫我看下，這個鎚子是什麼？', 
    ['咽喉之争'] = '咽喉之爭', 
    ['哀嚎之城'] = '哀嚎之城', 
    ['品阶：'] = '品階：', 
    ['哇哦！这么一大笔钱！命运真是不公平，我怎么就不是个大富商呢？'] = '哇哦！這麼一大筆錢！命運真是不公平，我怎麼就不是個大富商呢？', 
    ['哇！竟然是一名不错的航海士！'] = '哇！竟然是一名不錯的航海士！', 
    ['哈伯特'] = '哈伯特', 
    ['哈伯肖'] = '哈伯肖', 
    ['哈利路亚！'] = '哈利路亞！', 
    ['哈哈哈！幼稚！有什么能比掠夺来钱更快？我虽然败给了你，但为了葡萄牙的荣耀，我无怨无悔！'] = '哈哈哈！幼稚！有什麼能比掠奪來錢更快？我雖然敗給了你，但為了葡萄牙的榮耀，我無怨無悔！', 
    ['哈哈哈！这就是对抗葡萄牙的下场。'] = '哈哈哈！這就是對抗葡萄牙的下場。', 
    ['哈哈哈，当你直面过死亡之后，宝藏金币又算得了什么呢？不过是尘土里的一粒尘埃，海浪中的一滴水珠罢了。'] = '哈哈哈，當你直面過死亡之後，寶藏金幣又算得了什麼呢？不過是塵土裡的一粒塵埃，海浪中的一滴水珠罷了。', 
    ['哈哈哈，我虽然在金钱方面不够敏感，但这是我的会计师辛西亚的强项，她在千里之外就能嗅到金币的味道。'] = '哈哈哈，我雖然在金錢方面不夠敏感，但這是我的會計師辛西亞的強項，她在千里之外就能嗅到金幣的味道。', 
    ['哈哈哈，斯堪的纳维亚已经是我的囊中之物！现在，我们该干正事了！'] = '哈哈哈，斯堪的納維亞已經是我的囊中之物！現在，我們該干正事了！', 
    ['哈哈哈，目的？这一片海域都在我的掌控之下，自东印度公司出现之后抢走了我的货物，伤害了这里的子民，我不过想还这片海域清净罢了。'] = '哈哈哈，目的？這一片海域都在我的掌控之下，自東印度公司出現之後搶走了我的貨物，傷害了這裡的子民，我不過想還這片海域清凈罷了。', 
    ['哈哈哈，难得还有人念我的好，我心甚慰，我心甚慰啊！'] = '哈哈哈，難得還有人念我的好，我心甚慰，我心甚慰啊！', 
    ['哈哈！欢迎来到【萨格里什】，你在巴塞罗那的战绩已经随着海风飘到我这老耳朵里了呢！有啥我能帮得上忙的？'] = '哈哈！歡迎來到【薩格裡什】，你在巴塞羅那的戰績已經隨著海風飄到我這老耳朵里了呢！有啥我能幫得上忙的？', 
    ['哈哈！痛快的战斗！真令人精神舒爽啊，老师，尽管把剩下的都派出来吧！'] = '哈哈！痛快的戰鬥！真令人精神舒爽啊，老師，儘管把剩下的都派出來吧！', 
    ['哈哈，一个女儿家多管闲事，口气还如此狂妄！来人啊，给我把她……'] = '哈哈，一個女兒家多管閑事，口氣還如此狂妄！來人啊，給我把她……', 
    ['哈哈，不是这样的，我能说这是因为我娶了我叔叔的女儿吗？他是加勒比地区英军指挥官。'] = '哈哈，不是這樣的，我能說這是因為我娶了我叔叔的女兒嗎？他是加勒比地區英軍指揮官。', 
    ['哈哈，他跑不掉啦！'] = '哈哈，他跑不掉啦！', 
    ['哈哈，你以为摩尔人的战船从哪里来？【突尼斯】是北非重要的工业港，海盗所驾的【三桅卡拉维尔】就是在这里制造的！'] = '哈哈，你以為摩爾人的戰船從哪裡來？【突尼斯】是北非重要的工業港，海盜所駕的【三桅卡拉維爾】就是在這裡製造的！', 
    ['哈哈，你以为摩尔人的战船从哪里来？【突尼斯】是北非重要的工业港，海盗所驾的【三桅卡拉维尔】就是在这里制造的，投资市政厅可以解锁船厂。'] = '哈哈，你以為摩爾人的戰船從哪裡來？【突尼斯】是北非重要的工業港，海盜所駕的【三桅卡拉維爾】就是在這裡製造的，投資市政廳可以解鎖船廠。', 
    ['哈哈，你又输了！'] = '哈哈，你又輸了！', 
    ['哈哈，你这个不服输的气势还真像你的父亲。你说得没错，我就是虫子，一只懦弱的虫子……这个信物你拿好，记住，一定要亲自保存好。'] = '哈哈，你這個不服輸的氣勢還真像你的父親。你說得沒錯，我就是蟲子，一隻懦弱的蟲子……這個信物你拿好，記住，一定要親自保存好。', 
    ['哈哈，兄弟们来支援了'] = '哈哈，兄弟們來支援了', 
    ['哈哈，再见啦！'] = '哈哈，再見啦！', 
    ['哈哈，冲着宝物我也要完成试炼啊，我也早已迫不及待啦！'] = '哈哈，衝著寶物我也要完成試煉啊，我也早已迫不及待啦！', 
    ['哈哈，原来是这事儿，这很简单，我的远房叔叔就是女王的顾问呢。我这就带您去见他。'] = '哈哈，原來是這事兒，這很簡單，我的遠房叔叔就是女王的顧問呢。我這就帶您去見他。', 
    ['哈哈，又击沉一艘！货物归我们啦！'] = '哈哈，又擊沉一艘！貨物歸我們啦！', 
    ['哈哈，增援又来了'] = '哈哈，增援又來了', 
    ['哈哈，年轻人，生活本就是不公平，你要做的是去适应它。这个世界才不会在意你的抱怨，你要在自我感觉良好之前先有所成就。'] = '哈哈，年輕人，生活本就是不公平，你要做的是去適應它。這個世界才不會在意你的抱怨，你要在自我感覺良好之前先有所成就。', 
    ['哈哈，我会的。祝你们好运！'] = '哈哈，我會的。祝你們好運！', 
    ['哈哈，我刚在码头听说英国海军才赶到汉堡来，他们还真是不紧不慢。'] = '哈哈，我剛在碼頭聽說英國海軍才趕到漢堡來，他們還真是不緊不慢。', 
    ['哈哈，我喜欢这情景！'] = '哈哈，我喜歡這情景！', 
    ['哈哈，我无法拒绝命运的召唤……我同意，来【酒馆】喝一杯吧，敬自由！'] = '哈哈，我無法拒絕命運的召喚……我同意，來【酒館】喝一杯吧，敬自由！', 
    ['哈哈，收获果然丰厚，辛西亚你干得不错。'] = '哈哈，收穫果然豐厚，辛西亞你幹得不錯。', 
    ['哈哈，正是德雷克海峡，说起来这一伟大发现我还得感谢西班牙人。'] = '哈哈，正是德雷克海峽，說起來這一偉大發現我還得感謝西班牙人。', 
    ['哈哈，没错，我的确是犯了天大的错误，那就是错信了你这个懦夫、叛徒！要不是你的蛊惑……'] = '哈哈，沒錯，我的確是犯了天大的錯誤，那就是錯信了你這個懦夫、叛徒！要不是你的蠱惑……', 
    ['哈哈，猜对了！我保证这是最后一次……糖人的味道不太吸引人，我想收购一些香料混进去。'] = '哈哈，猜對了！我保證這是最後一次……糖人的味道不太吸引人，我想收購一些香料混進去。', 
    ['哈哈，谢谢你，我相信我一定会找到老船长继承人，一定！'] = '哈哈，謝謝你，我相信我一定會找到老船長繼承人，一定！', 
    ['哈哈，这个消息大概会让达尔布克基那家伙头痛咯！原来背后支持敌人的竟然是威尼斯人！'] = '哈哈，這個消息大概會讓達爾布克基那家伙頭痛咯！原來背後支持敵人的竟然是威尼斯人！', 
    ['哈哈，那我记住了，如果是你这样的“入侵者”，我会坚持不持寸铁，“和平”的抗争来取得胜利吧！现在，让我们面对真正的恶魔吧。'] = '哈哈，那我記住了，如果是你這樣的“入侵者”，我會堅持不持寸鐵，“和平”的抗爭來取得勝利吧！現在，讓我們面對真正的惡魔吧。', 
    ['哈哈，阿芒德，你可小心别被炮弹轰在了屁股上！'] = '哈哈，阿芒德，你可小心別被炮彈轟在了屁股上！', 
    ['哈哈，鲨鱼被我抓住了！嚯！鲨鱼肚子里居然有%s本【%s】和%s个【%s】，真是好运气。'] = '哈哈，鯊魚被我抓住了！嚯！鯊魚肚子里居然有%s本【%s】和%s個【%s】，真是好運氣。', 
    ['哈夫尔'] = '哈夫爾', 
    ['哈密顿岛'] = '哈密頓島', 
    ['哈尔.安德森'] = '哈爾.安德森', 
    ['哈尔伯特'] = '哈爾伯特', 
