    ['哦？这个漂亮的姑娘可不是个简单的角色，先把她$(missioncolor:【任命】)到副舰吧；经商也是每个舰队壮大必须的一环。'] = '哦？這個漂亮的姑娘可不是個簡單的角色，先把她$(missioncolor:【任命】)到副艦吧；經商也是每個艦隊壯大必須的一環。', 
