    ['好吧，你赢了。当日我在里斯本的酒馆里听到一群贩奴者正在讨论准备去南方“运货”，怒火中烧，所以……'] = '好吧，你贏了。當日我在裡斯本的酒館里聽到一群販奴者正在討論準備去南方“運貨”，怒火中燒，所以……', 
    ['好吧，我们先与神圣同盟的盟友汇合，率先突击奥斯曼海军在西西里一代的布防。'] = '好吧，我們先與神聖同盟的盟友匯合，率先突擊奧斯曼海軍在西西里一代的佈防。', 
    ['好吧，我可不管是谁在支持他，我一定要让他滚得远远的！永远离开这条航线。'] = '好吧，我可不管是誰在支持他，我一定要讓他滾得遠遠的！永遠離開這條航線。', 
    ['好吧，那你以我葡萄牙特使的名义，先去北方以寻求结盟的名义来寻找其它的女神之誓。这里有我的推荐信，你拿着它先到$(missioncolor:【伦敦】)试探一番吧。'] = '好吧，那你以我葡萄牙特使的名義，先去北方以尋求結盟的名義來尋找其它的女神之誓。這裡有我的推薦信，你拿著它先到$(missioncolor:【倫敦】)試探一番吧。', 
    ['好吧，那你听好了，卡瓦略·雷耶斯。我们不会像老师一样教导你，但是会像伙伴一样和你并肩作战。如果你愿意的话，就加入我们吧！'] = '好吧，那你聽好了，卡瓦略•雷耶斯。我們不會像老師一樣教導你，但是會像伙伴一樣和你並肩作戰。如果你願意的話，就加入我們吧！', 
    ['好吧，那我可就不客气了……哈哈，终于可以鸟枪换炮了……现在先将新船设置进入舰队。'] = '好吧，那我可就不客氣了……哈哈，終於可以鳥槍換炮了……現在先將新船設置進入艦隊。', 
    ['好啦好啦，我们会给【市政厅】投资一笔钱让你们维修港口的。'] = '好啦好啦，我們會給【市政廳】投資一筆錢讓你們維修港口的。', 
    ['好啦好啦，药材齐啦！'] = '好啦好啦，藥材齊啦！', 
    ['好大一块礁石，我们可别撞上去了！瞄准！让我炸掉它！'] = '好大一塊礁石，我們可別撞上去了！瞄準！讓我炸掉它！', 
    ['好大一条鱼！抓住它兄弟们就能美餐一顿了！准备撒网！'] = '好大一條魚！抓住它兄弟們就能美餐一頓了！準備撒網！', 
    ['好大的炮'] = '好大的炮', 
    ['好大的雾！没有瞭望镜，我什么也看不清，只能祈祷迷雾快快散去。'] = '好大的霧！沒有瞭望鏡，我什麼也看不清，只能祈禱迷霧快快散去。', 
    ['好好想想吧，是走上血与火的霸者之路，还是就此退出！'] = '好好想想吧，是走上血與火的霸者之路，還是就此退出！', 
    ['好好留意一下，附近可能有玛雅人的遗迹。'] = '好好留意一下，附近可能有瑪雅人的遺跡。', 
    ['好想运几头骆驼回欧洲去。'] = '好想運幾頭駱駝回歐洲去。', 
    ['好望角'] = '好望角', 
    ['好望角也叫风暴角，经常有杀人浪出现。'] = '好望角也叫風暴角，經常有殺人浪出現。', 
