    ['好望角被称为世界上最危险的航海地段的主要原因是？'] = '好望角被稱為世界上最危險的航海地段的主要原因是？', 
    ['好望角连通着大西洋与哪个海域？'] = '好望角連通著大西洋與哪個海域？', 
    ['好样的！哎，你终究还是没有找到你的父亲，我为此感到悲伤。'] = '好樣的！哎，你終究還是沒有找到你的父親，我為此感到悲傷。', 
    ['好消息是这次我和你们一起去！还等什么，快出发吧！'] = '好消息是這次我和你們一起去！還等什麼，快出發吧！', 
    ['好深的心机。我想，霍金斯和国王权杖也在你手中吧。'] = '好深的心機。我想，霍金斯和國王權杖也在你手中吧。', 
    ['好的船长'] = '好的船長', 
    ['好的，将这艘$(missioncolor:【轻型三角帆船】)加入到舰队，我们即刻出航！'] = '好的，將這艘$(missioncolor:【輕型三角帆船】)加入到艦隊，我們即刻出航！', 
    ['好的，我马上就去【马斯卡特】，但愿你们的老朋友也能够缓过来。'] = '好的，我馬上就去【馬斯卡特】，但願你們的老朋友也能夠緩過來。', 
    ['好的，船长。其实我心理预期是15帝国钻石币，没想到您这么痛快地就答应了，您放心，我……'] = '好的，船長。其實我心理預期是15帝國鑽石幣，沒想到您這麼痛快地就答應了，您放心，我……', 
    ['好的，那真是麻烦大叔了，我现在就购买新船扩大舰队。'] = '好的，那真是麻煩大叔了，我現在就購買新船擴大艦隊。', 
    ['好运'] = '好運', 
    ['好运的年轻人，你刚好进爵为五等男爵获得进阶轻型三角帆船的权限，现在又有了进阶图纸，我们当年可没有你这么好的运气啊。'] = '好運的年輕人，你剛好進爵為五等男爵獲得進階輕型三角帆船的許可權，現在又有了進階圖紙，我們當年可沒有你這麼好的運氣啊。', 
    ['好运还是不幸？'] = '好運還是不幸？', 
    ['好！为了能够找到父亲，我无所畏惧。'] = '好！為了能夠找到父親，我無所畏懼。', 
    ['好！年轻人，有气魄！“白棉布”杰克的势力盘踞在$(missioncolor:【哈瓦那】)、$(missioncolor:【梅里达】)和$(missioncolor:【巴拿马城】)，希望能听到你们胜利的消息。届时，我会赐予你们丰厚的赏金。'] = '好！年輕人，有氣魄！“白棉布”傑克的勢力盤踞在$(missioncolor:【哈瓦那】)、$(missioncolor:【梅里達】)和$(missioncolor:【巴拿馬城】)，希望能聽到你們勝利的消息。屆時，我會賜予你們豐厚的賞金。', 
    ['好！霍金斯，我一定会制裁你！'] = '好！霍金斯，我一定會製裁你！', 
    ['好，资金还很充裕，我们一步到位。哈哈哈哈……'] = '好，資金還很充裕，我們一步到位。哈哈哈哈……', 
    ['好，资金还很多，我们一步到位，哈哈哈哈……'] = '好，資金還很多，我們一步到位，哈哈哈哈……', 
    ['好，这个港口已经是我们的囊中之物了！'] = '好，這個港口已經是我們的囊中之物了！', 
    ['如你所愿，年轻人，希望我的同行能够给你带来帮助。'] = '如你所願，年輕人，希望我的同行能夠給你帶來幫助。', 
    ['如你所见……这里的情况糟糕透了，海盗洗劫了商铺，我们计划重开港口，但是连足够的货源都没有了。'] = '如你所見……這裡的情況糟糕透了，海盜洗劫了商鋪，我們計劃重開港口，但是連足夠的貨源都沒有了。', 
    ['如您所言！的黎波里的防御力量比突尼斯更强大，敌人果然将这里作为了基地。'] = '如您所言！的黎波里的防禦力量比突尼斯更強大，敵人果然將這裡作為了基地。', 
    ['如来佛'] = '如來佛', 
    ['如果 蒲丽雅 说我愿意援助，那我就愿意援助咯，不过，我只能让我的人帮忙建设城防炮台，我的舰队正跟马六甲的苏丹交战呢！'] = '如果 蒲麗雅 說我願意援助，那我就願意援助咯，不過，我只能讓我的人幫忙建設城防炮台，我的艦隊正跟馬六甲的蘇丹交戰呢！', 
    ['如果你们能到【汉堡】向消息灵通的阿尔伯特·希勒打听一下海盗的动向，并且消灭他们，我想你们肯定能赢得我们女王的青睐。'] = '如果你們能到【漢堡】向消息靈通的阿爾伯特•希勒打聽一下海盜的動向，並且消滅他們，我想你們肯定能贏得我們女王的青睞。', 
    ['如果你们能协助我们皇家海军击败那些见利忘义的家伙，我想女王会接见你们的。'] = '如果你們能協助我們皇家海軍擊敗那些見利忘義的家伙，我想女王會接見你們的。', 
    ['如果你坚持的话，我很乐意向达尔布克基大人转达你的意思。'] = '如果你堅持的話，我很樂意向達爾布克基大人轉達你的意思。', 
    ['如果你想反悔，最好现在说。'] = '如果你想反悔，最好現在說。', 
    ['如果你抱有希望的话！这个可恶的海角把我的舰队给毁了！我休整后就回航了，我听说达伽马的船队也在这附近，你要小心他！'] = '如果你抱有希望的話！這個可惡的海角把我的艦隊給毀了！我休整後就回航了，我聽說達伽馬的船隊也在這附近，你要小心他！', 
    ['如果你这么想，就是本末倒置了，难道你所做的一切，就是为了得到朝廷的承认？那我真是看错你了。'] = '如果你這麼想，就是本末倒置了，難道你所做的一切，就是為了得到朝廷的承認？那我真是看錯你了。', 
    ['如果在海上遇到龙卷风，不知道会被吹到哪里。'] = '如果在海上遇到龍卷風，不知道會被吹到哪裡。', 
    ['如果山不走过来，那我就走过去。'] = '如果山不走過來，那我就走過去。', 
    ['如果我们完全用欧洲人的方式生活，那我们还是自己吗？'] = '如果我們完全用歐洲人的方式生活，那我們還是自己嗎？', 
    ['如果我们绕着太阳转，为什么我不会头晕呢？'] = '如果我們繞著太陽轉，為什麼我不會頭暈呢？', 
    ['如果我因为带回这美妙的商品而成为里斯本最有名的会计师，我可一定也不会意外呢！'] = '如果我因為帶回這美妙的商品而成為裡斯本最有名的會計師，我可一定也不會意外呢！', 
    ['如果我真是小女生，就不可能在大海之上遇上狂风暴雨时，还能对其他水手指挥若定并且安全度过暴风雨。'] = '如果我真是小女生，就不可能在大海之上遇上狂風暴雨時，還能對其他水手指揮若定並且安全度過暴風雨。', 
    ['如果我能在竞技场里取得胜利，那么对于我的探索和影响力一定会有所帮助，那么，去试试看吧，听说奖励还非常丰厚呢！'] = '如果我能在競技場里取得勝利，那麼對於我的探索和影響力一定會有所幫助，那麼，去試試看吧，聽說獎勵還非常豐厚呢！', 
    ['如果是平常我肯定臭骂你，但是现在老娘没有力气，你要去谢谢俞红袖小姐，是她救了我们。'] = '如果是平常我肯定臭罵你，但是現在老娘沒有力氣，你要去謝謝俞紅袖小姐，是她救了我們。', 
    ['如果有人问玛丽，是否惧怕绞刑架，她会哈哈大笑后告诉你：“绞刑并不可怕，如果没有绞刑，那么胆小如鼠的人都能成为海盗了！”'] = '如果有人問瑪麗，是否懼怕絞刑架，她會哈哈大笑後告訴你：“絞刑並不可怕，如果沒有絞刑，那麼膽小如鼠的人都能成為海盜了！”', 
    ['如果没有背后政权的支持，没有任何一个公司能够做到东印度那样的程度，说到底东印度公司不过是皇宫贵族们的走狗罢了。'] = '如果沒有背後政權的支持，沒有任何一個公司能夠做到東印度那樣的程度，說到底東印度公司不過是皇宮貴族們的走狗罷了。', 
    ['如果能够选择，没人会选择当奴隶而不是主人。'] = '如果能夠選擇，沒人會選擇當奴隸而不是主人。', 
