    ['如果过几天的话我一定会考虑，但最近广州在举办美食节，正是我大显身手的时候。'] = '如果過幾天的話我一定會考慮，但最近廣州在舉辦美食節，正是我大顯身手的時候。', 
    ['如果遭遇海盗是无法避免的事，那么也许大多数人会宁肯遇上的是黑男爵的手下。因为只要放弃抵抗，就不会有比损失财物更不幸的后果。'] = '如果遭遇海盜是無法避免的事，那麼也許大多數人會寧肯遇上的是黑男爵的手下。因為只要放棄抵抗，就不會有比損失財物更不幸的後果。', 
    ['如果问每一个商船的船长，谁才是他们最畏惧的海盗王，无疑“黑胡子”爱德华·蒂奇的名字会无数次被反复提起。这个曾经参与过英西海战，在欧洲、非洲和新大陆之间的“金三角”航线上大发其财的海盗王，以他残忍及果敢的行动让所有贸易船主不寒而栗，甚至连军舰，都不愿意遇上这个可怕的海上魔鬼。'] = '如果問每一個商船的船長，誰才是他們最畏懼的海盜王，無疑“黑鬍子”愛德華•蒂奇的名字會無數次被反覆提起。這個曾經參與過英西海戰，在歐洲、非洲和新大陸之間的“金三角”航線上大發其財的海盜王，以他殘忍及果敢的行動讓所有貿易船主不寒而慄，甚至連軍艦，都不願意遇上這個可怕的海上魔鬼。', 
