    ['年纪轻轻便思虑过重，会有少年白头的危险。你们不是在寻找女神之誓碎片吗？我可以告诉你们它在谁的手上，可是这个人心狠手辣，实力强劲，你须得向我证明自己，我才会告诉你这个人是谁。'] = '年紀輕輕便思慮過重，會有少年白頭的危險。你們不是在尋找女神之誓碎片嗎？我可以告訴你們它在誰的手上，可是這個人心狠手辣，實力強勁，你須得向我證明自己，我才會告訴你這個人是誰。', 
    ['年轻人不要着急，现在正是冒险家协会发放奖励的时刻，免费的东西不要白不要，我们一起过去领取吧。'] = '年輕人不要著急，現在正是冒險家協會發放獎勵的時刻，免費的東西不要白不要，我們一起過去領取吧。', 
    ['年轻人你要想清楚，你这样做不仅会得罪亨利王子，还会与荷兰人为敌。'] = '年輕人你要想清楚，你這樣做不僅會得罪亨利王子，還會與荷蘭人為敵。', 
    ['年轻人，“邪恶的号角奏响，海水无法熄灭的火焰降临”，我们还是暂避锋芒为好。'] = '年輕人，“邪惡的號角奏響，海水無法熄滅的火焰降臨”，我們還是暫避鋒芒為好。', 
    ['年轻人，你们竟然还在码头大摇大摆！难道不知道吗？你们突袭伊斯坦堡的消息已经传开了，听说巴巴罗萨正率领他的庞大舰队往回赶呢！'] = '年輕人，你們竟然還在碼頭大搖大擺！難道不知道嗎？你們突襲伊斯坦堡的消息已經傳開了，聽說巴巴羅薩正率領他的龐大艦隊往回趕呢！', 
    ['年轻人，你先别忙着拒绝，我知道你在寻找着什么东西。一种散发着粉色光芒，氤氲着神秘气息的名叫古兰圣珠的宝石对不对？'] = '年輕人，你先別忙著拒絕，我知道你在尋找著什麼東西。一種散髮著粉色光芒，氤氳著神秘氣息的名叫古蘭聖珠的寶石對不對？', 
    ['年轻人，你现在的样子真像你的父亲。宿命，是否会归于一线呢……'] = '年輕人，你現在的樣子真像你的父親。宿命，是否會歸於一線呢……', 
    ['年轻人，你现在这艘小船当旗舰确实有些勉强，不过没关系，在之前战斗中获得的金币是可以用来强化船只装备的，你只需要进入舰队进行$(missioncolor:【装配研究】)，就能极大提升火炮的威力。'] = '年輕人，你現在這艘小船當旗艦確實有些勉強，不過沒關係，在之前戰鬥中獲得的金幣是可以用來強化船隻裝備的，你只需要進入艦隊進行$(missioncolor:【裝配研究】)，就能極大提升火炮的威力。', 
    ['年轻人，你看我说的没错吧，大学者安度因的弟子，自然不简单……'] = '年輕人，你看我說的沒錯吧，大學者安度因的弟子，自然不簡單……', 
    ['年轻人，你这又是何必呢？这样的性格将是你在日后航程中的阻碍。'] = '年輕人，你這又是何必呢？這樣的性格將是你在日後航程中的阻礙。', 
    ['年轻人，在北海，对于舰队来说最危险的并非是海盗，而是随处可见的浮冰。'] = '年輕人，在北海，對於艦隊來說最危險的並非是海盜，而是隨處可見的浮冰。', 
    ['年轻人，快走！“邪恶的号角奏响，海水无法熄灭的火焰降临”！'] = '年輕人，快走！“邪惡的號角奏響，海水無法熄滅的火焰降臨”！', 
    ['年轻人，我们刚从海盗手中缴获的金币可以升级船只装备，只要进入舰队进行$(missioncolor:【装配研究】)，应对之后的战斗可能会轻松一些。'] = '年輕人，我們剛從海盜手中繳獲的金幣可以升級船隻裝備，只要進入艦隊進行$(missioncolor:【裝配研究】)，應對之後的戰鬥可能會輕鬆一些。', 
    ['年轻人，我来给你介绍一下。这是西印度公司总督彼得松·霍因。此次前来，是为商谈联手对抗东印度公司的事情。你有没有带来迪欧·霍阿将军的消息？'] = '年輕人，我來給你介紹一下。這是西印度公司總督彼得松•霍因。此次前來，是為商談聯手對抗東印度公司的事情。你有沒有帶來迪歐•霍阿將軍的消息？', 
    ['年轻人，我自然是要控制整个印度洋了。我可不是黑斯廷斯那个蠢货，一味的强硬只会带来无止境的反抗，而当海盗入侵，统治者无能为力，实力大减，而我再以救世主的身份出现……'] = '年輕人，我自然是要控制整個印度洋了。我可不是黑斯廷斯那個蠢貨，一味的強硬只會帶來無止境的反抗，而當海盜入侵，統治者無能為力，實力大減，而我再以救世主的身分出現……', 
    ['年轻人，新消息称阿芒德的地盘——$(missioncolor:【突尼斯】)最近有些异动，说不定与拉比斯有关……'] = '年輕人，新消息稱阿芒德的地盤——$(missioncolor:【突尼斯】)最近有些異動，說不定與拉比斯有關……', 
