    ['年轻人，没时间感慨了。卢卡斯的旗舰就在前方。让我们突击过去给他点颜色看看！'] = '年輕人，沒時間感慨了。盧卡斯的旗艦就在前方。讓我們突擊過去給他點顏色看看！', 
