    ['年轻人，这是工匠公会的信物。工匠公会是七海中闻名的中立组织。有了这个就能够请动那群臭脾气的嗜酒如命的老家伙帮忙改造船只了。你是从哪得到的？'] = '年輕人，這是工匠公會的信物。工匠公會是七海中聞名的中立組織。有了這個就能夠請動那群臭脾氣的嗜酒如命的老家伙幫忙改造船隻了。你是從哪得到的？', 
    ['并不是所有瞭望手都有打捞技能。'] = '並不是所有瞭望手都有打撈技能。', 
