    ['意大利人。威尼斯的吟游诗人，穷困潦倒的日子里和一个老水手出海寻找出路，喜欢在甲板上用曼陀林弹奏哀伤的情歌。'] = '意大利人。威尼斯的吟游詩人，窮困潦倒的日子里和一個老水手出海尋找出路，喜歡在甲板上用曼陀林彈奏哀傷的情歌。', 
