    ['意大利人。标准的意大利美男子，优雅健谈、魅力四射，晋升之路十分顺遂，三年就当上了大副。是海上有名的单身贵族，因为太过完美总是被怀疑取向。'] = '意大利人。標準的意大利美男子，優雅健談、魅力四射，晉升之路十分順遂，三年就當上了大副。是海上有名的單身貴族，因為太過完美總是被懷疑取向。', 
    ['意大利人。波隆那大学的问题学生，因为讥讽政局被开除。退学后开始做水手，被誉为“海上政治家”，一直将船作为一个小型社会模型来研究。'] = '意大利人。波隆那大學的問題學生，因為譏諷政局被開除。退學後開始做水手，被譽為“海上政治家”，一直將船作為一個小型社會模型來研究。', 
    ['意大利人。生于水手之乡热那亚，是地圆学说的坚定信奉者，他坚称从欧洲往西航行，横穿大西洋是抵达东方国度的最近路途。'] = '意大利人。生於水手之鄉熱那亞，是地圓學說的堅定信奉者，他堅稱從歐洲往西航行，橫穿大西洋是抵達東方國度的最近路途。', 
    ['意大利人。维克多的童年好友，对维克多英俊的容貌不屑一顾，经常讽刺挖苦，实际上却非常珍惜这份友谊，经常帮维克多摆平暗处的敌人。'] = '意大利人。維克多的童年好友，對維克多英俊的容貌不屑一顧，經常諷刺挖苦，實際上卻非常珍惜這份友誼，經常幫維克多擺平暗處的敵人。', 
    ['意大利人垄断了胡椒贸易，促使葡萄牙人开拓了前往印度的新航线，使之成为风靡欧洲的香料。'] = '意大利人壟斷了胡椒貿易，促使葡萄牙人開拓了前往印度的新航線，使之成為風靡歐洲的香料。', 
