    ['成为海军中将后，亨利·摩根袭击了古巴，又袭击了巴拿马的城市。这座城市很大，防守严密，很多有经验的海盗都认为不可攻破。亨利·摩根使用独木舟夜间悄悄潜入港口，突破三道防线拿下这座重镇，被称“西班牙人灾星”。'] = '成為海軍中將後，亨利•摩根襲擊了古巴，又襲擊了巴拿馬的城市。這座城市很大，防守嚴密，很多有經驗的海盜都認為不可攻破。亨利•摩根使用獨木舟夜間悄悄潛入港口，突破三道防線拿下這座重鎮，被稱“西班牙人災星”。', 
