    ['成果不错啊，英国红茶到现在依旧是畅销品！跟着商船出海即安全又有钱挣，是一个不错的工作。后来发生了一件事，我放弃了这个工作……'] = '成果不錯啊，英國紅茶到現在依舊是暢銷品！跟著商船出海即安全又有錢掙，是一個不錯的工作。後來發生了一件事，我放棄了這個工作……', 
    ['成熟，当务之急是想办法如何在汉萨同盟的垄断下争得北海的利益。'] = '成熟，當務之急是想辦法如何在漢薩同盟的壟斷下爭得北海的利益。', 
    ['我'] = '我', 
    ['我——奥斯曼海盗之王，会亲手把你们一起解决掉。'] = '我——奧斯曼海盜之王，會親手把你們一起解決掉。', 
    ['我……我的月饼……全毁了……。'] = '我……我的月餅……全毀了……。', 
    ['我、你、你们……啊……不要打我英俊的脸……'] = '我、你、你們……啊……不要打我英俊的臉……', 
    ['我、我没、没醉，也就是穿梭几个大漩涡的事，等、等着啊。'] = '我、我沒、沒醉，也就是穿梭幾個大漩渦的事，等、等著啊。', 
    ['我一定会回来的！'] = '我一定會回來的！', 
    ['我一定会找到老船长继承人，一定会！'] = '我一定會找到老船長繼承人，一定會！', 
    ['我一定能甩开你们的！'] = '我一定能甩開你們的！', 
    ['我一直不太明白，黄金宝石不也是普通石头吗？'] = '我一直不太明白，黃金寶石不也是普通石頭嗎？', 
    ['我丈夫三年前去跑生意，之后再没回来。'] = '我丈夫三年前去跑生意，之後再沒回來。', 
    ['我不会跟你争夺这个荣誉的，不过“风暴角”可不是一个让人欢乐的名字，它让我们看到了更广阔的世界，为何不叫它“好望角”呢？'] = '我不會跟你爭奪這個榮譽的，不過“風暴角”可不是一個讓人歡樂的名字，它讓我們看到了更廣闊的世界，為何不叫它“好望角”呢？', 
    ['我不太清楚圣乔治是什么意思。'] = '我不太清楚聖喬治是什麼意思。', 
    ['我不如地狱，谁入地狱。'] = '我不如地獄，誰入地獄。', 
    ['我不懂你们为什么要定居下来，到处迁徙不好吗？'] = '我不懂你們為什麼要定居下來，到處遷徙不好嗎？', 
    ['我不是将军，也不是海盗，我只是我自己。'] = '我不是將軍，也不是海盜，我只是我自己。', 
    ['我不管，你答应过我要替我找回命运号的，否则别想我带你去世界的尽头。'] = '我不管，你答應過我要替我找回命運號的，否則別想我帶你去世界的盡頭。', 
    ['我为我的伙伴骄傲！只可惜，现在只剩下我和大副安东尼奥了……'] = '我為我的伙伴驕傲！只可惜，現在只剩下我和大副安東尼奧了……', 
    ['我为我的族人对你们所犯下的罪行道歉。'] = '我為我的族人對你們所犯下的罪行道歉。', 
    ['我之前对于正义的理解太肤浅了，从你们身上我们看到真正的正义，希望你们能把光复正义的智慧传授予我！'] = '我之前對於正義的理解太膚淺了，從你們身上我們看到真正的正義，希望你們能把光復正義的智慧傳授予我！', 
    ['我也明白，但我不愿就此抛却任何一艘曾经陪伴我的船。我已经提升到爵位到三等男爵，可以进阶【轻木帆船】，让它以全新的姿态伴随我们继续战斗。'] = '我也明白，但我不願就此拋卻任何一艘曾經陪伴我的船。我已經提升到爵位到三等男爵，可以進階【輕木帆船】，讓它以全新的姿態伴隨我們繼續戰鬥。', 
    ['我也是一名水手，船上才是我的家。'] = '我也是一名水手，船上才是我的家。', 
    ['我也是这么想，如果我真的打捞了沉船，一定可以将玛利亚迎娶进门，但是没有一个人找到那些宝藏，见鬼，包括我！'] = '我也是這麼想，如果我真的打撈了沉船，一定可以將瑪利亞迎娶進門，但是沒有一個人找到那些寶藏，見鬼，包括我！', 
    ['我也正有此意，因马尼拉海盗的埋伏，我们损失了不少人手，如果几位能协助我们，双方合力一举剿灭陈祖义，真是感激不尽。'] = '我也正有此意，因馬尼拉海盜的埋伏，我們損失了不少人手，如果幾位能協助我們，雙方合力一舉剿滅陳祖義，真是感激不盡。', 
    ['我也知道这很困难，但我不会放弃，除非有一天我也死去。'] = '我也知道這很困難，但我不會放棄，除非有一天我也死去。', 
    ['我也觉得十分奇怪，难道是霍金斯从某些特殊渠道弄来的装备？'] = '我也覺得十分奇怪，難道是霍金斯從某些特殊渠道弄來的裝備？', 
    ['我也觉得很很奇怪，但现在也不好突然上前发问，只能静观其变。'] = '我也覺得很很奇怪，但現在也不好突然上前發問，只能靜觀其變。', 
    ['我亲爱的船长，感谢你用勇气和牺牲为我们带来这场重要的胜利！'] = '我親愛的船長，感謝你用勇氣和犧牲為我們帶來這場重要的勝利！', 
    ['我从小就在长辈的关照下经营海上贸易，父母去世时我答应过他们，不让他们失望。'] = '我從小就在長輩的關照下經營海上貿易，父母去世時我答應過他們，不讓他們失望。', 
    ['我从小就想见识到世界各地所有珍稀的货物，海上的风险都吓不到我的。'] = '我從小就想見識到世界各地所有珍稀的貨物，海上的風險都嚇不到我的。', 
    ['我从没去过更远的地方，还是部落里最安全。'] = '我從沒去過更遠的地方，還是部落里最安全。', 
    ['我从没见过一个人的眼睛像他一般贪婪和冷漠，如果 马丁·金 无法说服他不再贩卖同胞，那么霍金斯迟早会卷土重来！'] = '我從沒見過一個人的眼睛像他一般貪婪和冷漠，如果 馬丁•金 無法說服他不再販賣同胞，那麼霍金斯遲早會卷土重來！', 
    ['我从船头搜到船尾，终于找到%s个【%s】，和这件古老的宝物【%s】，再看看有没有其他东西吧！'] = '我從船頭搜到船尾，終於找到%s個【%s】，和這件古老的寶物【%s】，再看看有沒有其他東西吧！', 
    ['我以那个暴戾的家伙是我的同胞为耻！而我千里迢迢赶来也绝不是为了躲在舷墙后看热闹，请允许我，加入防御部队吧！'] = '我以那個暴戾的家伙是我的同胞為恥！而我千里迢迢趕來也絕不是為了躲在舷牆後看熱鬧，請允許我，加入防禦部隊吧！', 
    ['我们不像海盗只在乎掠夺，要得到开展贸易的许可需先获取信任，让我们到【市政厅】为港口的繁荣做些贡献吧！'] = '我們不像海盜只在乎掠奪，要得到開展貿易的許可需先獲取信任，讓我們到【市政廳】為港口的繁榮做些貢獻吧！', 
    ['我们不关心历史，我们只关心未来。'] = '我們不關心歷史，我們只關心未來。', 
    ['我们不崇拜钱和权力，只崇拜最优秀的猎手。'] = '我們不崇拜錢和權力，只崇拜最優秀的獵手。', 
    ['我们不想向贪婪的国王交税。'] = '我們不想向貪婪的國王交稅。', 
    ['我们不是强盗'] = '我們不是強盜', 
    ['我们不生产粮食，我们只是大自然的搬运工。'] = '我們不生產糧食，我們只是大自然的搬運工。', 
    ['我们不能再让他背负更多的责任，请给他庇护。'] = '我們不能再讓他背負更多的責任，請給他庇護。', 
    ['我们也比在突尼斯的时候更强大！打起精神，让敌人看看我们舰队的实力吧。'] = '我們也比在突尼斯的時候更強大！打起精神，讓敵人看看我們艦隊的實力吧。', 
    ['我们亏欠赛维·达·汉太多了，当初他试图通过与殖民者贸易来保护部落，但却遭到了我们的驱逐。'] = '我們虧欠賽維•達•漢太多了，當初他試圖通過與殖民者貿易來保護部落，但卻遭到了我們的驅逐。', 
    ['我们会向你证明我们的信誉，但你必须为你无礼道歉。'] = '我們會向你證明我們的信譽，但你必須為你無禮道歉。', 
    ['我们击败卢卡斯是仅仅因为是因为正义而已，并不求其他回报，如果是我的父亲在这里，他也一定会做和我的一样的事情。'] = '我們擊敗盧卡斯是僅僅因為是因為正義而已，並不求其他回報，如果是我的父親在這裡，他也一定會做和我的一樣的事情。', 
    ['我们刚刚从商会兑换了些物资，不过还需要水手宝物来武装自己才行。毕竟在丛林遗迹之中，处处充满了危机。'] = '我們剛剛從商會兌換了些物資，不過還需要水手寶物來武裝自己才行。畢竟在叢林遺跡之中，處處充滿了危機。', 
    ['我们到了，英国最负盛名的出海港口之一—普利茅斯。'] = '我們到了，英國最負盛名的出海港口之一—普利茅斯。', 
    ['我们原住民的烟草在你们那里很受欢迎。'] = '我們原住民的煙草在你們那裡很受歡迎。', 
    ['我们可以买一些货物到【文莱】去售卖。'] = '我們可以買一些貨物到【文萊】去售賣。', 
    ['我们可以去【亚丁】附近的海面转转，那些私掠船一定就潜伏在不远处。'] = '我們可以去【亞丁】附近的海面轉轉，那些私掠船一定就潛伏在不遠處。', 
    ['我们向%s商会发起了商会战，本次商会战将持续24小时。'] = '我們向%s商會發起了商會戰，本次商會戰將持續24小時。', 
    ['我们向%s商会发起了商会战，本次商会战将持续30分钟。'] = '我們向%s商會發起了商會戰，本次商會戰將持續30分鐘。', 
    ['我们在东南亚还有未解锁的港口,'] = '我們在東南亞還有未解鎖的港口,', 
    ['我们在北海还有未解锁的港口,'] = '我們在北海還有未解鎖的港口,', 
    ['我们在印度洋还有未解锁的港口,'] = '我們在印度洋還有未解鎖的港口,', 
    ['我们在地中海还有未解锁的港口,'] = '我們在地中海還有未解鎖的港口,', 
    ['我们在非洲还有未解锁的港口,'] = '我們在非洲還有未解鎖的港口,', 
    ['我们好像比预期到的早了些，这么空着手过去拜访彼得松·霍因有些失礼。这样，辛西亚去采购些礼物，其余人就地解散，好好休息一天，一天后在此集合。'] = '我們好像比預期到的早了些，這麼空著手過去拜訪彼得松•霍因有些失禮。這樣，辛西亞去採購些禮物，其餘人就地解散，好好休息一天，一天后在此集合。', 
    ['我们对佛得角的地形不熟悉，与其等着被伏击，不如直接进击海盗的大本营--比绍，收拾掉敌人，才能安心的进行贸易呢。'] = '我們對佛得角的地形不熟悉，與其等著被伏擊，不如直接進擊海盜的大本營--比紹，收拾掉敵人，才能安心的進行貿易呢。', 
    ['我们已有同盟商会了，需要解除原有同盟后再请求缔结同盟关系'] = '我們已有同盟商會了，需要解除原有同盟後再請求締結同盟關係', 
    ['我们已经击败了%s，成为%s霸主，试着去挑战其他海域吧！'] = '我們已經擊敗了%s，成為%s霸主，試著去挑戰其他海域吧！', 
    ['我们已经击败了对手%s,提升了名望和地位，赶快领取奖励迎接新的挑战吧！'] = '我們已經擊敗了對手%s,提升了名望和地位，趕快領取獎勵迎接新的挑戰吧！', 
    ['我们已经在东印度建立了自己的公司。'] = '我們已經在東印度建立了自己的公司。', 
    ['我们已经完成了目标，让我们去'] = '我們已經完成了目標，讓我們去', 
    ['我们已经完成了老希勒的使命，回到【汉堡】向他复命，不知道会得到什么奖励呢？'] = '我們已經完成了老希勒的使命，回到【漢堡】向他覆命，不知道會得到什麼獎勵呢？', 
    ['我们已经获得了15枚竞技星徽了，这有什么用？'] = '我們已經獲得了15枚競技星徽了，這有什麼用？', 
    ['我们已经获得了最先进的战舰，让我们去'] = '我們已經獲得了最先進的戰艦，讓我們去', 
    ['我们应该靠近遗迹【%s】了，沿海岸线进行搜寻，点击遗迹访问遗迹'] = '我們應該靠近遺跡【%s】了，沿海岸線進行搜尋，點擊遺跡訪問遺跡', 
    ['我们当然可以成为伙伴，加入我的船队怎么样？'] = '我們當然可以成為伙伴，加入我的船隊怎麼樣？', 
    ['我们得想办法对付那些强大的炮塔。'] = '我們得想辦法對付那些強大的炮塔。', 
    ['我们必须尽快“靠近”被俘的商船才能营救他们。如果商船进入霍尔木兹海峡，我们就没法追上了。'] = '我們必須儘快“靠近”被俘的商船才能營救他們。如果商船進入霍爾木茲海峽，我們就沒法追上了。', 
    ['我们必须给他们一个教训。'] = '我們必須給他們一個教訓。', 
    ['我们必须赶快到【第乌】去。'] = '我們必須趕快到【第烏】去。', 
    ['我们必须阻截敌人，让苏菲尽快摆脱对方，只要回到港口，她就安全了！'] = '我們必須阻截敵人，讓蘇菲儘快擺脫對方，只要回到港口，她就安全了！', 
    ['我们快回【圣乔治】去吧。'] = '我們快回【聖喬治】去吧。', 
    ['我们快回【大阪】去吧。'] = '我們快回【大阪】去吧。', 
    ['我们把货物都给你们，有好酒，好肉，好鱼！我们投降！'] = '我們把貨物都給你們，有好酒，好肉，好魚！我們投降！', 
    ['我们收到撤退回来船只的信息，赶过来支援你们！'] = '我們收到撤退回來船隻的信息，趕過來支援你們！', 
    ['我们攻下了文莱，陈祖义那边一定已经有所防备了，接下来的行动必须更加小心才行'] = '我們攻下了文萊，陳祖義那邊一定已經有所防備了，接下來的行動必須更加小心才行', 
    ['我们攻占了敌方商会据点，望大家再接再厉。'] = '我們攻佔了敵方商會據點，望大家再接再厲。', 
    ['我们是为郑和的遗物而来。'] = '我們是為鄭和的遺物而來。', 
    ['我们是从中国来的。'] = '我們是從中國來的。', 
    ['我们是太阳的子孙。'] = '我們是太陽的子孫。', 
    ['我们是威尼斯在亚得里亚海上唯一的竞争对手。'] = '我們是威尼斯在亞得里亞海上唯一的競爭對手。', 
    ['我们是经过伟大的女王允许的。'] = '我們是經過偉大的女王允許的。', 
    ['我们有了新的船只，并且在与敌人的战斗中学习到了新的舰队阵型！您需要进行新的配置，那样对战斗有极大的帮助。'] = '我們有了新的船隻，並且在與敵人的戰鬥中學習到了新的艦隊陣型！您需要進行新的配置，那樣對戰鬥有極大的幫助。', 
    ['我们有足够的航海士信物了，试试信物招募吧。'] = '我們有足夠的航海士信物了，試試信物招募吧。', 
    ['我们本来就打算向贵军请求援助，如此最好。'] = '我們本來就打算向貴軍請求援助，如此最好。', 
    ['我们来决一死战吧！'] = '我們來決一死戰吧！', 
    ['我们来得及时，否则这一切都可能会被破坏殆尽，这也更坚定了我阻止达尔布克基的决心，不要耽误时间了，继续驰援$(missioncolor:【泉州】)。'] = '我們來得及時，否則這一切都可能會被破壞殆盡，這也更堅定了我阻止達爾布克基的決心，不要耽誤時間了，繼續馳援$(missioncolor:【泉州】)。', 
    ['我们正在洽谈合作的事宜，自从东印度公司溃败之后，这片海域愈发混乱了起来，盗贼四起，我正想请彼得松先生帮助我们清缴海盗，保护我的国家。'] = '我們正在洽談合作的事宜，自從東印度公司潰敗之後，這片海域愈發混亂了起來，盜賊四起，我正想請彼得松先生幫助我們清繳海盜，保護我的國家。', 
    ['我们正好缺一个像火药一样烈的火炮手，将【汉娜】任命为'] = '我們正好缺一個像火藥一樣烈的火炮手，將【漢娜】任命為', 
    ['我们每一次战役靠的可不是幸运女神的眷顾，靠的是实力，东方有句话说的很好，兵来将挡水来土掩，无论陈祖义设下什么陷阱，最终我们都会获胜！'] = '我們每一次戰役靠的可不是幸運女神的眷顧，靠的是實力，東方有句話說的很好，兵來將擋水來土掩，無論陳祖義設下什麼陷阱，最終我們都會獲勝！', 
    ['我们没能保护好“吉达号”，任务失败了...'] = '我們沒能保護好“吉達號”，任務失敗了...', 
    ['我们用牲畜和你们交换各种谷物。'] = '我們用牲畜和你們交換各種穀物。', 
    ['我们的事业是正义的，红胡子。我会加入神圣同盟，亲手赐予你失败。'] = '我們的事業是正義的，紅鬍子。我會加入神聖同盟，親手賜予你失敗。', 
    ['我们的国王同时也是神圣罗马帝国的皇帝。'] = '我們的國王同時也是神聖羅馬帝國的皇帝。', 
    ['我们的国王被处死之后，印加帝国成为了西班牙的傀儡。'] = '我們的國王被處死之後，印加帝國成為了西班牙的傀儡。', 
    ['我们的城市被称为伊比利亚半岛的明珠。'] = '我們的城市被稱為伊比利亞半島的明珠。', 
    ['我们的大副又在吵吵嚷嚷了，真是的，身为一个航海士一定要稳……那是，拉比斯！走，快跟上！'] = '我們的大副又在吵吵嚷嚷了，真是的，身為一個航海士一定要穩……那是，拉比斯！走，快跟上！', 
    ['我们的征途是星辰大海。'] = '我們的征途是星辰大海。', 
    ['我们的总督才是加勒比海最大的强盗。'] = '我們的總督才是加勒比海最大的強盜。', 
    ['我们的总督是一个伪善的贩奴者！'] = '我們的總督是一個偽善的販奴者！', 
    ['我们的总督是印度殖民地的建立者。'] = '我們的總督是印度殖民地的建立者。', 
    ['我们的木工已经无法应付这样的巨舰，走，去酒馆碰碰运气，说不定能遇到一位合适的木工。'] = '我們的木工已經無法應付這樣的巨艦，走，去酒館碰碰運氣，說不定能遇到一位合適的木工。', 
    ['我们的目标是【摩尔运奴船】，别去招惹那些船坚炮利的护卫舰！'] = '我們的目標是【摩爾運奴船】，別去招惹那些船堅炮利的護衛艦！', 
    ['我们的舰队已经集结完毕了，让我们为了生命的平等而战！大地母亲一定会护佑着我们！启程！目标--莫桑比克！'] = '我們的艦隊已經集結完畢了，讓我們為了生命的平等而戰！大地母親一定會護佑著我們！啟程！目標--莫桑比克！', 
    ['我们的资金十分充足，再次升级装备，强力的火炮才是男人的浪漫'] = '我們的資金十分充足，再次升級裝備，強力的火炮才是男人的浪漫', 
    ['我们目前为本港口第一商会，无法与其它商会缔结同盟关系'] = '我們目前為本港口第一商會，無法與其它商會締結同盟關係', 
    ['我们相信，年纪越大的人越有智慧。'] = '我們相信，年紀越大的人越有智慧。', 
    ['我们终于可以多一艘船了吗，船长。太好了，这下不用在晚上窝在小船舱里听辛西亚数金币，蒂奇甩皮鞭和汉娜调试火枪的声音了。谢天谢地，我能睡个好觉了。'] = '我們終於可以多一艘船了嗎，船長。太好了，這下不用在晚上窩在小船艙里聽辛西亞數金幣，蒂奇甩皮鞭和漢娜調試火槍的聲音了。謝天謝地，我能睡個好覺了。', 
    ['我们被包围了，向西航行，快，利用地形，在他们靠近酒桶时攻击水面的酒桶！'] = '我們被包圍了，向西航行，快，利用地形，在他們靠近酒桶時攻擊水面的酒桶！', 
    ['我们被打败了，提升船只、装配或者航海士的能力后重新挑战吧！'] = '我們被打敗了，提升船隻、裝配或者航海士的能力後重新挑戰吧！', 
    ['我们要想前往“世界的尽头”，还真是少不了她。走吧，等找到她，说什么都要好好教训一顿！'] = '我們要想前往“世界的盡頭”，還真是少不了她。走吧，等找到她，說什麼都要好好教訓一頓！', 
    ['我们认识的第一个欧洲人叫达·伽马。'] = '我們認識的第一個歐洲人叫達•伽馬。', 
    ['我们该为接下来的征程赚取更多的金钱！记得航经每一个港口都到交易所看看！我们的目标是：拥有4000银币！'] = '我們該為接下來的征程賺取更多的金錢！記得航經每一個港口都到交易所看看！我們的目標是：擁有4000銀幣！', 
    ['我们跟随霍金斯的行踪一路追到这里，突然失去了他的踪迹。不知道这个恶棍躲在了什么地方。'] = '我們跟隨霍金斯的行蹤一路追到這裡，突然失去了他的蹤跡。不知道這個惡棍躲在了什麼地方。', 
    ['我们这样带着几十人回去已经回引起怀疑，先去【交易所】把货物装满仓作为掩饰吧。'] = '我們這樣帶著幾十人回去已經回引起懷疑，先去【交易所】把貨物裝滿倉作為掩飾吧。', 
    ['我们这种人怎么配认识有钱人家的老爷？我母亲等了他十几年，一直等到死，现在我只想让他早点下地狱！'] = '我們這種人怎麼配認識有錢人家的老爺？我母親等了他十幾年，一直等到死，現在我只想讓他早點下地獄！', 
    ['我们这里卖椰子，这可不是哪里都买的到。'] = '我們這裡賣椰子，這可不是哪裡都買的到。', 
    ['我们这里有很多水果，但交易所只卖椰子。'] = '我們這裡有很多水果，但交易所只賣椰子。', 
    ['我们这里的乳香非常著名。'] = '我們這裡的乳香非常著名。', 
    ['我们这里的雪莉酒非常有名。'] = '我們這裡的雪莉酒非常有名。', 
    ['我们遭到攻击了!'] = '我們遭到攻擊了!', 
    ['我们首要目标是摧毁炮台，同时不能让货船运走货物，最后击败彼得松•霍因，夺回卡利卡特。'] = '我們首要目標是摧毀炮台，同時不能讓貨船運走貨物，最後擊敗彼得松•霍因，奪回卡利卡特。', 
    ['我们？还有其他人？'] = '我們？還有其他人？', 
    ['我会为你们弄到足够的货源，希望你们能够振作起来。'] = '我會為你們弄到足夠的貨源，希望你們能夠振作起來。', 
    ['我会带你们回去，只要你们把刚才说过的话告诉你们的同胞，让他们都醒过来吧。'] = '我會帶你們回去，只要你們把剛纔說過的話告訴你們的同胞，讓他們都醒過來吧。', 
    ['我会更强大！而你必将失败！'] = '我會更強大！而你必將失敗！', 
    ['我会让他上我的船，成为我的伙伴，我保证。'] = '我會讓他上我的船，成為我的伙伴，我保證。', 
    ['我会负责监视马铃薯的，小心点，可别引来增援哦。'] = '我會負責監視馬鈴薯的，小心點，可別引來增援哦。', 
    ['我倒不是担心这个，之前阻止了达尔布克基，此事最好还是先回$(missioncolor:【里斯本】)向亨利王子解释一番。'] = '我倒不是擔心這個，之前阻止了達爾布克基，此事最好還是先回$(missioncolor:【裡斯本】)向亨利王子解釋一番。', 
    ['我倒是挺羡慕他们这样的生活，起码非常安宁……'] = '我倒是挺羡慕他們這樣的生活，起碼非常安寧……', 
    ['我倒是觉得事情没这么简单。'] = '我倒是覺得事情沒這麼簡單。', 
    ['我做这些事并不为了需要朝廷承认，只是这对天下女子来说不公平。'] = '我做這些事並不為了需要朝廷承認，只是這對天下女子來說不公平。', 
    ['我准备在岛的西边开辟一片咖啡豆种植园。'] = '我準備在島的西邊開闢一片咖啡豆種植園。', 
    ['我准备造一艘名叫白银梅丽号的船。'] = '我準備造一艘名叫白銀梅麗號的船。', 
    ['我刚从俘虏口中探听得知，拉比斯趁着我们攻打亚历山大的时候，脱身逃往了$(missioncolor:【威尼斯】)。'] = '我剛從俘虜口中探聽得知，拉比斯趁著我們攻打亞歷山大的時候，脫身逃往了$(missioncolor:【威尼斯】)。', 
    ['我刚刚听到一个孩童说着一些奇怪的东西，好像是狮首象身的怪物和什么住在深海里半人半蛇的那伽摩纳娑……'] = '我剛剛聽到一個孩童說著一些奇怪的東西，好像是獅首象身的怪物和什麼住在深海裡半人半蛇的那伽摩納娑……', 
    ['我刚好要去见一位老朋友，那么回头见。'] = '我剛好要去見一位老朋友，那麼回頭見。', 
    ['我到东南方的【锡兰】去求援吧，希望他们明白厉害关系，愿意伸出援手。'] = '我到東南方的【錫蘭】去求援吧，希望他們明白厲害關係，願意伸出援手。', 
    ['我到今天这个地步全是拜这群恶魔所赐！实不相瞒，我是萨尔法八世，这片土地的国王。曾经这是一篇祥和的土地，直到恶魔降临，烧杀掳掠。我的人民奋起抵抗却无法抗拒那恐怖的巨龙吐息。他们夺走了我的王位，奴役着我的子民。而我，只能四处躲避，等待复国的时机。'] = '我到今天這個地步全是拜這群惡魔所賜！實不相瞞，我是薩爾法八世，這片土地的國王。曾經這是一篇祥和的土地，直到惡魔降臨，燒殺擄掠。我的人民奮起抵抗卻無法抗拒那恐怖的巨龍吐息。他們奪走了我的王位，奴役著我的子民。而我，只能四處躲避，等待復國的時機。', 
    ['我又回来了，这次，我带了无敌战舰送给你们，哈哈哈哈'] = '我又回來了，這次，我帶了無敵戰艦送給你們，哈哈哈哈', 
    ['我发誓，为了加尔各答的自由，我们一定能取得胜利！'] = '我發誓，為了加爾各答的自由，我們一定能取得勝利！', 
    ['我只不过是尽我作为一名管家的本分而已，这不算什么。'] = '我只不過是盡我作為一名管家的本分而已，這不算什麼。', 
    ['我只是不像其他的海盗一样赶尽杀绝而已，真是可笑，明明是做恶，只要在恶的基础上稍稍施加一点点善，被伤害的人却会给你冠以美誉，对你感激涕零。'] = '我只是不像其他的海盜一樣趕盡殺絕而已，真是可笑，明明是做惡，只要在惡的基礎上稍稍施加一點點善，被傷害的人卻會給你冠以美譽，對你感激涕零。', 
    ['我只是为当年死于墨西哥湾的同伴报仇而已。'] = '我只是為當年死於墨西哥灣的同伴報仇而已。', 
    ['我只知道有人被阿芒德给抓到了……不废话，让你见识见识我的厉害。'] = '我只知道有人被阿芒德給抓到了……不廢話，讓你見識見識我的厲害。', 
    ['我只站在自己这一边。你走吧，看在曾经国王的面子上，我会放你一马。远离这纷乱的漩涡吧，否则你只有死路一条。'] = '我只站在自己這一邊。你走吧，看在曾經國王的面子上，我會放你一馬。遠離這紛亂的漩渦吧，否則你只有死路一條。', 
    ['我只能帮到这，在他们发现我之前我得撤退了。'] = '我只能幫到這，在他們發現我之前我得撤退了。', 
    ['我叫夏洛克，你需要借贷吗？只需要一点点利息。'] = '我叫夏洛克，你需要借貸嗎？只需要一點點利息。', 
    ['我可不仅仅长得漂亮噢，将购销货物的事务交给我，我们的资金很快就会成倍增长的！现在进入交易所点击左下角我的头像就可以购买货物。'] = '我可不僅僅長得漂亮噢，將購銷貨物的事務交給我，我們的資金很快就會成倍增長的！現在進入交易所點擊左下角我的頭像就可以購買貨物。', 
    ['我可不像达伽马，我只想稳当的做我的总督，而战争毁掉了城镇，所以，你必须负责把【果阿】和【卡利卡特】建设达到港口等级3。'] = '我可不像達伽馬，我只想穩當的做我的總督，而戰爭毀掉了城鎮，所以，你必須負責把【果阿】和【卡利卡特】建設達到港口等級3。', 
    ['我可不只这点能耐!'] = '我可不只這點能耐!', 
    ['我可不是娇滴滴的贵族千金！我要让所有人记住我拉比斯的名字！'] = '我可不是嬌滴滴的貴族千金！我要讓所有人記住我拉比斯的名字！', 
    ['我可不管你为什么，我只想用舰炮狠狠地轰击阿芒德……眼睁睁看着阿芒德耀武扬威又从容而去，这是对我汉娜的蔑视！'] = '我可不管你為什麼，我只想用艦炮狠狠地轟擊阿芒德……眼睜睜看著阿芒德耀武揚威又從容而去，這是對我漢娜的蔑視！', 
    ['我可以在祈祷时喝酒吗？我可以在喝酒时祈祷吗？'] = '我可以在祈禱時喝酒嗎？我可以在喝酒時祈禱嗎？', 
    ['我可以帮你找到香料群岛，但我绝不会成为你屠杀的凶器。'] = '我可以幫你找到香料群島，但我絕不會成為你屠殺的凶器。', 
    ['我可对什么十字军和约翰王的联盟那些玩意不感兴趣，我只在意繁华的交易所和热闹的酒馆呢。'] = '我可對什麼十字軍和約翰王的聯盟那些玩意不感興趣，我只在意繁華的交易所和熱鬧的酒館呢。', 
    ['我可没有这样的意思，是你自己想多了……别瞪我，既然你这么喜欢这里，我就帮帮这些人。'] = '我可沒有這樣的意思，是你自己想多了……別瞪我，既然你這麼喜歡這裡，我就幫幫這些人。', 
    ['我可没有钱付给你们，但有的是力气，可以为你们工作。'] = '我可沒有錢付給你們，但有的是力氣，可以為你們工作。', 
    ['我可没这么闲。我来是想请你协助我前往“世界的尽头”。'] = '我可沒這麼閑。我來是想請你協助我前往“世界的盡頭”。', 
    ['我听当地的居民说陈祖义的手下甚至对沿海城邦征收高额的贸易税费，稍有不从，便会招致船毁人亡的下场！'] = '我聽當地的居民說陳祖義的手下甚至對沿海城邦徵收高額的貿易稅費，稍有不從，便會招致船毀人亡的下場！', 
    ['我听戴肯叔叔说，需要七海霸主信物才能压制女神的力量。'] = '我聽戴肯叔叔說，需要七海霸主信物才能壓制女神的力量。', 
    ['我听水手们说过郑和的故事，他是中国最伟大的航海家。'] = '我聽水手們說過鄭和的故事，他是中國最偉大的航海家。', 
    ['我听说了你们的事迹……如果我没有破产的话你们倒是不错的合作伙伴。'] = '我聽說了你們的事跡……如果我沒有破產的話你們倒是不錯的合作伙伴。', 
    ['我听说威廉基德正准备和霍金斯宣战，不如我们和他一起联手，打败霍金斯的胜率就更大了！'] = '我聽說威廉基德正準備和霍金斯宣戰，不如我們和他一起聯手，打敗霍金斯的勝率就更大了！', 
    ['我哼，原来如此，怪不得我上次功亏一篑。'] = '我哼，原來如此，怪不得我上次功虧一簣。', 
    ['我嗅到了金币的味道，这里一定有特级商品！我们快去$(missioncolor:【市政厅】)吧，我的直觉不会有错的！'] = '我嗅到了金幣的味道，這裡一定有特級商品！我們快去$(missioncolor:【市政廳】)吧，我的直覺不會有錯的！', 
    ['我在土里挖出了几枚中国古代的钱币。'] = '我在土裡挖出了幾枚中國古代的錢幣。', 
    ['我在寻找我的父亲，传闻他去了世界的尽头。东印度公司四处劫掠，欺压原住民，我攻击他们是替天行道。'] = '我在尋找我的父親，傳聞他去了世界的盡頭。東印度公司四處劫掠，欺壓原住民，我攻擊他們是替天行道。', 
    ['我在背诵教皇发布的禁止奴役印第安人的圣训。'] = '我在背誦教皇發佈的禁止奴役印第安人的聖訓。', 
    ['我在这颗宝石里感受到了大海的力量，上次在世界尽头的最终路途上被水幕结界所阻，或许就是缺少了这样一把钥匙……'] = '我在這顆寶石里感受到了大海的力量，上次在世界盡頭的最終路途上被水幕結界所阻，或許就是缺少了這樣一把鑰匙……', 
    ['我在附近的种植园里工作。'] = '我在附近的種植園裡工作。', 
    ['我好像听到打雷了，嗝！'] = '我好像聽到打雷了，嗝！', 
    ['我学了一句中国话：有钱能使鬼推磨。'] = '我學了一句中國話：有錢能使鬼推磨。', 
    ['我完全同意，我们应该到酒馆里去请喝一杯，总有一些人，舌头一大话匣子就打开了，比如我……'] = '我完全同意，我們應該到酒館里去請喝一杯，總有一些人，舌頭一大話匣子就打開了，比如我……', 
    ['我对你们的感激之情无以言表，我亲爱的朋友。'] = '我對你們的感激之情無以言表，我親愛的朋友。', 
    ['我对自己的运气一向很有信心。走，这就去酒馆。'] = '我對自己的運氣一向很有信心。走，這就去酒館。', 
    ['我尝试拼了一下，虽然磨损很严重但依稀能看得出是一张地图，您快看。'] = '我嘗試拼了一下，雖然磨損很嚴重但依稀能看得出是一張地圖，您快看。', 
    ['我就是一个普普通通的管家，可没什么故事可言。'] = '我就是一個普普通通的管家，可沒什麼故事可言。', 
    ['我就知道戴肯叔叔你一定会理解我的。'] = '我就知道戴肯叔叔你一定會理解我的。', 
    ['我就要死了，但现在战况紧急，不要透露我的死讯，请你接替我的位置，以我的名义，继续战斗下去……咦，你不是李莞？'] = '我就要死了，但現在戰況緊急，不要透露我的死訊，請你接替我的位置，以我的名義，繼續戰鬥下去……咦，你不是李莞？', 
    ['我就说我的运气一向不错吧。这位经验丰富的航海士一定能给我们带来极大的帮助。咦，$(missioncolor:【冒险家笔记】)，这是什么？'] = '我就說我的運氣一向不錯吧。這位經驗豐富的航海士一定能給我們帶來極大的幫助。咦，$(missioncolor:【冒險家筆記】)，這是什麼？', 
    ['我就说我的运气不错吧，在对战中使用钩锁，能够直接封锁对方旗舰的行动，我方旗舰上刚好缺少这样一位人才。'] = '我就說我的運氣不錯吧，在對戰中使用鉤鎖，能夠直接封鎖對方旗艦的行動，我方旗艦上剛好缺少這樣一位人才。', 
    ['我已经听说了这事了，是的，协议的确没有对个人有约束，这也是我为了我们私人商船在北海的利益而做的让步。'] = '我已經聽說了這事了，是的，協議的確沒有對個人有約束，這也是我為了我們私人商船在北海的利益而做的讓步。', 
    ['我已经听说了这事了，英国那边暧昧的态度着实令人担忧。霍金斯现在的实力依然不容小觑，你要小心。另外，请你代表我们葡萄牙王室与刚刚重获自由的城市缔结贸易关系，葡萄牙愿意帮助他们走出困境。'] = '我已經聽說了這事了，英國那邊曖昧的態度著實令人擔憂。霍金斯現在的實力依然不容小覷，你要小心。另外，請你代表我們葡萄牙王室與剛剛重獲自由的城市締結貿易關係，葡萄牙願意幫助他們走出困境。', 
    ['我已经当了超过40年的水手，现在准备退休做点小生意。'] = '我已經當了超過40年的水手，現在準備退休做點小生意。', 
    ['我已经很久没有回到这里了，自移居到普利茅斯后，我就在这一带讨生活，跟着商船到世界各地贩卖红茶和啤酒。大海充满了商机，年轻人你要擅长发现。'] = '我已經很久沒有回到這裡了，自移居到普利茅斯後，我就在這一帶討生活，跟著商船到世界各地販賣紅茶和啤酒。大海充滿了商機，年輕人你要擅長髮現。', 
    ['我已经把那块女神之誓给了那小子，戴肯，你觉得靠这小子就一定能在世界的尽头找到女神？'] = '我已經把那塊女神之誓給了那小子，戴肯，你覺得靠這小子就一定能在世界的盡頭找到女神？', 
    ['我希望我可以相信你……来【酒馆】找我。'] = '我希望我可以相信你……來【酒館】找我。', 
    ['我当然愿意！能与你们一同为了正义而战是我的荣幸，快来【酒馆】签订招募合同吧！'] = '我當然願意！能與你們一同為了正義而戰是我的榮幸，快來【酒館】簽訂招募合同吧！', 
    ['我怎么可能甘心，空手回去见玛利亚不如直接让我丧生在这片大海当中，成为鱼群的饵料！我去了加勒比海，加入了本杰明.霍尼戈的海盗团。'] = '我怎麼可能甘心，空手回去見瑪利亞不如直接讓我喪生在這片大海當中，成為魚群的餌料！我去了加勒比海，加入了本傑明.霍尼戈的海盜團。', 
    ['我怎么感觉巴巴罗萨话里有话。'] = '我怎麼感覺巴巴羅薩話裡有話。', 
    ['我怎么没感觉到他在推脱。你看，居然有一艘船，不过看上去并不像战舰。先去【舰队】升级装备，做好将它加入舰队的准备，等戴肯叔叔回来向他咨询下关于这艘船的信息。'] = '我怎麼沒感覺到他在推脫。你看，居然有一艘船，不過看上去並不像戰艦。先去【艦隊】升級裝備，做好將它加入艦隊的準備，等戴肯叔叔回來向他咨詢下關於這艘船的信息。', 
    ['我怎么知道？我和那个纨绔小子可没什么交集。'] = '我怎麼知道？我和那個紈絝小子可沒什麼交集。', 
    ['我怎会没付诸行动呢？我的打算是加入一艘船上积累经验，然后慢慢建立自己的船队。'] = '我怎會沒付諸行動呢？我的打算是加入一艘船上積累經驗，然後慢慢建立自己的船隊。', 
    ['我总觉得还缺点啥，要不到交易所里看看吧'] = '我總覺得還缺點啥，要不到交易所里看看吧', 
    ['我想凡是有正义感的人没人会愿意如此安宁悠闲的地方被战争给破坏。'] = '我想凡是有正義感的人沒人會願意如此安寧悠閑的地方被戰爭給破壞。', 
    ['我想在佛得角建一座小教堂。'] = '我想在佛得角建一座小教堂。', 
    ['我想她一定是一个大美人，让您到现在都念念不忘。'] = '我想她一定是一個大美人，讓您到現在都念念不忘。', 
    ['我想如果能够利用好大漩涡，会给我们日后带来诸多便利。至于危险又算得了什么！走，让我们去见识一下这神奇的大漩涡吧！'] = '我想如果能夠利用好大漩渦，會給我們日後帶來諸多便利。至於危險又算得了什麼！走，讓我們去見識一下這神奇的大漩渦吧！', 
    ['我感觉到钱袋又重了一些。'] = '我感覺到錢袋又重了一些。', 
    ['我愿意。只要给我足够的继续、足够的时间，而且我还需要你的帮助。'] = '我願意。只要給我足夠的繼續、足夠的時間，而且我還需要你的幫助。', 
    ['我懂一点占卜，知道他凶多吉少了……'] = '我懂一點占卜，知道他凶多吉少了……', 
    ['我懂了，看来我又得操劳一番了。'] = '我懂了，看來我又得操勞一番了。', 
    ['我懂的，戴肯叔叔，秘密在金子面前不再是秘密。'] = '我懂的，戴肯叔叔，秘密在金子面前不再是秘密。', 
    ['我成为水手之后，听说有一艘西班牙宝船在佛州被飓风卷进了大海深处，我决定去佛州试一试运气。'] = '我成為水手之後，聽說有一艘西班牙寶船在佛州被颶風卷進了大海深處，我決定去佛州試一試運氣。', 
    ['我才不信什么女人会带来厄运呢，如果我们连一个炮手都没有就去和摩尔人战斗那才真的会倒大霉！'] = '我才不信什麼女人會帶來厄運呢，如果我們連一個炮手都沒有就去和摩爾人戰鬥那才真的會倒大霉！', 
    ['我才不是在向你认错呢……哼！我发现这群自称商人的海盗围绕南方的$(missioncolor:【圣乔治】)经营退路，并和另一股势力有所勾结，我一定要将他们一网打尽！'] = '我才不是在向你認錯呢……哼！我發現這群自稱商人的海盜圍繞南方的$(missioncolor:【聖喬治】)經營退路，並和另一股勢力有所勾結，我一定要將他們一網打盡！', 
    ['我找你前来正是为了此事。霍金斯并没有在东印度公司手上，而是与海盗勾结，四处劫掠商船。'] = '我找你前來正是為了此事。霍金斯並沒有在東印度公司手上，而是與海盜勾結，四處劫掠商船。', 
    ['我把她卖给了一个威尼斯人，他说要到非洲干一趟大买卖……饶命啊……'] = '我把她賣給了一個威尼斯人，他說要到非洲干一趟大買賣……饒命啊……', 
    ['我把希望留给自己，它将给我带来无穷的财富！'] = '我把希望留給自己，它將給我帶來無窮的財富！', 
    ['我投降！我投降！别杀我，我愿意用我所有的财宝换我一条生路！你看，只要你们放过我，这个美丽的宝瓶就是你们的。'] = '我投降！我投降！別殺我，我願意用我所有的財寶換我一條生路！你看，只要你們放過我，這個美麗的寶瓶就是你們的。', 
    ['我支持不了多久了。'] = '我支持不了多久了。', 
    ['我收到了%s分享的热销信息，谢谢！'] = '我收到了%s分享的熱銷信息，謝謝！', 
    ['我方'] = '我方', 
    ['我方全体行进速度增加50%，持续8秒。'] = '我方全體行進速度增加50%，持續8秒。', 
    ['我方全体进入隐形状态，持续4秒。'] = '我方全體進入隱形狀態，持續4秒。', 
    ['我方商会据点被攻占，望大家努力夺回。'] = '我方商會據點被攻佔，望大家努力奪回。', 
    ['我方在单挑战斗中获胜，对敌方造成了%s伤害！！'] = '我方在單挑戰鬥中獲勝，對敵方造成了%s傷害！！', 
    ['我方在本次据点争夺战中失败，望大家卧薪尝胆，以图东山再起。'] = '我方在本次據點爭奪戰中失敗，望大家臥薪嘗膽，以圖東山再起。', 
    ['我方成功的获得本次据点争夺站的胜利，望大家再接再厉，称霸一方。'] = '我方成功的獲得本次據點爭奪站的勝利，望大家再接再厲，稱霸一方。', 
    ['我方死亡数少于1'] = '我方死亡數少於1', 
    ['我方死亡数少于2'] = '我方死亡數少於2', 
    ['我方死亡数量少于2'] = '我方死亡數量少於2', 
    ['我明白了，我会为【亚丁】的【市政厅】投资一笔钱。'] = '我明白了，我會為【亞丁】的【市政廳】投資一筆錢。', 
    ['我明白的，你们投资这个城市，会有意想不到的回报。'] = '我明白的，你們投資這個城市，會有意想不到的回報。', 
    ['我是从印度来的。'] = '我是從印度來的。', 
    ['我是伊梅里纳王国的居民。'] = '我是伊梅里納王國的居民。', 
    ['我是和丈夫一起来东南亚讨生活的。'] = '我是和丈夫一起來東南亞討生活的。', 
    ['我是女王的顾问--亚当·斯密，你说你代表亨利王子前来商议联盟事宜吗？我很抱歉的通知你，女王并不想卷入北海的纷争，因为不管是哪个势力得胜，他们都不敢罔顾大英帝国的权益的。'] = '我是女王的顧問--亞當•斯密，你說你代表亨利王子前來商議聯盟事宜嗎？我很抱歉的通知你，女王並不想卷入北海的紛爭，因為不管是哪個勢力得勝，他們都不敢罔顧大英帝國的權益的。', 
    ['我是本愿寺的僧人，织田信长就死在本愿寺中。'] = '我是本願寺的僧人，織田信長就死在本願寺中。', 
    ['我是注定要成为海贼王的男人！'] = '我是註定要成為海賊王的男人！', 
    ['我是葡萄牙人，和丈夫一起来这里旅行。'] = '我是葡萄牙人，和丈夫一起來這裡旅行。', 
    ['我是这里的神学教师，向未知探索时不能忘记对上帝的谦卑。'] = '我是這裡的神學教師，向未知探索時不能忘記對上帝的謙卑。', 
    ['我是骑兵队长，但只要能消灭入侵者，就是让我刷甲板都没问题！现在我要去饱餐一顿，稍后来【酒馆】找我吧。'] = '我是騎兵隊長，但只要能消滅入侵者，就是讓我刷甲板都沒問題！現在我要去飽餐一頓，稍後來【酒館】找我吧。', 
    ['我曾经也是一个冒险者，直到我的膝盖中了一箭。'] = '我曾經也是一個冒險者，直到我的膝蓋中了一箭。', 
    ['我曾经也是一位探险家，直到我的膝盖中了一箭。'] = '我曾經也是一位探險家，直到我的膝蓋中了一箭。', 
    ['我曾经和你一样也是个冒险者，直到我的膝盖中了一箭。'] = '我曾經和你一樣也是個冒險者，直到我的膝蓋中了一箭。', 
    ['我曾经看到过他和印有东印度公司标志旗帜的船只有来往。'] = '我曾經看到過他和印有東印度公司標誌旗幟的船隻有來往。', 
    ['我曾经认为我会一辈子在海上漂泊，但不是现在……我的家族正在生死存亡的边缘。'] = '我曾經認為我會一輩子在海上漂泊，但不是現在……我的家族正在生死存亡的邊緣。', 
    ['我最喜欢拉菲酒庄出产的葡萄酒。'] = '我最喜歡拉菲酒莊出產的葡萄酒。', 
    ['我最近也总是有些不好的预感。算了，走吧，世界的尽头就在不远的前方。父亲，我来了！'] = '我最近也總是有些不好的預感。算了，走吧，世界的盡頭就在不遠的前方。父親，我來了！', 
    ['我有一个好消息和一个坏消息告诉你们。'] = '我有一個好消息和一個壞消息告訴你們。', 
    ['我有一点不明白，这里深受大明国文化影响我有感受到，但复杂体现在何处？'] = '我有一點不明白，這裡深受大明國文化影響我有感受到，但複雜體現在何處？', 
    ['我有喜欢的人，除了她我不会对任何人动心！'] = '我有喜歡的人，除了她我不會對任何人動心！', 
    ['我有幸见识过宫本武藏和佐佐木小次郎的惊天一战。'] = '我有幸見識過宮本武藏和佐佐木小次郎的驚天一戰。', 
    ['我来帮您出售有利润的商品'] = '我來幫您出售有利潤的商品', 
    ['我来，我见，我征服。'] = '我來，我見，我征服。', 
    ['我查询了下，最近塞维利亚对薰衣草的需求量很大，我们这趟贸易的目的地就定在塞维利亚吧！'] = '我查詢了下，最近塞維利亞對薰衣草的需求量很大，我們這趟貿易的目的地就定在塞維利亞吧！', 
    ['我正在构思一部骑士小说，主人公叫堂吉诃德。'] = '我正在構思一部騎士小說，主人公叫堂吉訶德。', 
    ['我正有此意，在突尼斯的敌人援军从东面来的，让我们沿着突尼斯海岸线向东寻找敌人的下一个据点--的黎波里！'] = '我正有此意，在突尼斯的敵人援軍從東面來的，讓我們沿著突尼斯海岸線向東尋找敵人的下一個據點--的黎波里！', 
    ['我没看错吧！那艘船竟然悬挂着英国国旗！无耻的家伙，在剥夺了我们在北海的权益后，居然还有脸到非洲来与我们争夺！'] = '我沒看錯吧！那艘船竟然懸掛著英國國旗！無恥的家伙，在剝奪了我們在北海的權益後，居然還有臉到非洲來與我們爭奪！', 
    ['我熟悉敌人行进路线，你们攻城，我来解决右边巡逻的家伙。'] = '我熟悉敵人行進路線，你們攻城，我來解決右邊巡邏的家伙。', 
    ['我爱上了一个姑娘，她叫玛利亚.哈里特。'] = '我愛上了一個姑娘，她叫瑪利亞.哈里特。', 
    ['我独自航行的时候也听过一些老妪聊起关于科纳克太阳神庙的神秘传说，我们快去看看吧！'] = '我獨自航行的時候也聽過一些老嫗聊起關於科納克太陽神廟的神秘傳說，我們快去看看吧！', 
    ['我现在心中的疑惑越来越多，让我冷静一下。'] = '我現在心中的疑惑越來越多，讓我冷靜一下。', 
    ['我现在最缺的是一位与帝国官方接触的引荐者，如果你有这个能力，不管你的箭术如何，我可以让你加入。'] = '我現在最缺的是一位與帝國官方接觸的引薦者，如果你有這個能力，不管你的箭術如何，我可以讓你加入。', 
    ['我用贵族与爱情为主题写了一部小说：公主怀孕了。'] = '我用貴族與愛情為主題寫了一部小說：公主懷孕了。', 
    ['我的丈夫不知道什么时候才会从加勒比回来……'] = '我的丈夫不知道什麼時候才會從加勒比回來……', 
    ['我的人已经准备好了，让我们进攻吧！'] = '我的人已經準備好了，讓我們進攻吧！', 
    ['我的信息'] = '我的信息', 
    ['我的占星师托马斯先生对我说，由于摧毁了东印度公司在印度洋的布置，位于东南亚的东印度公司总部已经下发了通缉令悬赏你的人头。'] = '我的占星師托馬斯先生對我說，由於摧毀了東印度公司在印度洋的佈置，位於東南亞的東印度公司總部已經下發了通緝令懸賞你的人頭。', 
    ['我的同伴被他们抓走了，救救他们。'] = '我的同伴被他們抓走了，救救他們。', 
    ['我的同胞告诉我，霍金斯绕过了海角，他不但双手沾满我同胞的鲜血，更企图征服我们并找到去往东方的航线！他的目标是莫桑比克，千万不能放过这个屠夫！'] = '我的同胞告訴我，霍金斯繞過了海角，他不但雙手沾滿我同胞的鮮血，更企圖征服我們並找到去往東方的航線！他的目標是莫桑比克，千萬不能放過這個屠夫！', 
    ['我的商会'] = '我的商會', 
    ['我的奖励'] = '我的獎勵', 
    ['我的好友'] = '我的好友', 
    ['我的宫廷占星师告诉我的，他拥有神秘的力量能够预知未来。我们今天的相遇就在他的预测之中。这块宝石，是我权杖上的镶嵌物，现在它就在那群人手中，如果你们能够帮助我，我愿意将它送给你们。'] = '我的宮廷占星師告訴我的，他擁有神秘的力量能夠預知未來。我們今天的相遇就在他的預測之中。這塊寶石，是我權杖上的鑲嵌物，現在它就在那群人手中，如果你們能夠幫助我，我願意將它送給你們。', 
    ['我的征途是星辰大海。'] = '我的征途是星辰大海。', 
    ['我的执行力：'] = '我的執行力：', 
    ['我的排名'] = '我的排名', 
    ['我的排名：'] = '我的排名：', 
    ['我的排行'] = '我的排行', 
    ['我的推荐'] = '我的推薦', 
    ['我的推荐人'] = '我的推薦人', 
    ['我的族人们，你们自由了。'] = '我的族人們，你們自由了。', 
    ['我的昵称我的昵称'] = '我的暱稱我的暱稱', 
    ['我的梦想很简单，我要拥有一只属于自己的船队。'] = '我的夢想很簡單，我要擁有一隻屬於自己的船隊。', 
    ['我的爱情像天上的雄鹰，可望而不可及。'] = '我的愛情像天上的雄鷹，可望而不可及。', 
    ['我的父亲，当代最伟大的航海家之一！可就在三年前，他前往“终极航线—世界尽头”后就杳无音讯。我，一定要找到他！'] = '我的父親，當代最偉大的航海家之一！可就在三年前，他前往“終極航線—世界盡頭”後就杳無音訊。我，一定要找到他！', 
    ['我的直觉果然没错，船长您看，这批薰衣草香气浓郁，连盛装的容器都是如此精美，肯定能卖个好价钱。'] = '我的直覺果然沒錯，船長您看，這批薰衣草香氣濃郁，連盛裝的容器都是如此精美，肯定能賣個好價錢。', 
    ['我的积分'] = '我的積分', 
    ['我的老朋友不过是被你控制了心智，你算什么女神，在我眼中，你比传说中丑陋的地精还要丑一万倍！'] = '我的老朋友不過是被你控制了心智，你算什麼女神，在我眼中，你比傳說中醜陋的地精還要醜一萬倍！', 
    ['我的老雇主是韦恩海运公司的创始人，他去世时没有留下继承人，只好由我代为管理公司。最近我听说老雇主还有一个私生子，我想让你们帮我找到他。'] = '我的老雇主是韋恩海運公司的創始人，他去世時沒有留下繼承人，只好由我代為管理公司。最近我聽說老雇主還有一個私生子，我想讓你們幫我找到他。', 
    ['我的聊天内容我的聊天内容我的聊天内容'] = '我的聊天內容我的聊天內容我的聊天內容', 
    ['我的脚已伸入马镫，带着对于死亡的焦虑向您献上此书。'] = '我的腳已伸入馬鐙，帶著對於死亡的焦慮向您獻上此書。', 
    ['我的船只'] = '我的船只', 
    ['我的足迹遍布七海，没有任何人能够阻挡我的脚步！'] = '我的足跡遍佈七海，沒有任何人能夠阻擋我的腳步！', 
    ['我的远航能够为英国带回大量利润，更能打破西班牙海上霸主地位，女王自然会资助我的航行……'] = '我的遠航能夠為英國帶回大量利潤，更能打破西班牙海上霸主地位，女王自然會資助我的航行……', 
    ['我的酒量可一点儿不比男人差！'] = '我的酒量可一點兒不比男人差！', 
    ['我相信，只要我坚持梦想，总有一天我的梦想能够实现！'] = '我相信，只要我堅持夢想，總有一天我的夢想能夠實現！', 
    ['我相信，这一定不是我国亨利王子的意愿。'] = '我相信，這一定不是我國亨利王子的意願。', 
    ['我看你的身手不错，刚刚围攻你的海盗都被抽得快不成人形了。怎么样，要不要加入我们，你必定能成为一个优秀的水手长！'] = '我看你的身手不錯，剛剛圍攻你的海盜都被抽得快不成人形了。怎麼樣，要不要加入我們，你必定能成為一個優秀的水手長！', 
    ['我看到一船金币！'] = '我看到一船金幣！', 
    ['我看到一队哭哭啼啼的日本人从港口被押上船，就在不久之前！'] = '我看到一隊哭哭啼啼的日本人從港口被押上船，就在不久之前！', 
    ['我看到许多原住民的手工制品被东印度公司打压，只能滞销与于此地，不如我们帮助他们销出一些产品缓解他们的燃眉之急。'] = '我看到許多原住民的手工製品被東印度公司打壓，只能滯銷與於此地，不如我們幫助他們銷出一些產品緩解他們的燃眉之急。', 
    ['我看是心里有鬼吧，保险起见，我们还是去【市政厅】走一趟，请治安官帮我们查查他的底细吧——当然得先准备好一笔投资。'] = '我看是心裡有鬼吧，保險起見，我們還是去【市政廳】走一趟，請治安官幫我們查查他的底細吧——當然得先準備好一筆投資。', 
    ['我看看，这句话的大概意思就是一个人思念他的情人，亲手制作了这个容器。这可不是鱼缸，是个笔洗。你看，里面还有笔搁呢。'] = '我看看，這句話的大概意思就是一個人思念他的情人，親手製作了這個容器。這可不是魚缸，是個筆洗。你看，裡面還有筆擱呢。', 
    ['我真不明白，皇帝收税就好了为什么要禁止海上贸易？'] = '我真不明白，皇帝收稅就好了為什麼要禁止海上貿易？', 
    ['我知道了'] = '我知道了', 
    ['我知道，不能在同一个地方摔两次。为了正义的海洋女神，为了洗刷耻辱，我们一定要拿下$(missioncolor:【雅加达】)！'] = '我知道，不能在同一個地方摔兩次。為了正義的海洋女神，為了洗刷恥辱，我們一定要拿下$(missioncolor:【雅加達】)！', 
    ['我知道，我只是在想是不是父亲返航的航线上的灯塔已经熄灭，以至于他一直都没有回来。'] = '我知道，我只是在想是不是父親返航的航線上的燈塔已經熄滅，以至於他一直都沒有回來。', 
