    ['戚继光虽作战勇猛，倭寇无不闻风丧胆，但其对上司张居正颇为迎合恭谦，但这亦是戚继光为了抗倭所使的手段而已。'] = '戚繼光雖作戰勇猛，倭寇無不聞風喪膽，但其對上司張居正頗為迎合恭謙，但這亦是戚繼光為了抗倭所使的手段而已。', 
    ['戴尔森'] = '戴爾森', 
    ['戴肯叔叔对于北海十分的熟悉，不知您还有什么好的建议。'] = '戴肯叔叔對於北海十分的熟悉，不知您還有什麼好的建議。', 
    ['戴肯叔叔，你也知道拉比斯？'] = '戴肯叔叔，你也知道拉比斯？', 
