    ['看……莫卧儿王朝的商船!正在遭受他们的攻击，一定是被他们发现私下贸易了！'] = '看……莫臥兒王朝的商船!正在遭受他們的攻擊，一定是被他們發現私下貿易了！', 
    ['看上去像是一团聚在一起的黑色小颗粒，入口香甜，酸味鲜美。'] = '看上去像是一團聚在一起的黑色小顆粒，入口香甜，酸味鮮美。', 
