    ['看上去只是黑色的粉末，却有着强大的威力。'] = '看上去只是黑色的粉末，卻有著強大的威力。', 
    ['看上去有些年头，可以尝试拼一下，直觉告诉我这应该是有价值的物品。'] = '看上去有些年頭，可以嘗試拼一下，直覺告訴我這應該是有價值的物品。', 
    ['看不出你居然有这等实力！'] = '看不出你居然有這等實力！', 
    ['看准机会，找一艘大船动手，这样才能得到海盗们的信任。'] = '看準機會，找一艘大船動手，這樣才能得到海盜們的信任。', 
    ['看到海面上的骷髅旗了吗？这些家伙明目张胆地把这里当成了他们的猎场！'] = '看到海面上的骷髏旗了嗎？這些家伙明目張膽地把這裡當成了他們的獵場！', 
    ['看到玛丽被围困，安妮扯掉了头巾，挥舞着指挥刀，嘶吼着命令她的水手向敌人发起进攻，一定要把玛丽救出重围！'] = '看到瑪麗被圍困，安妮扯掉了頭巾，揮舞著指揮刀，嘶吼著命令她的水手向敵人發起進攻，一定要把瑪麗救出重圍！', 
    ['看到苏菲的船了，她受损很严重！对方正对她穷追不舍！'] = '看到蘇菲的船了，她受損很嚴重！對方正對她窮追不捨！', 
    ['看到那个酒桶了吗？先干掉那三艘具有优秀瞭望手的守卫舰，再点燃酒桶给吉布斯发信号。'] = '看到那個酒桶了嗎？先幹掉那三艘具有優秀瞭望手的守衛艦，再點燃酒桶給吉布斯發信號。', 
    ['看吧，我们几乎“顺便”就把悬赏任务完成了！现在让我们去【酒馆】把奖励领了吧，记得常到酒馆看看哦。'] = '看吧，我們幾乎“順便”就把懸賞任務完成了！現在讓我們去【酒館】把獎勵領了吧，記得常到酒館看看哦。', 
    ['看来你也被我的外表欺骗了呢，其实我是一个内心非常坚强的人。'] = '看來你也被我的外表欺騙了呢，其實我是一個內心非常堅強的人。', 
    ['看来你很享受当英雄的感觉。'] = '看來你很享受當英雄的感覺。', 
    ['看来只有到竞技商店中用竞技场星章兑换合适的水手宝物了。'] = '看來只有到競技商店中用競技場星章兌換合適的水手寶物了。', 
    ['看来奥斯曼的海军和海盗早已是合作关系，统治了地中海。'] = '看來奧斯曼的海軍和海盜早已是合作關係，統治了地中海。', 
    ['看来对手都是些欺软怕硬的家伙，让我们继续前进吧！'] = '看來對手都是些欺軟怕硬的家伙，讓我們繼續前進吧！', 
    ['看来我们这次的收获相当丰富，不过可真是惊险，每一个都是亡命之徒。'] = '看來我們這次的收穫相當豐富，不過可真是驚險，每一個都是亡命之徒。', 
    ['看来我要把这个好消息告诉【I·F·拉齐】。'] = '看來我要把這個好消息告訴【I•F•拉齊】。', 
    ['看来敌人为数不少，而且作战经验丰富，不可掉以轻心！'] = '看來敵人為數不少，而且作戰經驗豐富，不可掉以輕心！', 
    ['看来是$(missioncolor:【悬赏令】)发布了，通过悬赏任务，可以获得$(missioncolor:【商会贡献】)，这样就能从商会仓库那里兑换很多好处。这些人恐怕都是为了商会贡献而来。'] = '看來是$(missioncolor:【懸賞令】)發佈了，通過懸賞任務，可以獲得$(missioncolor:【商會貢獻】)，這樣就能從商會倉庫那裡兌換很多好處。這些人恐怕都是為了商會貢獻而來。', 
    ['看来没有其他办法了，这里我也待不下去了……你们可以来【酒馆】找我。'] = '看來沒有其他辦法了，這裡我也待不下去了……你們可以來【酒館】找我。', 
    ['看来真的有强征民夫的事情发生，他们应该走不远，我们在附近的海域搜寻一下！'] = '看來真的有強徵民夫的事情發生，他們應該走不遠，我們在附近的海域搜尋一下！', 
    ['看来老伙计在等着我了……'] = '看來老伙計在等著我了……', 
    ['看来这里虽然名义上隶属牙买加总督的管辖，实际上是一块混乱无序的领地。'] = '看來這裡雖然名義上隸屬牙買加總督的管轄，實際上是一塊混亂無序的領地。', 
    ['看来魔鬼之手并不是指这里的惊涛骇浪，全员警戒，准备迎战！'] = '看來魔鬼之手並不是指這裡的驚濤駭浪，全員警戒，準備迎戰！', 
    ['看来，繁华安逸的生活早已经腐蚀了那些士兵，我们会轻松取得胜利的！'] = '看來，繁華安逸的生活早已經腐蝕了那些士兵，我們會輕鬆取得勝利的！', 
    ['看来，这次有额外的收益哦'] = '看來，這次有額外的收益哦', 
    ['看杰克使用他的罗盘找到黑珍珠号的方位'] = '看傑克使用他的羅盤找到黑珍珠號的方位', 
    ['看样子敌人阵势未稳，直接冲击敌人侧翼!'] = '看樣子敵人陣勢未穩，直接衝擊敵人側翼!', 
    ['看看吧。'] = '看看吧。', 
    ['看看我们造成的轰动吧！不要停下，继续耕耘这条美妙的航线，你知道么？人们已经用黄金商路来形容她了呢！'] = '看看我們造成的轟動吧！不要停下，繼續耕耘這條美妙的航線，你知道麽？人們已經用黃金商路來形容她了呢！', 
    ['看看那里的情况。'] = '看看那裡的情況。', 
    ['看见你们面前的那艘船了吗？这是女王最强大的“吕贝克的耶稣”号，它会毫不留情地粉碎你们！'] = '看見你們面前的那艘船了嗎？這是女王最強大的“呂貝克的耶穌”號，它會毫不留情地粉碎你們！', 
    ['看起来像蛇，但是生活在干净的水中，身体又长又扁，有的品种像叶子一样薄。'] = '看起來像蛇，但是生活在乾淨的水中，身體又長又扁，有的品種像葉子一樣薄。', 
    ['看这辽阔的海面，还有每一艘都满载着贵重货物的船舶！这里真是海盗的天堂啊！'] = '看這遼闊的海面，還有每一艘都滿載著貴重貨物的船舶！這裡真是海盜的天堂啊！', 
    ['看！海盗已经将俘虏装船，正准备离开据点了！'] = '看！海盜已經將俘虜裝船，正準備離開據點了！', 
