    ['看，前面就是【萨格里什】，我们到了！'] = '看，前面就是【薩格裡什】，我們到了！', 
    ['看，我们马上就到马尼拉了。'] = '看，我們馬上就到馬尼拉了。', 
    ['看，是上次那艘下令攻击我们的海盗船，还有………巴巴罗萨的海军！？'] = '看，是上次那艘下令攻擊我們的海盜船，還有………巴巴羅薩的海軍！？', 
    ['真了不起！你已经绕过了非洲，离印度不远了。'] = '真了不起！你已經繞過了非洲，離印度不遠了。', 
    ['真想喝一杯波尔多的红葡萄酒。'] = '真想喝一杯波爾多的紅葡萄酒。', 
    ['真愁今天的收获少呢，你们就来啦！'] = '真愁今天的收穫少呢，你們就來啦！', 
    ['真是……已经分不清是耿直还是其他的什么了。'] = '真是……已經分不清是耿直還是其他的什麼了。', 
    ['真是不堪一击。'] = '真是不堪一擊。', 
    ['真是个明事理的人，看在你们如此用心的份上，我可以透露个消息。汉萨同盟首领阿尔伯特·希勒告知女王，北欧海盗势力最近肆无忌惮地劫掠我们大英帝国的商船。'] = '真是個明事理的人，看在你們如此用心的份上，我可以透露個消息。漢薩同盟首領阿爾伯特•希勒告知女王，北歐海盜勢力最近肆無忌憚地劫掠我們大英帝國的商船。', 
    ['真是个棘手的小家伙，这样一来救回你的父亲的线索又断了，看来我得去重新找些老朋友打听情况，刚好你趁这个时间去造船厂购买一艘新船。'] = '真是個棘手的小家伙，這樣一來救回你的父親的線索又斷了，看來我得去重新找些老朋友打聽情況，剛好你趁這個時間去造船廠購買一艘新船。', 
    ['真是个翻脸不认人的混蛋！'] = '真是個翻臉不認人的混蛋！', 
