    ['真是好运气，这个什么笔搁就是女神之誓碎片制成的！天啊，居然有人用它来……笔搁是干什么用的？'] = '真是好運氣，這個什麼筆擱就是女神之誓碎片製成的！天啊，居然有人用它來……筆擱是干什麼用的？', 
    ['真是痛快的战斗！据点已经摧毁，俘虏也都解救出来了！让我们返航【巴塞罗那】喝一杯庆祝吧！'] = '真是痛快的戰鬥！據點已經摧毀，俘虜也都解救出來了！讓我們返航【巴塞羅那】喝一杯慶祝吧！', 
    ['真是精湛的手艺！真想给舰队里所有的船都改造一番。'] = '真是精湛的手藝！真想給艦隊里所有的船都改造一番。', 
