    ['真高兴见到你！勇敢的孩子，是你和你的船员用智慧和勇气为我们带来了这场重要的胜利！'] = '真高興見到你！勇敢的孩子，是你和你的船員用智慧和勇氣為我們帶來了這場重要的勝利！', 
