    ['船长下令，要把马拉开波的值钱东西一点不留的搜刮出来，这需要点时间，但敌人的援军已经接近了，阻拦他们的前进。'] = '船長下令，要把馬拉開波的值錢東西一點不留的搜刮出來，這需要點時間，但敵人的援軍已經接近了，阻攔他們的前進。', 
