    ['船长信息界面'] = '船長信息介面', 
    ['船长决定把他的船从“查理二世”改名为“幻想号”。嗯，这是一个好名字。但是，他为何要给全英国写信？'] = '船長決定把他的船從“查理二世”改名為“幻想號”。嗯，這是一個好名字。但是，他為何要給全英國寫信？', 
    ['船长别冲动，“梅利号”没了还可以东山再起，但海盗人多势众，我们这么艘小舢板追上去会连人也没了……'] = '船長別衝動，“梅利號”沒了還可以東山再起，但海盜人多勢眾，我們這麼艘小舢板追上去會連人也沒了……', 
    ['船长大人，不如沿着海岸线继续追击霍金斯残余部队，一定要斩草除根！不能让他们继续干这种伤天害理的事！'] = '船長大人，不如沿著海岸線繼續追擊霍金斯殘餘部隊，一定要斬草除根！不能讓他們繼續干這種傷天害理的事！', 
    ['船长大人，市政厅的书记官给我们送来了投资分红。用这些资金，赚取更多的利益吧！'] = '船長大人，市政廳的書記官給我們送來了投資分紅。用這些資金，賺取更多的利益吧！', 
    ['船长大人，我是向导，可不想负责战斗。你看我吹弹可破的肌肤，都被硝烟熏黑了！'] = '船長大人，我是嚮導，可不想負責戰鬥。你看我吹彈可破的肌膚，都被硝煙熏黑了！', 
    ['船长小心，有人袭击我们的船舰！火炮手准备，反击！'] = '船長小心，有人襲擊我們的船艦！火炮手準備，反擊！', 
    ['船长就像在自己后院闲逛一样的悠闲，对方的船队已经集结了，他竟命令折返马拉开波，把这个到处还遍布冒烟灰烬的城市又洗劫了一遍。'] = '船長就像在自己後院閑逛一樣的悠閑，對方的船隊已經集結了，他竟命令折返馬拉開波，把這個到處還遍佈冒煙灰燼的城市又洗劫了一遍。', 
    ['船长提升属性'] = '船長提升屬性', 
    ['船长界面关闭按钮'] = '船長介面關閉按鈕', 
    ['船长等级'] = '船長等級', 
    ['船长需要同时扮演贤者和暴君两种角色。'] = '船長需要同時扮演賢者和暴君兩種角色。', 
    ['船长！刚刚从酒馆得到确切的情报显示，摩尔人正在北非要塞【突尼斯】大规模集结兵力，看来他们又有行动啦！'] = '船長！剛剛從酒館得到確切的情報顯示，摩爾人正在北非要塞【突尼斯】大規模集結兵力，看來他們又有行動啦！', 
    ['船长！发现敌人的一支船队企图突围！'] = '船長！發現敵人的一支船隊企圖突圍！', 
    ['船长！发现敌人的船队正要离港！是斥候船！我们被发现了？'] = '船長！發現敵人的船隊正要離港！是斥候船！我們被髮現了？', 
    ['船长！坏消息！听说巴巴罗萨因为我们攻占亚历山大的行动而大发雷霆，正打算对我们进行报复呢！'] = '船長！壞消息！聽說巴巴羅薩因為我們攻佔亞歷山大的行動而大發雷霆，正打算對我們進行報複呢！', 
    ['船长！悬赏任务已经完成，请去港口的【商会】领赏。'] = '船長！懸賞任務已經完成，請去港口的【商會】領賞。', 
    ['船长！我们从商会得知:的商品正在热卖，0点前去任意港口出售这些商品，都能卖个好价钱！'] = '船長！我們從商會得知:的商品正在熱賣，0點前去任意港口出售這些商品，都能賣個好價錢！', 
    ['船长！我们的防御舰伤痕累累，这样下去，迟早会不堪重负。'] = '船長！我們的防禦艦傷痕纍纍，這樣下去，遲早會不堪重負。', 
    ['船长！我似乎闻到了特级商品的味道，快去$(missioncolor:【市政厅】)看看，说不定挣的钱可以给我们换一艘不错的船舰！'] = '船長！我似乎聞到了特級商品的味道，快去$(missioncolor:【市政廳】)看看，說不定掙的錢可以給我們換一艘不錯的船艦！', 
    ['船长！我倒是迫不及待想要继续向敌人发起攻击，让他们瞧瞧我们舰队的威力了！'] = '船長！我倒是迫不及待想要繼續向敵人發起攻擊，讓他們瞧瞧我們艦隊的威力了！', 
    ['船长！我在仓库里发现一些旧羊皮纸碎片，貌似是悬赏任务的奖励。这东西真不知道到底有什么用。'] = '船長！我在倉庫里發現一些舊羊皮紙碎片，貌似是懸賞任務的獎勵。這東西真不知道到底有什麼用。', 
    ['船长！黑市商人在本港口出现了，快去船厂看看吧！'] = '船長！黑市商人在本港口出現了，快去船廠看看吧！', 
    ['船长，【%s】战役爆发了，委托人给予我们大笔赏金，希望我们能去平息。'] = '船長，【%s】戰役爆發了，委托人給予我們大筆賞金，希望我們能去平息。', 
    ['船长，【汉堡】是敌人的心脏！确保我们已经攻占【里加】、【但泽】和【阿姆斯特丹】才能开始这里的战斗！'] = '船長，【漢堡】是敵人的心臟！確保我們已經攻佔【裡加】、【但澤】和【阿姆斯特丹】才能開始這裡的戰鬥！', 
    ['船长，【酒馆】现在有一批航海士，前往招募%s次吧。'] = '船長，【酒館】現在有一批航海士，前往招募%s次吧。', 
    ['船长，不好了，后方出现很多战船，他们朝着这边过来了！'] = '船長，不好了，後方出現很多戰船，他們朝著這邊過來了！', 
    ['船长，不要激怒他，我们根本不是他的对手……'] = '船長，不要激怒他，我們根本不是他的對手……', 
    ['船长，世界那么大，带我去看看吧！点我可以查看咱们的行程备忘录……'] = '船長，世界那麼大，帶我去看看吧！點我可以查看咱們的行程備忘錄……', 
    ['船长，亨利王子对于我们驰援巴塞罗那的义举大为赞赏，这是授予您的封爵册，您这下可成了贵族老爷了。'] = '船長，亨利王子對於我們馳援巴塞羅那的義舉大為贊賞，這是授予您的封爵冊，您這下可成了貴族老爺了。', 
    ['船长，从与敌人的战斗中我们学习到了新的舰队阵型了呢！'] = '船長，從與敵人的戰鬥中我們學習到了新的艦隊陣型了呢！', 
    ['船长，作为一个航海士，一定要稳……'] = '船長，作為一個航海士，一定要穩……', 
    ['船长，你可真幸运，把这位经验老到的航海士任命到舰队里吧。'] = '船長，你可真幸運，把這位經驗老到的航海士任命到艦隊里吧。', 
    ['船长，你接到了一个多人任务！'] = '船長，你接到了一個多人任務！', 
