    ['船长，汉娜，你们都消消气！我们现在只有三个人加一艘轻木帆船了，可没办法对付阿芒德庞大的舰队。先前往$(missioncolor:【塞维利亚】)，看看在那里能否得到些援助吧。'] = '船長，漢娜，你們都消消氣！我們現在只有三個人加一艘輕木帆船了，可沒辦法對付阿芒德龐大的艦隊。先前往$(missioncolor:【塞維利亞】)，看看在那裡能否得到些援助吧。', 
    ['船长，港口商店里有我们需要的商品，赶紧去吧。'] = '船長，港口商店里有我們需要的商品，趕緊去吧。', 
    ['船长，港口商店里的货物就要买完了，赶紧前往吧。'] = '船長，港口商店里的貨物就要買完了，趕緊前往吧。', 
    ['船长，现在是做买卖的黄金时期，快前往【%s】倾销%s个任意类型商品吧。'] = '船長，現在是做買賣的黃金時期，快前往【%s】傾銷%s個任意類型商品吧。', 
    ['船长，皇家海军已经开始盯着我们了，等风声不紧的时候再动手吧!'] = '船長，皇家海軍已經開始盯著我們了，等風聲不緊的時候再動手吧!', 
    ['船长，累了可以去收藏室休息一下，回顾一下自己的航海历程。'] = '船長，累了可以去收藏室休息一下，回顧一下自己的航海曆程。', 
    ['船长，联盟需要我们的力量，赶快出海去攻击敌方吧。'] = '船長，聯盟需要我們的力量，趕快出海去攻擊敵方吧。', 
    ['船长，舰队的补给都已准备完毕，赶快去海上大肆掠夺吧。'] = '船長，艦隊的補給都已準備完畢，趕快去海上大肆掠奪吧。', 
    ['船长，船厂里的装备研究已经开放了，让我们去为装备强化提升吧！'] = '船長，船廠里的裝備研究已經開放了，讓我們去為裝備強化提升吧！', 
    ['船长，船长，你看那边，那个身影……'] = '船長，船長，你看那邊，那個身影……', 
    ['船长，营地的情报屋已经启用了，您可以调派赋闲的航海士去完成各地搜集来的任务，除了能提升我们航海士的经验等级，还有机会赢取宝物哦！'] = '船長，營地的情報屋已經啟用了，您可以調派賦閑的航海士去完成各地搜集來的任務，除了能提升我們航海士的經驗等級，還有機會贏取寶物哦！', 
    ['船长，营地的材料工坊已经启用了，您可以调派赋闲的航海士去完成任务，生产我们装备研究所急需的材料啦！'] = '船長，營地的材料工坊已經啟用了，您可以調派賦閑的航海士去完成任務，生產我們裝備研究所急需的材料啦！', 
    ['船长，营地的贸易站已经启用了，您可以调派赋闲的航海士建设贸易站，为我们的情报屋提供更多更好的任务！'] = '船長，營地的貿易站已經啟用了，您可以調派賦閑的航海士建設貿易站，為我們的情報屋提供更多更好的任務！', 
    ['船长，营地的铸造厂已经启用了，您可以调派赋闲的航海士到铸造厂完成任务，铸造我们急需的宝物啦！'] = '船長，營地的鑄造廠已經啟用了，您可以調派賦閑的航海士到鑄造廠完成任務，鑄造我們急需的寶物啦！', 
    ['船长，虽然巴塞罗那已经解围了，但我们不少同胞被海盗俘虏，他们会被当成奴隶的。让我们攻击敌人的据点，拯救他们吧！'] = '船長，雖然巴塞羅那已經解圍了，但我們不少同胞被海盜俘虜，他們會被當成奴隸的。讓我們攻擊敵人的據點，拯救他們吧！', 
    ['船长，装备提升的效果非常显著呢，我们物资还有剩余，不继续升级我们的装备了吗？'] = '船長，裝備提升的效果非常顯著呢，我們物資還有剩餘，不繼續升級我們的裝備了嗎？', 
    ['船长，要是我们的火炮能再加把劲，我早就轻轻松松地把他们轰得稀巴烂了！'] = '船長，要是我們的火炮能再加把勁，我早就輕輕鬆松地把他們轟得稀巴爛了！', 
    ['船长，请下达航向命令吧！'] = '船長，請下達航向命令吧！', 
    ['船长，赶紧出发吧！【%s】战役需要我们这样强大的舰队。'] = '船長，趕緊出發吧！【%s】戰役需要我們這樣強大的艦隊。', 
    ['船长，赶紧去港口商店采购一批货物吧。'] = '船長，趕緊去港口商店採購一批貨物吧。', 
    ['船长，赶紧去购买%s个【%s】吧，委托人可不只是委托我们一只舰队哦。'] = '船長，趕緊去購買%s個【%s】吧，委托人可不只是委托我們一隻艦隊哦。', 
    ['船长，趁【酒馆】还没打烊，快去进行%s次招募吧。'] = '船長，趁【酒館】還沒打烊，快去進行%s次招募吧。', 
    ['船长，这个麻烦一大堆的家伙我们一定要去救吗？'] = '船長，這個麻煩一大堆的家伙我們一定要去救嗎？', 
    ['船长，这些敌人太强大了，我们还需要提升实力才行。前往【酒馆】，接受并完成悬赏任务，提升等级，才可以挑战实力强大的敌人。'] = '船長，這些敵人太強大了，我們還需要提升實力才行。前往【酒館】，接受並完成懸賞任務，提升等級，才可以挑戰實力強大的敵人。', 
    ['船长，这人说话好奇怪，谁会不是自己……'] = '船長，這人說話好奇怪，誰會不是自己……', 
    ['船长，这封送去【%s】的信函似乎非常紧急重要，我们得马上出航。'] = '船長，這封送去【%s】的信函似乎非常緊急重要，我們得馬上出航。', 
    ['船长，这是您上次在藏宝海湾寻获的宝贝，请验收吧！'] = '船長，這是您上次在藏寶海灣尋獲的寶貝，請驗收吧！', 
    ['船长，这次出海打捞到了不少酒桶，兄弟们有酒喝啦！'] = '船長，這次出海打撈到了不少酒桶，兄弟們有酒喝啦！', 
    ['船长，这次出海被鲨鱼袭击了，船只受损！损失了不少弟兄！'] = '船長，這次出海被鯊魚襲擊了，船隻受損！損失了不少弟兄！', 
    ['船长，这次出海遭遇了暴风雨，船只受损！丢失了许多货物！'] = '船長，這次出海遭遇了暴風雨，船隻受損！丟失了許多貨物！', 
    ['船长，酒馆里已经可以招募航海士了！我们只需要到酒馆准备好足够的佳酿，那些家伙就会自动扑过来。当然，有时良莠不齐、颜值不高是难以避免的啦！'] = '船長，酒館里已經可以招募航海士了！我們只需要到酒館準備好足夠的佳釀，那些家伙就會自動撲過來。當然，有時良莠不齊、顏值不高是難以避免的啦！', 
