    ['花瓣锦绣成团，像一只绣球。自从航海家将其从好望角带到荷兰，欧洲人的窗台上开始经常出现这种绚丽的花朵，同时它也是一种香料。'] = '花瓣錦繡成團，像一隻繡球。自從航海家將其從好望角帶到荷蘭，歐洲人的窗臺上開始經常出現這種絢麗的花朵，同時它也是一種香料。', 
