    ['苏轼'] = '蘇軾', 
    ['苏辙'] = '蘇轍', 
    ['苏门答腊也可以种植咖啡。'] = '蘇門答臘也可以種植咖啡。', 
    ['苏门答腊有一种吃咖啡豆的猫，猫屎可以泡咖啡。'] = '蘇門答臘有一種吃咖啡豆的貓，貓屎可以泡咖啡。', 
    ['若“英国军舰”被击沉，则奴隶会转变阵营。'] = '若“英國軍艦”被擊沉，則奴隸會轉變陣營。', 
    ['若不是因为我不能违犯禁令，泄露我的狱中的秘密，我可以告诉你一件事，最轻微的几句话，都可以使你魂飞魄散，使你年轻的血液凝冻成冰，'] = '若不是因為我不能違犯禁令，泄露我的獄中的秘密，我可以告訴你一件事，最輕微的幾句話，都可以使你魂飛魄散，使你年輕的血液凝凍成冰，', 
    ['若今日我败在这里，只可能是海神对我的惩罚，冒险号可不会束手就擒！'] = '若今日我敗在這裡，只可能是海神對我的懲罰，冒險號可不會束手就擒！', 
    ['若干钻石'] = '若干鑽石', 
    ['若干钻石，闪烁着令人目眩的光芒'] = '若干鑽石，閃爍著令人目眩的光芒', 
    ['若昂·迪亚士'] = '若昂•迪亞士', 
    ['若昂二世国王让他来寻找约翰王和东方国家，希望那个暴躁的家伙不要干蠢事。你可以继续前进，记得拐过海角后就要向北航行了啊。'] = '若昂二世國王讓他來尋找約翰王和東方國家，希望那個暴躁的家伙不要干蠢事。你可以繼續前進，記得拐過海角後就要向北航行了啊。', 
    ['若明朝水军被击沉，将会有更多的敌人出现。'] = '若明朝水軍被擊沉，將會有更多的敵人出現。', 
    ['若消灭所有海盗，可获得各强化材料*100'] = '若消滅所有海盜，可獲得各強化材料*100', 
    ['英伦三岛包括英格兰、苏格兰和威尔士。'] = '英倫三島包括英格蘭、蘇格蘭和威爾士。', 
    ['英军士兵'] = '英軍士兵', 
    ['英勇豪迈的马赛皇家海军炮手，对自由生活的向往让他投身当上私掠船主。浪漫的骑士精神却使其深陷争端的漩涡，他要征服的，已经不止是海洋的惊涛骇浪！'] = '英勇豪邁的馬賽皇家海軍炮手，對自由生活的嚮往讓他投身當上私掠船主。浪漫的騎士精神卻使其深陷爭端的漩渦，他要征服的，已經不止是海洋的驚濤駭浪！', 
    ['英吉利海峡'] = '英吉利海峽', 
    ['英国'] = '英國', 
    ['英国不服从罗马教廷，国王是教会的最高领袖。'] = '英國不服從羅馬教廷，國王是教會的最高領袖。', 
    ['英国人只顾着寻找享受奢侈品，接受指引，前往【汉堡】寻求其他机会吧。'] = '英國人只顧著尋找享受奢侈品，接受指引，前往【漢堡】尋求其他機會吧。', 
    ['英国人和法国人都试图在岛上建立殖民。'] = '英國人和法國人都試圖在島上建立殖民。', 
    ['英国人在沿海岸疯狂地绑架非洲人……'] = '英國人在沿海岸瘋狂地綁架非洲人……', 
    ['英国人封锁了英吉利海峡，我们要冲破他们的防线，只要到这里就安全了。'] = '英國人封鎖了英吉利海峽，我們要衝破他們的防線，只要到這裡就安全了。', 
    ['英国人的海军并不强大，听说他们的女王找了不少的海盗和私掠船才拼凑起这只舰队，让我们好好的教训教训他们吧。'] = '英國人的海軍並不強大，聽說他們的女王找了不少的海盜和私掠船才拼湊起這隻艦隊，讓我們好好的教訓教訓他們吧。', 
    ['英国军官'] = '英國軍官', 
    ['英国军舰'] = '英國軍艦', 
    ['英国国王大都在威斯敏斯特教堂加冕。'] = '英國國王大都在威斯敏斯特教堂加冕。', 
    ['英国国王查理二世就生于波尔多。'] = '英國國王查理二世就生於波爾多。', 
    ['英国打败西班牙之后，弗朗西斯·德雷克已经成为了北海名副其实的霸主。作为女王的骑士、海军中将、完成全球航行的航海家、挫败无敌舰队的海战天才，德雷克的强大让人热血沸腾。而汹涌的赞美和掌声能让最冷静的人都失去理智，德雷克的行为越来越乖张，并且对手下的约束越来越松懈……'] = '英國打敗西班牙之後，弗朗西斯•德雷克已經成為了北海名副其實的霸主。作為女王的騎士、海軍中將、完成全球航行的航海家、挫敗無敵艦隊的海戰天才，德雷克的強大讓人熱血沸騰。而洶涌的贊美和掌聲能讓最冷靜的人都失去理智，德雷克的行為越來越乖張，並且對手下的約束越來越鬆懈……', 
    ['英国政府允许士兵像海盗一样掠夺财宝？'] = '英國政府允許士兵像海盜一樣掠奪財寶？', 
    ['英国海军使用的制式长管炮，使用铁弹作为弹药。'] = '英國海軍使用的制式長管炮，使用鐵彈作為彈葯。', 
    ['英国王室是奴隶贸易的最大幕后支持者，连海军战船也来莫桑比克支援敌军！'] = '英國王室是奴隸貿易的最大幕後支持者，連海軍戰船也來莫桑比克支援敵軍！', 
    ['英国现在是新教国家，不归属罗马教廷。'] = '英國現在是新教國家，不歸屬羅馬教廷。', 
    ['英国皇家海军为了保卫海峡，派出了炮船巡逻，不要去惊动这些没油水的家伙，看准时机躲过去就行了。'] = '英國皇家海軍為了保衛海峽，派出了炮船巡邏，不要去驚動這些沒油水的家伙，看準時機躲過去就行了。', 
    ['英国皇家海军为了保护商船出动了，除掉这些碍事的家伙。'] = '英國皇家海軍為了保護商船出動了，除掉這些礙事的家伙。', 
    ['英国皇家海军的著名风帆战列舰，作为海军上将纳尔逊的旗舰大破法兰西联合舰队而闻名于世。更因其冠绝七海的攻击火力而得到“海上堡垒”的称号。'] = '英國皇家海軍的著名風帆戰列艦，作為海軍上將納爾遜的旗艦大破法蘭西聯合艦隊而聞名於世。更因其冠絕七海的攻擊火力而得到“海上堡壘”的稱號。', 
    ['英国舰队几乎每艘船上都装配了这种船首像，战士们相信女王可以带领他们战胜一切。'] = '英國艦隊幾乎每艘船上都裝配了這種船首像，戰士們相信女王可以帶領他們戰勝一切。', 
    ['英国著名探险家、海盗德雷克的战舰，他成功通过麦哲伦海峡时，为了纪念所剩下来的最后一艘船而改名。金雌鹿号伴随了德雷克一生的征战。'] = '英國著名探險家、海盜德雷克的戰艦，他成功通過麥哲倫海峽時，為了紀念所剩下來的最後一艘船而改名。金雌鹿號伴隨了德雷克一生的征戰。', 
