    ['英格兰人。做奴隶贸易起家的海盗，在印第安人中被称为“禁闭者”。在伦敦的奴隶拍卖会上与上流社会建立了利益关系，在灰色生意上总有人关照。'] = '英格蘭人。做奴隸貿易起家的海盜，在印第安人中被稱為“禁閉者”。在倫敦的奴隸拍賣會上與上流社會建立了利益關係，在灰色生意上總有人關照。', 
    ['英格兰人。其姑母是葡萄牙国王若奥一世的王后，定居葡萄牙后被王室委以重任，成为促成英葡两国结盟的功臣。与亨利王子是好友。'] = '英格蘭人。其姑母是葡萄牙國王若奧一世的王后，定居葡萄牙後被王室委以重任，成為促成英葡兩國結盟的功臣。與亨利王子是好友。', 
    ['英格兰人。典型水手的耿直、冲动和豪迈，会因一言不合大打出手，也会为梦想舍生赴死。虽然自诩为世界公民，但容不得任何人批评自己的祖国。'] = '英格蘭人。典型水手的耿直、衝動和豪邁，會因一言不合大打出手，也會為夢想捨生赴死。雖然自詡為世界公民，但容不得任何人批評自己的祖國。', 
    ['英格兰人。出生于普利茅斯，行事果断、机智，通过鼓动水手哗变夺得船长权位，联合其他5艘海盗船，抢劫了载有大量财富的莫卧尔王朝战舰。'] = '英格蘭人。出生於普利茅斯，行事果斷、機智，通過鼓動水手嘩變奪得船長權位，聯合其他5艘海盜船，搶劫了載有大量財富的莫臥爾王朝戰艦。', 
    ['英格兰人。印度洋大海盗，最早是武装民运船的船长，他特立独行、胆大妄为，贿赂官员得到民船委任状后四处抢掠，是社会名流和海盗们争相结交的对象。'] = '英格蘭人。印度洋大海盜，最早是武裝民運船的船長，他特立獨行、膽大妄為，賄賂官員得到民船委任狀後四處搶掠，是社會名流和海盜們爭相結交的對象。', 
    ['英格兰人。原本为一名老年船主做管家，雇主去世后代为管理产业，利润稳步提升。一次偶然的机会，他听说雇主的继承人尚在人间，于是开始尽力寻找。'] = '英格蘭人。原本為一名老年船主做管家，雇主去世後代為管理產業，利潤穩步提升。一次偶然的機會，他聽說雇主的繼承人尚在人間，於是開始儘力尋找。', 
    ['英格兰人。牧师的儿子，性格多疑但行事专横，是一艘私掠船的船长，在大同盟战争期间，获得当地总督的许可证，在加勒比海地区进行武装私掠活动。'] = '英格蘭人。牧師的兒子，性格多疑但行事專橫，是一艘私掠船的船長，在大同盟戰爭期間，獲得當地總督的許可證，在加勒比海地區進行武裝私掠活動。', 
    ['英格兰人。生于中等家庭，最著名的海图绘制家之一，是个思想敏锐、性格豪放的探险家。年轻时投身于海盗集团，后来成为海盗船船长。'] = '英格蘭人。生於中等家庭，最著名的海圖繪製家之一，是個思想敏銳、性格豪放的探險家。年輕時投身於海盜集團，後來成為海盜船船長。', 
    ['英格兰人。生于贫苦农家，富有冒险精神。从学徒干到水手，最后成为商船船长。据知他是第二位在麦哲伦之后完成环球航海的探险家。'] = '英格蘭人。生於貧苦農家，富有冒險精神。從學徒干到水手，最後成為商船船長。據知他是第二位在麥哲倫之後完成環球航海的探險家。', 
    ['英格兰人。生来就是个亡命徒，喜欢挑战危险的事物，绰号“黑胡子”，被认为是大海上最疯狂、最残忍的海盗，他的骷髅旗几乎成为海盗的图腾。'] = '英格蘭人。生來就是個亡命徒，喜歡挑戰危險的事物，綽號“黑鬍子”，被認為是大海上最瘋狂、最殘忍的海盜，他的骷髏旗幾乎成為海盜的圖騰。', 
    ['英格兰人。自称“最坏的海盗”，实际上做事很有分寸，无论任何时候手里总留有交易用的“筹码”，以便在遭受打击后能够迅速恢复。'] = '英格蘭人。自稱“最壞的海盜”，實際上做事很有分寸，無論任何時候手裡總留有交易用的“籌碼”，以便在遭受打擊後能夠迅速恢復。', 
    ['英格兰人。著名海盗，为人慷慨仁慈，在占领船舰后便将自己旧船给予俘虏，让俘虏得以逃生。他的海盗团员们也自称“义贼团”。'] = '英格蘭人。著名海盜，為人慷慨仁慈，在佔領船艦後便將自己舊船給予俘虜，讓俘虜得以逃生。他的海盜團員們也自稱“義賊團”。', 
