    ['萨姆·贝拉米仅仅活了28岁，“黑山姆”一名的由来是因为贝拉米有着一头黑色的长发扎束成马尾。贝拉米的行事作风有别于其他的海盗，对俘虏十分宽大与慷慨，甚至在占领船舰后便将自己的旧船给予俘虏，让俘虏得以逃生。而他的演说更是为人乐道。相传，听他的演讲，最懦弱的人都能在他的鼓励下变成最无畏的水手，最矜持的妇人也会像月季花一样绽放，就连信天翁都会在他的桅杆上驻足聆听······'] = '薩姆•貝拉米僅僅活了28歲，“黑山姆”一名的由來是因為貝拉米有著一頭黑色的長髮扎束成馬尾。貝拉米的行事作風有別於其他的海盜，對俘虜十分寬大與慷慨，甚至在佔領船艦後便將自己的舊船給予俘虜，讓俘虜得以逃生。而他的演說更是為人樂道。相傳，聽他的演講，最懦弱的人都能在他的鼓勵下變成最無畏的水手，最矜持的婦人也會像月季花一樣綻放，就連信天翁都會在他的桅桿上駐足聆聽••••••', 
