    ['著名的日本战船，船艏到船艉都有楯板做的装甲防护，上面遍布用来射箭、放枪的孔洞。接近敌船后把楯板向外侧放倒，变成通向敌船的桥梁，非常利于接舷战斗。'] = '著名的日本戰船，船艏到船艉都有楯板做的裝甲防護，上面遍佈用來射箭、放槍的孔洞。接近敵船後把楯板向外側放倒，變成通向敵船的橋梁，非常利於接舷戰鬥。', 
