    ['葡萄干！哦，不，我们要的是真正的上好葡萄酒，对于无法满足我们的伙伴，我们是绝对无法愉快的合作下去的啊。'] = '葡萄干！哦，不，我們要的是真正的上好葡萄酒，對於無法滿足我們的伙伴，我們是絕對無法愉快的合作下去的啊。', 
