    ['葡萄牙人'] = '葡萄牙人', 
    ['葡萄牙人、英国人和法国长得都一个样。'] = '葡萄牙人、英國人和法國長得都一個樣。', 
    ['葡萄牙人。中产阶级，父亲和兄长忙于从政，把家里的生意来交给他照料，而他在犯了大量低级错误后终于渐入佳境，取得了令父亲和兄长都吃惊的进展。'] = '葡萄牙人。中產階級，父親和兄長忙於從政，把家裡的生意來交給他照料，而他在犯了大量低級錯誤後終於漸入佳境，取得了令父親和兄長都吃驚的進展。', 
    ['葡萄牙人。亨利王子忠心的侍从，也是约翰.恩里克航海方面的启蒙老师。虽然年纪不大，但操心的事情太多，所以总是一副苦大仇深的表情。'] = '葡萄牙人。亨利王子忠心的侍從，也是約翰.恩里克航海方面的啟蒙老師。雖然年紀不大，但操心的事情太多，所以總是一副苦大仇深的表情。', 
    ['葡萄牙人。凭借敏锐的危机意识和过人的胆量在加勒比海创出名声的狡猾海盗，是来往船只的噩梦。过去是个谜，名字也是假的，在海盗圈子里是个神秘偶像。'] = '葡萄牙人。憑藉敏銳的危機意識和過人的膽量在加勒比海創出名聲的狡猾海盜，是來往船隻的噩夢。過去是個謎，名字也是假的，在海盜圈子裡是個神秘偶像。', 
    ['葡萄牙人。原本是海军军官，因为酗酒被降职后索性做起了自由自在的海盗。势力不大但交友极广，无论军方还是海盗都不愿与他为敌。'] = '葡萄牙人。原本是海軍軍官，因為酗酒被降職後索性做起了自由自在的海盜。勢力不大但交友極廣，無論軍方還是海盜都不願與他為敵。', 
    ['葡萄牙人。是个壮实的木匠，为了帮青梅竹马出头而误伤人命，开始逃亡生涯。一直认为误伤人命是自己的污点，但很多人因此敬畏他。'] = '葡萄牙人。是個壯實的木匠，為了幫青梅竹馬出頭而誤傷人命，開始逃亡生涯。一直認為誤傷人命是自己的污點，但很多人因此敬畏他。', 
    ['葡萄牙人。曾经也是富家子弟，因赌博欠下巨额债务，浪子回头后得到资助，开始有了点起色，但麻烦接踵而至，目前要一面照看生意一面躲避债主。'] = '葡萄牙人。曾經也是富家子弟，因賭博欠下巨額債務，浪子回頭後得到資助，開始有了點起色，但麻煩接踵而至，目前要一面照看生意一面躲避債主。', 
    ['葡萄牙人。有商业头脑的传教士，利用传教的机会兜售一些小商品，在各殖民地都有朋友，商船也乐于让他搭乘。在一次远东旅行中想到了一个新点子，只等大鱼上钩。'] = '葡萄牙人。有商業頭腦的傳教士，利用傳教的機會兜售一些小商品，在各殖民地都有朋友，商船也樂於讓他搭乘。在一次遠東旅行中想到了一個新點子，只等大魚上鉤。', 
    ['葡萄牙人。有经济头脑的情报贩子，靠贩卖亦真亦假的情报赚了第一笔，同时也惹了不少麻烦，一直在寻找一位强有力的靠山帮他摆平一切。'] = '葡萄牙人。有經濟頭腦的情報販子，靠販賣亦真亦假的情報賺了第一筆，同時也惹了不少麻煩，一直在尋找一位強有力的靠山幫他擺平一切。', 
    ['葡萄牙人。没落贵族，为了中兴家族而成为一名殖民者，虽然外表与普通水手无异，但仍努力维持着自己的贵族标签，对荣誉一类的东西非常重视。'] = '葡萄牙人。沒落貴族，為了中興家族而成為一名殖民者，雖然外表與普通水手無異，但仍努力維持著自己的貴族標簽，對榮譽一類的東西非常重視。', 
    ['葡萄牙人。父亲是殖民地总督，而他是殖民地行侠仗义的游侠，可以说专跟父亲作对。官方忍无可忍之下发出通缉令，卡瓦略不得不逃离殖民地。'] = '葡萄牙人。父親是殖民地總督，而他是殖民地行俠仗義的游俠，可以說專跟父親作對。官方忍無可忍之下發出通緝令，卡瓦略不得不逃離殖民地。', 
    ['葡萄牙人。父亲是雷阿尔城的商人，少年时代就开始在父亲的货船上掌舵，穿行葡西两国。当他厌倦了塔霍河狭窄的水道后直接把目光投向了大西洋。'] = '葡萄牙人。父親是雷阿爾城的商人，少年時代就開始在父親的貨船上掌舵，穿行葡西兩國。當他厭倦了塔霍河狹窄的水道後直接把目光投向了大西洋。', 
    ['葡萄牙人。航海家亨利王子的堂弟，准男爵，因为娇生惯养而被派到船上历练。实际上比堂兄想象的更努力，很快具备了领导能力。'] = '葡萄牙人。航海家亨利王子的堂弟，準男爵，因為嬌生慣養而被派到船上歷練。實際上比堂兄想象的更努力，很快具備了領導能力。', 
    ['葡萄牙人。退伍陆军军官之子，在为了对抗海盗而成立的民兵队担任民兵队长，得知主角准备讨伐摩尔人后毅然加入。'] = '葡萄牙人。退伍陸軍軍官之子，在為了對抗海盜而成立的民兵隊擔任民兵隊長，得知主角準備討伐摩爾人後毅然加入。', 
