    ['虽然“梅利”号被阿芒德击沉，但重建的舰队已经初具规模了，现在先回$(missioncolor:【里斯本】)，或许亨利王子能够提供一些帮助。'] = '雖然“梅利”號被阿芒德擊沉，但重建的艦隊已經初具規模了，現在先回$(missioncolor:【裡斯本】)，或許亨利王子能夠提供一些幫助。', 
    ['虽然一切都准备妥当，但在伊斯坦堡你赢得还是很艰难。不过霸者之路从来都不是轻松的坦途，剑只有在磨砺之后才会展露锋芒！'] = '雖然一切都準備妥當，但在伊斯坦堡你贏得還是很艱難。不過霸者之路從來都不是輕鬆的坦途，劍只有在磨礪之後才會展露鋒芒！', 
    ['虽然不太懂，但是看上去很厉害的样子！'] = '雖然不太懂，但是看上去很厲害的樣子！', 
    ['虽然不知道是谁稍稍破坏了我完美的计划，导致了你们提前赶来，不过有些小瑕疵也无妨，恐怕连王座上的国王都不会怀疑我。'] = '雖然不知道是誰稍稍破壞了我完美的計劃，導致了你們提前趕來，不過有些小瑕疵也無妨，恐怕連王座上的國王都不會懷疑我。', 
    ['虽然你对维克多极尽讽刺与挖苦，其实你心里是非常珍惜这份友谊的。'] = '雖然你對維克多極盡諷刺與挖苦，其實你心裡是非常珍惜這份友誼的。', 
    ['虽然名字不一样，但您所说的宝石的外观确实和我要找的东西一样。这……您是怎么知道我在寻找一种宝石的？'] = '雖然名字不一樣，但您所說的寶石的外觀確實和我要找的東西一樣。這……您是怎麼知道我在尋找一種寶石的？', 
    ['虽然我们还缺不少人手，但形势紧急，让我们补充补给，即刻向【巴塞罗那】出发！'] = '雖然我們還缺不少人手，但形勢緊急，讓我們補充補給，即刻向【巴塞羅那】出發！', 
    ['虽然我很想帮助你，我的朋友，但现在我们的商队也需要保护，我们实在腾不出手来帮助你。'] = '雖然我很想幫助你，我的朋友，但現在我們的商隊也需要保護，我們實在騰不出手來幫助你。', 
    ['虽然找回了图纸，但要制造这么庞大的战舰需要无数人力物力。'] = '雖然找回了圖紙，但要製造這麼龐大的戰艦需要無數人力物力。', 
    ['虽然投资信是不错，不过每天都要做日常，感觉好麻烦的样子……'] = '雖然投資信是不錯，不過每天都要做日常，感覺好麻煩的樣子……', 
    ['虽然抵御住了达伽马的再次攻击，但卡利卡特的防御力量几乎伤毁殆尽，到'] = '雖然抵禦住了達伽馬的再次攻擊，但卡利卡特的防禦力量幾乎傷毀殆盡，到', 
    ['虽然是欧洲人，但拉斯·卡萨斯教士是我们的朋友。'] = '雖然是歐洲人，但拉斯•卡薩斯教士是我們的朋友。', 
    ['虽然有些难以启齿，但我不想隐瞒，说实话，绵羊终究无法逃脱狼群的追猎。'] = '雖然有些難以啟齒，但我不想隱瞞，說實話，綿羊終究無法逃脫狼群的追獵。', 
