    ['西班牙“无敌舰队”的主力炮舰，装配有多层的炮楼。依靠这种“海上要塞”般的战舰，西班牙一度成为了世界的海洋霸主。'] = '西班牙“無敵艦隊”的主力炮艦，裝配有多層的炮樓。依靠這種“海上要塞”般的戰艦，西班牙一度成為了世界的海洋霸主。', 
    ['西班牙、意大利的航海家都会来这里学习。'] = '西班牙、意大利的航海家都會來這裡學習。', 
    ['西班牙与南美人原住民混血儿。会西班牙语，与各地水手混得熟络，为人淳朴善良，没有财富积累的观念，手头有一点闲钱就会在赌桌上输得精光。'] = '西班牙與南美人原住民混血兒。會西班牙語，與各地水手混得熟絡，為人淳樸善良，沒有財富積累的觀念，手頭有一點閑錢就會在賭桌上輸得精光。', 
    ['西班牙人。为了娶到自己的梦中情人不断做着发财梦，因听说某小岛有海盗的宝藏而出海，几年时间里虽然没有找到宝藏，但积累了丰富的航海知识。'] = '西班牙人。為了娶到自己的夢中情人不斷做著發財夢，因聽說某小島有海盜的寶藏而出海，幾年時間里雖然沒有找到寶藏，但積累了豐富的航海知識。', 
    ['西班牙人。乡绅世家，小时候被骑士小说冲昏头脑，在城市里攀援跳跃，把钟楼当龙穴。成年后依然故我，家人希望通过婚姻锁住他，而他索性逃到了海上。'] = '西班牙人。鄉紳世家，小時候被騎士小說衝昏頭腦，在城市裡攀援跳躍，把鐘樓當龍穴。成年後依然故我，家人希望通過婚姻鎖住他，而他索性逃到了海上。', 
    ['西班牙人。以一头火红的长发著称，在海盗中被称为“女爵”，为了找出逃婚的丈夫而专挑海军船只下手，其疯狂程度只有“黑胡子”可堪匹敌。'] = '西班牙人。以一頭火紅的長髮著稱，在海盜中被稱為“女爵”，為了找出逃婚的丈夫而專挑海軍船隻下手，其瘋狂程度只有“黑鬍子”可堪匹敵。', 
    ['西班牙人。传奇大海盗“黑胡子”的女儿，喜欢男装打扮，从小苦练剑术并组织自己的马贼团，希望向抛弃自己的父亲复仇。'] = '西班牙人。傳奇大海盜“黑鬍子”的女兒，喜歡男裝打扮，從小苦練劍術並組織自己的馬賊團，希望向拋棄自己的父親復仇。', 
    ['西班牙人。博学的收藏家，尤其喜欢收藏各种地图，当发现各种航海地图描述差异极大时觉得马可.波罗等人都是大话精，准备出海亲眼见证真相。'] = '西班牙人。博學的收藏家，尤其喜歡收藏各種地圖，當發現各種航海地圖描述差異極大時覺得馬可.波羅等人都是大話精，準備出海親眼見證真相。', 
    ['西班牙人。性格坚毅的小胡子，为躲避当地领主的迫害溜上了远洋商船。5年时间，从一名与老鼠为伍的底层水手成长为商船的大副。'] = '西班牙人。性格堅毅的小鬍子，為躲避當地領主的迫害溜上了遠洋商船。5年時間，從一名與老鼠為伍的底層水手成長為商船的大副。', 
    ['西班牙人。沉默而老道的水手，从来只谈生意不谈交情。在吵吵嚷嚷的水手圈子里被称为“冷面人”，但也有相当多的船长喜欢他的务实处事风格。'] = '西班牙人。沉默而老道的水手，從來只談生意不談交情。在吵吵嚷嚷的水手圈子裡被稱為“冷面人”，但也有相當多的船長喜歡他的務實處事風格。', 
    ['西班牙人。脾气暴躁，嗓门儿大，在与海盗的交锋中被刺伤眼睛，伤疤让他显得更狰狞。但其实心地善良，喜欢小孩且擅长做各种玩具。'] = '西班牙人。脾氣暴躁，嗓門兒大，在與海盜的交鋒中被刺傷眼睛，傷疤讓他顯得更猙獰。但其實心地善良，喜歡小孩且擅長做各種玩具。', 
    ['西班牙人。英俊而激情洋溢的青年，有很大的志向，但半生都被霉运之神笼罩。虽然已经很少有船长敢招募他，但他仍然没有放弃自己的理想。'] = '西班牙人。英俊而激情洋溢的青年，有很大的志向，但半生都被霉運之神籠罩。雖然已經很少有船長敢招募他，但他仍然沒有放棄自己的理想。', 
