    ['这个该死的混蛋居然拆了我的“命运号”！没法修复了啊。'] = '這個該死的混蛋居然拆了我的“命運號”！沒法修復了啊。', 
    ['这个酒桶看起来没有什么特别之处，没想到里面居然藏有%d本【%s】，和%d个【%s】。'] = '這個酒桶看起來沒有什麼特別之處，沒想到裡面居然藏有%d本【%s】，和%d個【%s】。', 
    ['这个重要的港口吧！'] = '這個重要的港口吧！', 
    ['这个重要的港口！'] = '這個重要的港口！', 
    ['这么大的雨，视野都不清晰了，等等我们，小船可经不起折腾。'] = '這麼大的雨，視野都不清晰了，等等我們，小船可經不起折騰。', 
    ['这么快就醉了？！'] = '這麼快就醉了？！', 
    ['这么珍贵的东西，要牢牢掌握在自己手中。'] = '這麼珍貴的東西，要牢牢掌握在自己手中。', 
    ['这么胆大的女人除了拉比斯我实在想不出第二位来。那我们就现在就前往海盗大本营$(missioncolor:【比绍】)去营救她吧，真是令人头疼的家伙。'] = '這麼膽大的女人除了拉比斯我實在想不出第二位來。那我們就現在就前往海盜大本營$(missioncolor:【比紹】)去營救她吧，真是令人頭疼的家伙。', 
    ['这么说你是要站在东印度公司那一边喽。'] = '這麼說你是要站在東印度公司那一邊嘍。', 
    ['这么说您决定跟随船队出海就是为了找到老船长的继承人？'] = '這麼說您決定跟隨船隊出海就是為了找到老船長的繼承人？', 
    ['这么长时间以来，我见过的夷人，全部都是那些野蛮无理、长相奇异的强盗，所以就把你们也误认为来烧杀抢掠的海盗了。'] = '這麼長時間以來，我見過的夷人，全部都是那些野蠻無理、長相奇異的強盜，所以就把你們也誤認為來燒殺搶掠的海盜了。', 
    ['这也叫海盗！简直就是不堪一击。'] = '這也叫海盜！簡直就是不堪一擊。', 
    ['这也怨不得你。这下我是彻底没什么可去的地方了，只好留在这艘船上，你不会反对吧，亲爱的船长？'] = '這也怨不得你。這下我是徹底沒什麼可去的地方了，只好留在這艘船上，你不會反對吧，親愛的船長？', 
    ['这些兵匪难分的家伙原来全部都是巴巴罗萨.海雷丁的手下，消灭这些豺狼，不过要小心阿芒德的旗舰，奥斯曼海盗王可不是好惹的。'] = '這些兵匪難分的家伙原來全部都是巴巴羅薩.海雷丁的手下，消滅這些豺狼，不過要小心阿芒德的旗艦，奧斯曼海盜王可不是好惹的。', 
    ['这些勇敢的冒险家聚集在一起貌似是为了反抗海盗的压迫，我们已经剿灭了海盗，现在去市政厅投资，说不定会获得一位经验丰富的航海士的青睐呢！'] = '這些勇敢的冒險家聚集在一起貌似是為了反抗海盜的壓迫，我們已經剿滅了海盜，現在去市政廳投資，說不定會獲得一位經驗豐富的航海士的青睞呢！', 
    ['这些古旧的碎片居然拼出了一张完整的藏宝图，出海探寻宝藏，看看有什么额外的收获吧'] = '這些古舊的碎片居然拼出了一張完整的藏寶圖，出海探尋寶藏，看看有什麼額外的收穫吧', 
    ['这些只是零散海盗而已，实力不值一晒！根本连海盗团都称不上。'] = '這些只是零散海盜而已，實力不值一曬！根本連海盜團都稱不上。', 
    ['这些奇怪的东西一起熬在一起真的能吃吗……'] = '這些奇怪的東西一起熬在一起真的能吃嗎……', 
    ['这些家伙速度可真快，好像已经攻进了海上丝绸之路起点——泉州……那边是…达尔布克基！'] = '這些家伙速度可真快，好像已經攻進了海上絲綢之路起點——泉州……那邊是…達爾布克基！', 
    ['这些巨型战舰里装载的是满满的鸦片，这些地狱之花给这里带来了永夜般的黑暗。死灰复燃的东印度公司仍然在制造无边的罪孽，碾碎他们！'] = '這些巨型戰艦里裝載的是滿滿的鴉片，這些地獄之花給這裡帶來了永夜般的黑暗。死灰復燃的東印度公司仍然在製造無邊的罪孽，碾碎他們！', 
    ['这些年来，东南亚多了许多欧洲人。'] = '這些年來，東南亞多了許多歐洲人。', 
    ['这些无耻的强盗，控制了国王，还掠夺了无数的黄金，一个也不能放过！'] = '這些無恥的強盜，控制了國王，還掠奪了無數的黃金，一個也不能放過！', 
    ['这些烦人的官兵就像苍蝇一样赶也赶不走，徐海决定自己带队击退追捕的官兵。'] = '這些煩人的官兵就像蒼蠅一樣趕也趕不走，徐海決定自己帶隊擊退追捕的官兵。', 
    ['这些犬牙交错的岛礁不仅可以掩护伏击，也可以分散船阵！'] = '這些犬牙交錯的島礁不僅可以掩護伏擊，也可以分散船陣！', 
    ['这些破旧的碎片居然是一张藏宝图，让我们看看藏宝地点在哪！'] = '這些破舊的碎片居然是一張藏寶圖，讓我們看看藏寶地點在哪！', 
    ['这些防御炮台非常坚固，尽量将他们诱出炮台火力覆盖范围，再逐个消灭。'] = '這些防禦炮台非常堅固，儘量將他們誘出炮台火力覆蓋範圍，再逐個消滅。', 
    ['这伙海盗的做法是每次交易都选择在半夜进行，为的是方便实施抢夺。但同意半夜偷偷交易的难道不也是非法商品贩子吗？不用跟他们“客气”。'] = '這夥海盜的做法是每次交易都選擇在半夜進行，為的是方便實施搶奪。但同意半夜偷偷交易的難道不也是非法商品販子嗎？不用跟他們“客氣”。', 
    ['这伙海盗！打着贸易公司的旗号无恶不作。现在，他们的指挥官彼得松.霍因又指挥着他的海盗船队扑向了新大陆。'] = '這夥海盜！打著貿易公司的旗號無惡不作。現在，他們的指揮官彼得松.霍因又指揮著他的海盜船隊撲向了新大陸。', 
    ['这伙海盗，在攻击了普林西蒲城后，不但没有仓皇逃走，竟敢企图进攻贝略港。做好准备，给年轻的对手一个难忘的教训。'] = '這夥海盜，在攻擊了普林西蒲城後，不但沒有倉皇逃走，竟敢企圖進攻貝略港。做好準備，給年輕的對手一個難忘的教訓。', 
    ['这位先生，难道您还不知道吗？那些打着商人旗号的家伙其实贩卖的商品正是……我的同胞呀！已经有许多兄弟姐妹被那个可恶的家伙给贩卖去了天涯海角，再也见不到了！！'] = '這位先生，難道您還不知道嗎？那些打著商人旗號的家伙其實販賣的商品正是……我的同胞呀！已經有許多兄弟姐妹被那個可惡的家伙給販賣去了天涯海角，再也見不到了！！', 
    ['这位大叔，不要激动，现在让我们一起来了解您的故事。'] = '這位大叔，不要激動，現在讓我們一起來瞭解您的故事。', 
    ['这位新来的水手长居然会熟练地使用钩锁，船长，你可赚大了。'] = '這位新來的水手長居然會熟練地使用鉤鎖，船長，你可賺大了。', 
    ['这句话的意思是把猴封起来非常合我心意，这样海面上就会风平浪静。'] = '這句話的意思是把猴封起來非常合我心意，這樣海面上就會風平浪靜。', 
    ['这只船正在使用'] = '這隻船正在使用', 
    ['这可是个好消息，也不枉费我多浪费了几天。我们现在就去改造吧，我早就想给旗舰多加两门火炮。'] = '這可是個好消息，也不枉費我多浪費了幾天。我們現在就去改造吧，我早就想給旗艦多加兩門火炮。', 
    ['这可是个好消息，我早就想给旗舰上多加装两门火炮了。'] = '這可是個好消息，我早就想給旗艦上多加裝兩門火炮了。', 
    ['这可是个好消息，马上就去造船厂。'] = '這可是個好消息，馬上就去造船廠。', 
    ['这可是好东西！这上面记录着经历丰富的冒险家们的毕生经验.交给你的航海士阅读，可以提升阅历，增长知识。'] = '這可是好東西！這上面記錄著經歷豐富的冒險家們的畢生經驗.交給你的航海士閱讀，可以提升閱歷，增長知識。', 
    ['这可真是个好地方呢！茂密的丛林和辽阔的草原，看来这是个适合发展，值得投资的好地方呢！'] = '這可真是個好地方呢！茂密的叢林和遼闊的草原，看來這是個適合發展，值得投資的好地方呢！', 
    ['这可真是个好消息，戴肯叔叔。就按您说的办。'] = '這可真是個好消息，戴肯叔叔。就按您說的辦。', 
    ['这场战役实在是太惊险了，没想到陈祖义如此心狠手辣，竟然都是下死手。'] = '這場戰役實在是太驚險了，沒想到陳祖義如此心狠手辣，竟然都是下死手。', 
    ['这场战斗真是艰难，维达号名不虚传！'] = '這場戰鬥真是艱難，維達號名不虛傳！', 
    ['这场荒唐的战争该结束了，我会向民众证明这场战争是个错误，你们只是无辜的受害者。'] = '這場荒唐的戰爭該結束了，我會向民眾證明這場戰爭是個錯誤，你們只是無辜的受害者。', 
    ['这块冰看起来没什么威胁，不过我们还是轰碎它吧，别让它挡着路。'] = '這塊冰看起來沒什麼威脅，不過我們還是轟碎它吧，別讓它擋著路。', 
    ['这块大陆上要什么有什么。'] = '這塊大陸上要什麼有什麼。', 
    ['这大英帝国可真舍得下这么大的血本……'] = '這大英帝國可真捨得下這麼大的血本……', 
    ['这对你来说的确有失公平，难道你要因此卸下你肩上的责任？'] = '這對你來說的確有失公平，難道你要因此卸下你肩上的責任？', 
    ['这就明了了！海盗其实是有两拨，一波是真正的海盗，而另一波则是……来不及了，我们火速赶往卡利卡特增援！'] = '這就明瞭了！海盜其實是有兩撥，一波是真正的海盜，而另一波則是……來不及了，我們火速趕往卡利卡特增援！', 
    ['这就是糖胶？真想不到长相那么凶恶的乌加尔·马丁能用这些东西做出那么精制的糖人。'] = '這就是糖膠？真想不到長相那麼凶惡的烏加爾•馬丁能用這些東西做出那麼精製的糖人。', 
    ['这就是索法拉么？看起来就像个小渔村呀！'] = '這就是索法拉麽？看起來就像個小漁村呀！', 
    ['这就是那群海盗的首领了'] = '這就是那群海盜的首領了', 
    ['这就足够了！愿诸神保佑你我，如果有机会，我一定回来助你一臂之力！以报答你的慷慨援助！'] = '這就足夠了！願諸神保佑你我，如果有機會，我一定回來助你一臂之力！以報答你的慷慨援助！', 
    ['这帮混蛋！'] = '這幫混蛋！', 
    ['这年月想做海盗的比想做骑士的还多！'] = '這年月想做海盜的比想做騎士的還多！', 
    ['这并非易事，我想我们需要准备充分才行。'] = '這並非易事，我想我們需要準備充分才行。', 
    ['这座城市原来是玛雅人的特奥城。'] = '這座城市原來是瑪雅人的特奧城。', 
    ['这座城市的实际统治者不是总督，而是银行家们。'] = '這座城市的實際統治者不是總督，而是銀行家們。', 
    ['这座城市的年纪比葡萄牙王国的年纪还大呢！'] = '這座城市的年紀比葡萄牙王國的年紀還大呢！', 
    ['这座岛被称为印度洋上的明珠。'] = '這座島被稱為印度洋上的明珠。', 
    ['这座港口是从穆斯林的手中夺来的。'] = '這座港口是從穆斯林的手中奪來的。', 
    ['这座港口是根据圣经中的圣多美日命名的。'] = '這座港口是根據聖經中的聖多美日命名的。', 
    ['这座港口没什么有意思的东西。'] = '這座港口沒什麼有意思的東西。', 
    ['这座贸易港可真繁盛，人们都在港口边忙碌。'] = '這座貿易港可真繁盛，人們都在港口邊忙碌。', 
    ['这很突然……'] = '這很突然……', 
    ['这我倒是没意见，那家伙差点害我没命，不过，我要先到加尔各答一趟，顺便还个欠下的人情。'] = '這我倒是沒意見，那家伙差點害我沒命，不過，我要先到加爾各答一趟，順便還個欠下的人情。', 
    ['这我倒是还没考虑过，你可以说说你的条件，太难的要求我可做不到。'] = '這我倒是還沒考慮過，你可以說說你的條件，太難的要求我可做不到。', 
    ['这战力，并不是贩奴船！而是普通的商船！'] = '這戰力，並不是販奴船！而是普通的商船！', 
    ['这才是我葡萄牙的勇士！正好，最近威尼斯联邦牵头组建神圣联盟，准备讨伐奥斯曼海军，奥斯曼海军统帅正是巴巴罗萨，第一块信物就在他手中。'] = '這才是我葡萄牙的勇士！正好，最近威尼斯聯邦牽頭組建神聖聯盟，準備討伐奧斯曼海軍，奧斯曼海軍統帥正是巴巴羅薩，第一塊信物就在他手中。', 
    ['这支神秘的工匠锤是工匠公会的信物，有了它就可以找到那些臭脾气的老工匠协助我们改造船只'] = '這支神秘的工匠錘是工匠公會的信物，有了它就可以找到那些臭脾氣的老工匠協助我們改造船隻', 
    ['这支神秘的工匠锤是工匠公会的信物，有了它就可以找到那些臭脾气的老工匠协助我们改造船只。不过那些臭脾气的老工匠C级以下的船只可看不上眼。前往【舰队】，改造C级或以上船舶'] = '這支神秘的工匠錘是工匠公會的信物，有了它就可以找到那些臭脾氣的老工匠協助我們改造船隻。不過那些臭脾氣的老工匠C級以下的船隻可看不上眼。前往【艦隊】，改造C級或以上船舶', 
    ['这是一个大海贼时代，前往伟大的航路吧！'] = '這是一個大海賊時代，前往偉大的航路吧！', 
    ['这是一张记录着宝藏埋藏地的地图。'] = '這是一張記錄著寶藏埋藏地的地圖。', 
    ['这是一点小小的心意顾问先生，您看能不能通融一下……'] = '這是一點小小的心意顧問先生，您看能不能通融一下……', 
    ['这是个锤子？'] = '這是個鎚子？', 
    ['这是什么东西？船上的渔网居然没人会用，还是离这个怪物远一点吧！'] = '這是什麼東西？船上的漁網居然沒人會用，還是離這個怪物遠一點吧！', 
    ['这是什么？'] = '這是什麼？', 
    ['这是冒险家协会为新人冒险家的准备的宝物精华，这些足够你把这门火炮提升一阶，不过，之后升阶所需的宝物精华，只有通过冒险来获得了。'] = '這是冒險家協會為新人冒險家的準備的寶物精華，這些足夠你把這門火炮提升一階，不過，之後升階所需的寶物精華，只有通過冒險來獲得了。', 
    ['这是刚刚那个废物口中“美丽的宝瓶”——塞壬低语魔瓶，可笑的家伙，居然只把它当做一个美丽的装饰品，真是愚蠢！'] = '這是剛剛那個廢物口中“美麗的寶瓶”——塞壬低語魔瓶，可笑的家伙，居然只把它當做一個美麗的裝飾品，真是愚蠢！', 
    ['这是因为贪婪！从战争英雄到成功商人，到最后沦为恶贯满盈的海盗，是欲望与贪婪使你变得多面……'] = '這是因為貪婪！從戰爭英雄到成功商人，到最後淪為惡貫滿盈的海盜，是欲望與貪婪使你變得多面……', 
    ['这是塞壬低语魔瓶，它就能创造出真实的幻境，你曾打败过的敌人会以更强大的姿态重新出现。挑战并打败他们，你就会得到魔瓶上一任主人——迪亚士封印在里面的奖励。'] = '這是塞壬低語魔瓶，它就能創造出真實的幻境，你曾打敗過的敵人會以更強大的姿態重新出現。挑戰並打敗他們，你就會得到魔瓶上一任主人——迪亞士封印在裡面的獎勵。', 
    ['这是我为拯救昔日故友的一点心意，你不用推辞，现在我帮助你，以后我会需要你的帮助……'] = '這是我為拯救昔日故友的一點心意，你不用推辭，現在我幫助你，以後我會需要你的幫助……', 
    ['这是我们应做的，夺回巴塞罗那只是开始，我们的目标是彻底消灭敌人！可惜我的人手不足，您是一名航海士？'] = '這是我們應做的，奪回巴塞羅那隻是開始，我們的目標是徹底消滅敵人！可惜我的人手不足，您是一名航海士？', 
    ['这是汉萨同盟最强的力量，正面强攻无异于以卵击石，先攻击旁边的护卫船，瓦解他们防线，最后围歼这只“雄鹰”。'] = '這是漢薩同盟最強的力量，正面強攻無異於以卵擊石，先攻擊旁邊的護衛船，瓦解他們防線，最後圍殲這隻“雄鷹”。', 
    ['这是海洋女神之誓言，据传在它共有7块，分布在世界的七大海域之中，据说集齐七块碎片，才能获得面见女神的资格。这块碎片正是当年我亲手交给你父亲的一块……'] = '這是海洋女神之誓言，據傳在它共有7塊，分佈在世界的七大海域之中，據說集齊七塊碎片，才能獲得面見女神的資格。這塊碎片正是當年我親手交給你父親的一塊……', 
    ['这是葡萄牙总督达尔布克基的旗帜。'] = '這是葡萄牙總督達爾布克基的旗幟。', 
    ['这是！'] = '這是！', 
    ['这枚被他当做假眼的物件就是霸主信物，巴巴罗萨貌似要说一些秘辛。不好，有人偷袭，巴巴罗萨中弹身亡'] = '這枚被他當做假眼的物件就是霸主信物，巴巴羅薩貌似要說一些秘辛。不好，有人偷襲，巴巴羅薩中彈身亡', 
    ['这样不会耽误我们的行程吧。'] = '這樣不會耽誤我們的行程吧。', 
    ['这样你就可以顺利的掌控整个印度洋了。'] = '這樣你就可以順利的掌控整個印度洋了。', 
    ['这样做出来的东西真的能吃吗？'] = '這樣做出來的東西真的能吃嗎？', 
    ['这样啊，实在太可惜了，至少700%的利润啊，太可惜了，太可惜了，太可惜了……'] = '這樣啊，實在太可惜了，至少700%的利潤啊，太可惜了，太可惜了，太可惜了……', 
    ['这样的一个港口重镇自然有很多人盯着，我手下的一个水手刚刚和我说，张保仔想见你，想和你一起啃下最难啃的港口马六甲。'] = '這樣的一個港口重鎮自然有很多人盯著，我手下的一個水手剛剛和我說，張保仔想見你，想和你一起啃下最難啃的港口馬六甲。', 
    ['这样的对手我都赢不了，还要怎么去挑战阿芒德？怎么去救出拉比斯？怎么去找到失踪的父亲呢？我真是……'] = '這樣的對手我都贏不了，還要怎麼去挑戰阿芒德？怎麼去救出拉比斯？怎麼去找到失蹤的父親呢？我真是……', 
    ['这次就当是个教训，骄兵必败，你当引以为戒。但是这场战斗过后，我们需要休养生息，才有机会攻破陈祖义的老巢，找到女神之誓碎片。'] = '這次就當是個教訓，驕兵必敗，你當引以為戒。但是這場戰鬥過後，我們需要休養生息，才有機會攻破陳祖義的老巢，找到女神之誓碎片。', 
    ['这次收获可真不少！不仅获得%s金币，还有%s个【%s】。'] = '這次收穫可真不少！不僅獲得%s金幣，還有%s個【%s】。', 
