    ['这片海域，寒风和浮冰都让人难受，喝一口烈酒投入战斗才能让人热血沸腾起来。'] = '這片海域，寒風和浮冰都讓人難受，喝一口烈酒投入戰鬥才能讓人熱血沸騰起來。', 
    ['这真是一个伟大的文艺复兴时代！'] = '這真是一個偉大的文藝復興時代！', 
    ['这真是个艰难的任务'] = '這真是個艱難的任務', 
    ['这真是让我痛不欲生，我的梦想就是消灭这种苦难，请你一定帮助我！到开普敦找到曼德拉王子，他一定会伸出援手的！'] = '這真是讓我痛不欲生，我的夢想就是消滅這種苦難，請你一定幫助我！到開普敦找到曼德拉王子，他一定會伸出援手的！', 
    ['这真是让我痛不欲生，我的梦想就是消灭这种苦难，请你一定帮助我！到开普敦找到曼德拉王子，制止霍金斯的罪行！'] = '這真是讓我痛不欲生，我的夢想就是消滅這種苦難，請你一定幫助我！到開普敦找到曼德拉王子，制止霍金斯的罪行！', 
    ['这种托后腿的队友真是令人头痛，不过唯一的好处是能够帮我们分散火力。有消息称，红胡子在偷袭神圣同盟旗舰时，被四散奔逃的神圣同盟舰队冲散了阵型，这对于我们来说可是个好机会。。'] = '這種托後腿的隊友真是令人頭痛，不過唯一的好處是能夠幫我們分散火力。有消息稱，紅鬍子在偷襲神聖同盟旗艦時，被四散奔逃的神聖同盟艦隊衝散了陣型，這對於我們來說可是個好機會。。', 
