    ['那些愚蠢的家伙总是自以为是，他们并不清楚，女人也能像男人一样战斗。不，应该说比男人更能战斗！'] = '那些愚蠢的家伙總是自以為是，他們並不清楚，女人也能像男人一樣戰鬥。不，應該說比男人更能戰鬥！', 
    ['那些暴徒都是彼得松•霍因的手下，他命令他们替东印度公司掌管所有锡兰的贸易。'] = '那些暴徒都是彼得松•霍因的手下，他命令他們替東印度公司掌管所有錫蘭的貿易。', 
    ['那些本地人说我侮辱中华的美食……他们掀了我的摊子还把月饼都踩碎了，有个日本人说我做的简直是“黑暗料理”！'] = '那些本地人說我侮辱中華的美食……他們掀了我的攤子還把月餅都踩碎了，有個日本人說我做的簡直是“黑暗料理”！', 
    ['那些欧洲海盗竟然拥有海军大炮？务必小心应对！'] = '那些歐洲海盜竟然擁有海軍大炮？務必小心應對！', 
    ['那些海盗，胆子太大了，竟然连重兵把守的港口都敢来进犯。不能放过他们。'] = '那些海盜，膽子太大了，竟然連重兵把守的港口都敢來進犯。不能放過他們。', 
    ['那些炮塔伤害巨大，别靠近。'] = '那些炮塔傷害巨大，別靠近。', 
    ['那些落后的家伙还驾驶着古老的桨帆船，让他们好好见识风帆船的威力吧。'] = '那些落後的家伙還駕駛著古老的槳帆船，讓他們好好見識風帆船的威力吧。', 
    ['那些被赶跑的强盗和赌徒听说在东南方的海岛上建立了一个叫做【圣多美】的港口，我必须过去看看，可不能让他们形成气候！'] = '那些被趕跑的強盜和賭徒聽說在東南方的海島上建立了一個叫做【聖多美】的港口，我必須過去看看，可不能讓他們形成氣候！', 
    ['那伙该死的阿拉伯商人，不但拒绝与我的船队贸易，还煽动民众抵制我们，你与我手下一起，把那些家伙全部赶出果阿！'] = '那夥該死的阿拉伯商人，不但拒絕與我的船隊貿易，還煽動民眾抵制我們，你與我手下一起，把那些家伙全部趕出果阿！', 
    ['那伙龙蛇混杂的欧洲海盗依仗自己船坚炮利，在南中国海到处设据点对往来商船肆意掠夺。'] = '那夥龍蛇混雜的歐洲海盜依仗自己船堅炮利，在南中國海到處設據點對往來商船肆意掠奪。', 
    ['那你是为了什么？'] = '那你是為了什麼？', 
    ['那几位可得多加小心，我爹让我赶来告诉几位，汪直一直难以剿灭，除了其实力强大之外，还因为其与丰臣秀吉有着关系。'] = '那幾位可得多加小心，我爹讓我趕來告訴幾位，汪直一直難以剿滅，除了其實力強大之外，還因為其與豐臣秀吉有著關係。', 
    ['那可是一场艰难的战斗，维达号名不虚传。'] = '那可是一場艱難的戰鬥，維達號名不虛傳。', 
    ['那好吧，姑且就相信你们，但你们先协助我恢复开普敦的士气。'] = '那好吧，姑且就相信你們，但你們先協助我恢復開普敦的士氣。', 
    ['那好吧，您先告诉我，那群人是谁？'] = '那好吧，您先告訴我，那群人是誰？', 
    ['那好，最新战报，我们反抗军秘密筹集物资的商队由于叛徒泄密，被围堵在霍尔木兹，希望你们能即刻赶赴那里，解救商队。'] = '那好，最新戰報，我們反抗軍秘密籌集物資的商隊由於叛徒泄密，被圍堵在霍爾木茲，希望你們能即刻趕赴那裡，解救商隊。', 
    ['那家伙阴险狡诈，却偏偏有坚硬的城墙，让我们到亚齐集结，我安排内应到马六甲城里，到时候里应外合才能获得胜利。'] = '那家伙陰險狡詐，卻偏偏有堅硬的城牆，讓我們到亞齊集結，我安排內應到馬六甲城裡，到時候裡應外合才能獲得勝利。', 
    ['那就一鼓作气，拿下他们！'] = '那就一鼓作氣，拿下他們！', 
    ['那就好，但愿他们能给我改造出我梦寐以求的火炮吧。'] = '那就好，但願他們能給我改造出我夢寐以求的火炮吧。', 
    ['那就是我的手杖，即不是偷来的也不是抢来的，你们别来烦我！'] = '那就是我的手杖，即不是偷來的也不是搶來的，你們別來煩我！', 
    ['那就是没得谈咯，你们真以为胜券在握了吗？人头在这，你倒是来拿啊！'] = '那就是沒得談咯，你們真以為勝券在握了嗎？人頭在這，你倒是來拿啊！', 
    ['那就看看谁先到吧，【果阿】可不比卡利卡特差多少！'] = '那就看看誰先到吧，【果阿】可不比卡利卡特差多少！', 
    ['那已经可以称你为女强人了。'] = '那已經可以稱你為女強人了。', 
