    ['那是啥？投资文化港口赠送的航海士学习书籍！我记得那个谁说过学习使人气质高雅！我亲爱的船长，能让我试试吗？'] = '那是啥？投資文化港口贈送的航海士學習書籍！我記得那個誰說過學習使人氣質高雅！我親愛的船長，能讓我試試嗎？', 
