    ['郑和的宝船船队经过附近，这么大的船队，必定有无数宝物，只是军队庞大，硬抢只怕不容易得手，不妨诈降趁其不备一击必杀！'] = '鄭和的寶船船隊經過附近，這麼大的船隊，必定有無數寶物，只是軍隊龐大，硬搶只怕不容易得手，不妨詐降趁其不備一擊必殺！', 
    ['郑和的遗物拿到了，我们快回【雅加达】把他交给【静轩·白】吧。'] = '鄭和的遺物拿到了，我們快回【雅加達】把他交給【靜軒•白】吧。', 
