    ['郑成功先生，你的要求我们已经做到了，稍后我会去各处市政厅投资来复兴各处城镇。虽然不能弥补达尔布克基所做的万一，我也算是尽我所能了。至于道歉什么的，我想就不需要了，告辞。'] = '鄭成功先生，你的要求我們已經做到了，稍後我會去各處市政廳投資來複興各處城鎮。雖然不能彌補達爾布克基所做的萬一，我也算是盡我所能了。至於道歉什麼的，我想就不需要了，告辭。', 
