    ['郑石氏'] = '鄭石氏', 
    ['郑石氏虽然被捕，但红旗帮还有郑石氏的义子张保仔坐镇，他联合了黑旗帮等其他海盗帮派组成大联盟，直接挑衅前来围剿的官军。这些年来，郑石氏虽然是名义上的领袖，但是更加年轻、狠辣的张保仔俨然已成长为带领红旗帮百战百胜的灵魂人物。'] = '鄭石氏雖然被捕，但紅旗幫還有鄭石氏的義子張保仔坐鎮，他聯合了黑旗幫等其他海盜幫派組成大聯盟，直接挑釁前來圍剿的官軍。這些年來，鄭石氏雖然是名義上的領袖，但是更加年輕、狠辣的張保仔儼然已成長為帶領紅旗幫百戰百勝的靈魂人物。', 
