    ['郑芝龙见局面越来越不利，不打算继续支持南明隆武皇帝了，遂与清朝洽商投降事宜，仅带心腹从人北上降清，其子郑成功劝止郑芝龙未果，父子决裂，趁着对方实力削弱，斩草除根。'] = '鄭芝龍見局面越來越不利，不打算繼續支持南明隆武皇帝了，遂與清朝洽商投降事宜，僅帶心腹從人北上降清，其子鄭成功勸止鄭芝龍未果，父子決裂，趁著對方實力削弱，斬草除根。', 
