    ['随着政治、信仰、领土及商业竞争等领域摩擦的升温，基督教国家与强大的奥斯曼帝国之间的战事已是无法避免。在希腊勒班陀近海，由西班牙王国、威尼斯共和国、教皇国、萨伏依公国、热那亚共和国及马耳他骑士团组成的神圣同盟即将与雄霸地中海的奥斯曼海军展开一场空前绝后的海战，这场战役，将最终决定的绝不仅仅是海军的胜负！'] = '隨著政治、信仰、領土及商業競爭等領域摩擦的升溫，基督教國家與強大的奧斯曼帝國之間的戰事已是無法避免。在希腊勒班陀近海，由西班牙王國、威尼斯共和國、教皇國、薩伏依公國、熱那亞共和國及馬耳他騎士團組成的神聖同盟即將與雄霸地中海的奧斯曼海軍展開一場空前絕後的海戰，這場戰役，將最終決定的絕不僅僅是海軍的勝負！', 
